INSERT INTO `majors` (`Name`, `Description`, `Average Salary`, `Expected Growth`, `No of Students`, `No of Offering Schools`) VALUES
('Accounting', 'A program that prepares individuals to practice the profession of accounting and to perform related business functions.  Includes instruction in accounting principles and theory, financial accounting, managerial accounting, cost accounting, budget control, tax accounting, legal aspects of accounting, auditing, reporting procedures, statement analysis, planning and consulting, business information systems, accounting research methods, professional standards and ethics, and applications to specific for-profit, public, and non-profit organizations.', 76089, '9.7', 82941, 1716),
('Actuarial Science', 'A program that focuses on the mathematical and statistical analysis of risk, and their applications to insurance and other business management problems.  Includes instruction in forecasting theory, quantitative and non-quantitative risk measurement methodologies, development of risk tables, secondary data analysis, and computer-assisted research methods.', 85037, '0.7', 1618, 90),
('Animal Genetics', 'A program that focuses on the scientific study of the genetics of multicellular animal life forms from the experimental, comparative, and clinical (veterinary and medical) viewpoints.  Includes instruction in molecular genetics, gene expression, gene regulation, genomics, epigenetic phenomena, DNA recombination and repair, genetic interactions at the microbial and higher levels, and molecular evolution.', 114311, '1.9', 72, 10),
('Medical Reception/Receptionist', 'A program that prepares individuals, under the supervision of office managers, nurses, or physicians, to provide customer service, visitor reception, and patient intake and discharge services.  Includes instruction in medical office and health care facility procedures, medical terminology, interpersonal skills, record-keeping, customer service, telephone skills, data entry, interpersonal communications skills, and applicable policies and regulations.', 31910, '24.0', 548, 55),
('Medical Scientist', 'An undifferentiated clinical science program that prepares clinicians to conduct clinical and translational research in various areas. Note: programs that prepare clinicians to conduct research in specific scientific fields should report under the relevant CIP code series (e.g., Series 26 Biological and Biomedical Sciences).', 107185, '6.3', 656, 54),
('Animal Physiology', 'A program that focuses on the scientific study of function, morphology, regulation, and intercellular communications and dynamics within vertebrate and invertebrate in animal species, with comparative applications to homo sapiens and its relatives and antecedents.  Includes instruction in reproduction, growth, lactation, digestion, performance, behavioral adaptation, sensory perception, motor action, phylogenetics, biotic and abiotic function, membrane biology, and related aspects of biochemistry and biophysics.', 99374, '6.8', 176, 19),
('Animal Sciences, General', 'A general program that focuses on the scientific principles that underlie the breeding and husbandry of agricultural animals, and the production, processing, and distribution of agricultural animal products.  Includes instruction in the animal sciences, animal husbandry and production, and agricultural and food products processing.', 65353, '-2.4', 6321, 109),
('Mining and Mineral Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of mineral extraction, processing and refining systems, including open pit and shaft mines, prospecting and site analysis equipment and instruments, environmental and safety systems, mine equipment and facilities, mineral processing and refining methods and systems, and logistics and communications systems.', 134251, '4.0', 517, 18),
('Mining Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers and other professionals engaged in the development and operation of mines and related mineral processing facilities.  Includes instruction in principles of mineral extraction and related geology, mineral field mapping and site analysis, testing and sampling methods, instrument calibration, assay analysis, test equipment operation and maintenance, mine environment and safety monitoring procedures, mine inspection procedures, and report preparation.', 56963, '3.2', 76, 15),
('Missions/Missionary Studies and Missiology', 'A program that focuses on the theory and practice of religious outreach, social service and proselytization, and that prepares individuals for mission vocations.  Includes instruction in theology, evangelism, preaching, medical and social mission work, missionary education, missionary aviation, emergency services, legal and political aspects of working in other countries, and preparation for ordination as missionaries.', 61353, '8.3', 1294, 133),
('Mobil Crane Operation/Operator', 'A program that prepares individuals to hoist and swing loads via complex rotating machinery that is driver operated.  Includes instruction in crane operational characteristics, load and capacity chart usage, emergency control skills, safety, specific types of mobile cranes and loading devices, applicable codes and standards, and applications to particular types of jobs and loads.', 49741, '9.8', 203, 1),
('Modeling, Virtual Environments and Simulation', 'A program focusing on the principles of applied visual simulation technology and the application of quantitative analyses to human-computer interaction.  Includes instruction in object-oriented programming, artificial intelligence, computer communications and networks, computer graphics, virtual worlds and simulation systems, probability, statistics, stochastic modeling, data analysis, human-performance evaluation, and human-behavior modeling.', 96878, '11.3', 400, 25),
('Modern Greek Language and Literature', 'A program that focuses on the development and use of the Greek language in the period dating from the late 15th century to the present.  Includes instruction in modern Greek literature, current Greek dialects, and applications to business, science/technology, and other settings.', 56350, '22.2', 4, 5),
('Molecular Biochemistry', 'A program that focuses on the scientific relationship of physiological function to the structure and actions of macromolecules and supramolecular assemblies such as multienzyme complexes, membranes, and viruses.  Includes instruction in the chemical mechanisms of regulation and catalysis, protein synthesis and other syntheses, and biomolecular chemical reactions.', 93390, '8.0', 581, 21),
('Animal Training', 'A program that prepares individuals to teach and exercise animals for leisure, sport, show, and professional purposes.  Includes instruction in animal psychology, health, and safety; human-animal interaction; learning and behavior styles associated with different breeds and species; and the technical and pedagogical aspects of training animals for such specific functions as obedient household pets, performing show animals, animal athletes, care-giving (e.g., seeing-eye dogs), search and rescue, and police/security work.', 61500, '8.7', 88, 5),
('Molecular Biology', 'A program that focuses on the scientific study of the structure and function of biological macromolecules and the role of molecular constituents and mechanisms in supramolecular assemblies and cells.  Includes instruction in such topics as molecular signaling and transduction, regulation of cell growth, enzyme substrates and mechanisms of enzyme action, DNA-protein interaction, and applications to fields such as biotechnology, genetics, cell biology, and physiology.', 99539, '7.5', 1296, 100),
('Molecular Biophysics', 'A scientific program that focuses on the dynamics and interactions of macromolecules and other three-dimensional ultrastructures, the architecture of supramolecular structures, and energy transfer in biomolecular systems.  Includes instruction in energy transduction, structural dynamics, mechanisms of electron and proton transfer in biological systems, bioinformatics, automated analysis, and specialized research techniques.', 93390, '8.0', 21, 5),
('Molecular Genetics', 'A program that focuses on the scientific study of genetic structures and mechanisms of organisms, including bacteria, phages, and viruses.  Includes instruction in the replication, expression, transfer, structure, maintenance, and stability of heritable information in DNA, RNA, and proteins; the regulation of these processes; and neurogenetics.', 103963, '7.2', 310, 22),
('Molecular Medicine', 'A program that focuses on the scientific study of the molecular and cellular basis of disease, and the application of this knowledge to the development of new clinical and diagnostic tools, medications, and therapies. Includes instruction in cell biology, molecular biology, physiology, pharmacology, biochemistry, genetics, pathology, molecular immunology, research and quantitative methods, and biomedical research computing.', 102958, '8.7', 60, 12),
('Molecular Pharmacology', 'A program that focuses on the scientific study of the biochemical and biophysical characteristics of drugs at the molecular level and their interaction with, and effects on, biological macromolecules and cellular structures and processes.  Includes instruction in molecular biology and biophysics; pharmacology of signal transduction, transmitters, and protein synthesis and release; receptors, protein interaction and binding; drug discovery and recognition; molecular toxicology; drug design; pharmacodynamics; developmental genetics; and studies of therapeutic strategies.', 93730, '8.0', 46, 11),
('Molecular Physiology', 'A program that focuses on the scientific study of dynamic interactive processes and biochemical communications at the subcellular level.  Includes instruction in ion channels and transporters, molecular signaling pathways, endocrine control and regulation, genetic information transfer, homeostasis and molecular control systems, electrophysiology and sensory mechanisms, protein synthesis, and applicable research methods and technologies.', 93730, '8.0', 27, 8),
('Molecular Toxicology', 'A program that focuses on the scientific study of the genetic determinants of susceptibility to external pollutants and poisons; the interaction of toxic agents with biological systems at the molecular and cellular levels; and the development of countermeasures and treatments.  Includes instruction in pharmacogenetics, biomolecular structure, gene expression and regulation, transgenic modeling, toxic events signaling, transcriptional activation, mutagenesis and carcinogenesis, pulmonary toxicology, xenobiotic metabolism, oxidative stress, risk assessment, molecular dosimetry, and studies of specific toxins and treatment therapies.', 93730, '8.0', 2, 3),
('Animal-Assisted Therapy', 'A program that prepares health and human service professionals to integrate the use of animals into their treatment practices in order to facilitate change in people with mental and physical disabilities. Includes instruction in psychology, psychology of disabilities, animal behavior, animal training, the human-animal bond, integration of animals into therapeutic settings, and ethical and cultural issues.', 114510, '19.0', 31, 7),
('Mortuary Science and Embalming/Embalmer', 'A program that prepares individuals for licensure as embalmers and morticians.  Includes instruction in pathogenic microbiology, systematic pathology, thanatochemistry, gross anatomy, clinical mortuary science, embalming, restorative art, applicable laws and regulations, and special services such as cremation and preparations required by specific religious communities.', 41490, '-6.0', 153, 5),
('Motorcycle Maintenance and Repair Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to repair, service, and maintain motorcycles and other similar powered vehicles.  Includes instruction in lubrication and cooling systems, electrical and ignition systems, carburetion, fuel systems and adjustments of moving parts.', 36240, '6.0', 2325, 41),
('Multicultural Education', 'A program that focuses on the design, and implementation of instructional and advising services for culturally diverse learning populations.  Includes instruction in cultural diversity, at-risk populations, multilingual and ESL education, program and curriculum design, instructional technology, information resources, LEP and minority education strategies, counseling and communicating with multicultural populations, law and regulations, and applications to specific cultural groups, educational services, and research issues.', 49781, '7.0', 255, 37),
('Museology/Museum Studies', 'A program that focuses on the attitudes, knowledge, and skills required to develop, prepare, organize, administer, conserve, store and retrieve artifacts, exhibits and entire collections in museums and galleries, and that prepares individuals to assume curatorial, technical and managerial positions in museums.  Includes instruction in institutional management, acquisition, exhibit design, conservation, packing techniques, and public relations.', 51749, '6.7', 708, 67),
('Music History, Literature, and Theory', 'A program that focuses on the study of the historical evolution of music as a social and intellectual phenomenon, the development of musical instruments and techniques, and the analysis and criticism of musical literature.  Includes instruction in music history research methods, aesthetic analysis of musical compositions, history of musical writing and notation, the development of musical instruments, the development of music theory, and the study of specific periods, cultural traditions, styles, and themes.', 76710, '11.0', 193, 73),
('Music Management', 'A program that prepares individuals to organize and manage music organizations, operations, facilities, and personnel.  Includes instruction in business and financial management; marketing and fundraising; personnel management and labor relations; event promotion and management; music products merchandising; artist agency and promotion; music law; and applications to specific activities such as managing theaters, recording studios and companies, bands and other ensembles, individual artists, and music organizations.', 73534, '9.6', 2027, 141),
('Music Teacher Education', 'A program that prepares individuals to teach music and music appreciation programs at various educational levels.', 61012, '6.4', 5053, 603),
('Music Technology', 'A program that focuses on the creative aspects of the blending of music and technology; and that prepares individuals to apply technical knowledge and skills to the composition, recording, synthesis, and performance of music; audio-visual production; scoring for film and multimedia; and software and multimedia development. Includes instruction in music theory, music history, composition, acoustics, recording technology, computer composition, electronic music synthesis, technology-based performance, 3D sound and spatial audio, and music business and law.', 72479, '9.4', 929, 71),
('Music Theory and Composition', 'A program that focuses on the study of the principles of sound manipulation as applied to the creation of music, and the techniques of creating and arranging music.  Includes instruction in aural theory, melody, counterpoint, complex harmony, modulation, chromatics, improvisation, progressions, musical writing, instrumentation, orchestration, electronic and computer applications, studies of specific musical styles, and development of original creative ability.', 73534, '9.6', 1526, 201),
('Music Therapy/Therapist', 'A program that prepares individuals, in association with a rehabilitation team or in private practice, to use music in therapeutic relationships to address patients'' physical, psychological, cognitive, emotional, and social needs.  Includes instruction in music theory and performance, human growth and development, biomedical sciences, abnormal psychology, disabling conditions, patient assessment and diagnosis, treatment plan development and implementation, clinical evaluation, record-keeping, and professional standards and ethics.', 114510, '19.0', 485, 66),
('Musical Instrument Fabrication and Repair', 'A program that prepares individuals to apply technical knowledge and skills to make, repair, maintain, and tune acoustic and electric musical instruments.  Includes instruction in methods and equipment for making musical instruments, electronic instrument amplification systems, techniques of cleaning, and methods of tuning musical instruments.', 38590, '4.0', 274, 9),
('Animation, Interactive Technology, Video Graphics and Special Effects', 'A program that prepares individuals to use computer applications and related visual and sound imaging techniques to manipulate images and information originating as film, video, still photographs, digital copy, soundtracks, and physical objects in order to communicate messages simulating real-world content.  Includes instruction in specialized camerawork and equipment operation and maintenance, image capture, computer programming, dubbing, CAD applications, and applications to specific commercial, industrial, and entertainment needs.', 70300, '6.0', 4371, 294),
('Musicology and Ethnomusicology', 'A program that focuses on the systematic study of the forms and methods of music art, and the functions of music, in Western and non-Western societies and cultures.  Includes instruction in music theory, musicological research methods, and studies of specific cultural styles such as jazz, folk music, rock, ethnic musical traditions, and the music of non-Western cultures.', 73534, '9.6', 171, 44),
('Nail Technician/Specialist and Manicurist', 'A program that prepares individuals to shape fingernails and toenails, remove unwanted skin and blemishes, apply polish and cosmetics to nails, and function as licensed manicurists or nail technicians/specialists.  Includes instruction in manicuring theory; skin anatomy; nail growth, irregularities, and diseases; sterilization and sanitation; equipment and table maintenance; cuticle, blemish, and rough skin removal; nail filing, shaping, and polishing; cream application and extremity massage; nail sculpture and design art; product storage and use; customer service; laws and regulations; and business practices.', 23630, '10.0', 9036, 703),
('National Security Policy Studies', 'A program that focuses on the theory and application of intelligence, diplomacy, military power, and related tools of statecraft to national defense policy formulation and power projection.  Includes instruction in history, political theory, public policy analysis, civil-military relations, military and defense studies, homeland security, leadership, threat scenarios, regional and local issues, alliance and coalition issues, defense budgeting and economics, intelligence, and strategy.', 110161, '4.2', 625, 19),
('Natural Products Chemistry and Pharmacognosy', 'A program that focuses on the scientific study of biologically active compounds found in naturally occurring sources such as plants, animals, and microbes and their use and/or modification as medicinal substances.  Includes instruction in medicinal chemistry, organic medicinals, pharmacological therapeutics, pharmacokinetics, molecular biology, structural chemistry, enzymes, nucleic acids, economic botany, ethnobotany, bioprospecting, bioassay, compound identification and isolation, mass spectrometry, and analytical instrumentation and techniques.', 119270, '3.0', 6, 2),
('Natural Resource Economics', 'A program that focuses on the application of economic concepts and methods to the analysis of issues such as air and water pollution, land use planning, waste disposal, invasive species and pest control, conservation policies, and related environmental problems.  Includes instruction in cost-benefit analysis, environmental impact assessment, evaluation and assessment of alternative resource management strategies, policy evaluation and monitoring, and descriptive and analytic tools for studying how environmental developments affect the economic system.', 54970, '2.0', 83, 14),
('Natural Resources Law Enforcement and Protective Services', 'A program that prepares individuals to enforce natural resource and environmental protection regulations and laws; and to perform emergency duties to protect human life, property and natural resources, including fire prevention and control measures, and emergency and rescue procedures. Includes instruction in natural and physical sciences, natural resource management, outdoor field skills, firearms and outdoor equipment and vehicle operation, evidence collection and environmental sampling and monitoring, natural resource legislation, environmental compliance techniques, patrol procedures, investigation and report writing, interpersonal skills and crisis intervention, community liaison, public safety, public education, and public relations. Note: this program was re-instated after being deleted from CIP 2000; previously, it was coded as 03.0203.', 58221, '4.7', 141, 8),
('Natural Resources Management and Policy', 'A program that prepares individuals to plan, develop, manage, and evaluate programs to protect and regulate natural habitats and renewable natural resources.  Includes instruction in the principles of wildlife and conservation biology, environmental science, animal population surveying, natural resource economics, management techniques for various habitats, applicable law and policy, administrative and communications skills, and public relations.', 64396, '7.3', 1351, 93),
('Natural Resources/Conservation, General', 'A general program that focuses on the studies and activities relating to the natural environment and its conservation, use, and improvement.  Includes instruction in subjects such as climate, air, soil, water, land, fish and wildlife, and plant resources; in the basic principles of environmental science and natural resources management; and the recreational and economic uses of renewable and nonrenewable natural resources.', 64396, '7.3', 2361, 148),
('Natural Sciences', 'A program with a combined or undifferentiated focus on one or more of the physical and biological sciences.', 125710, '2.4', 2205, 125),
('Naval Architecture and Marine Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of self-propelled, stationary, or towed vessels operating on or under the water, including inland, coastal and ocean environments; and the analysis of related engineering problems such as corrosion, power transfer, pressure, hull efficiency, stress factors, safety and life support, environmental hazards and factors, and specific use requirements.', 134034, '4.1', 442, 15),
('Apparel and Accessories Marketing Operations', 'A program that prepares individuals to perform operations connected with the distribution and sale of apparel and accessories. Includes instruction in wholesaling and retailing, apparel technologies, distribution, customer sales and service skills, and principles of consumer research and sales forecasting.', 66240, '6.0', 160, 30),
('Near and Middle Eastern Studies', 'A program that focuses on the history, society, politics, culture, and economics of one or more of the peoples of North Africa, Southwestern Asia, Asia Minor, and the Arabian Peninsula, related borderlands and island groups, and including emigrant and immigrant groups.', 81700, '15.0', 542, 63),
('Network and System Administration/Administrator', 'A program that prepares individuals to manage the computer operations and control the system configurations emanating from a specific site or network hub.  Includes instruction in computer hardware and software and applications; local area (LAN) and wide area (WAN) networking; principles of information systems security; disk space and traffic load monitoring; data backup; resource allocation; and setup and takedown procedures.', 101001, '11.0', 5692, 311),
('Neurobiology and Anatomy', 'A program that focuses on the scientific study of the structure and function of the central and peripheral nervous system in vertebrates and invertebrates. Includes instruction in molecular and cellular studies of neuronal and glial cells and circuits, neural transmitters and receptors, neuronal signaling processes, membrane and synapse structure and communication, autonomic function, nervous system circuitry and mapping, and anatomical and functional basis of central nervous system diseases and disorders.', 99539, '7.5', 752, 29),
('Neurobiology and Behavior', 'A program that focuses on the scientific study of the structure and function of the central and peripheral nervous system in vertebrates and invertebrates as it relates to control of behavior. Includes instruction in neuronal systems and circuits, higher level studies of behavior and cognition, computational neurobiology, and behavioral manifestations of central nervous system diseases and disorders.', 99539, '7.5', 131, 5),
('Neuropharmacology', 'A program that focuses on the scientific study of drugs that modify the function of the brain and central nervous system, the effects of such drugs on health, disease, perception, motor action, and behavior; and the development of countermeasures and treatment therapies.  Includes instruction in neuroanatomy, neurophysiology, behavioral neuroscience, neurobiochemistry, neuropathology, the mechanisms of brain function, medicinal chemistry, pharmaceutics, and studies of specific drugs and drug therapies.', 93730, '8.0', 11, 1),
('Neuroscience', 'A program that focuses on the interdisciplinary scientific study of the molecular, structural, physiologic, cognitive, and behavioral aspects of the brain and nervous system.  Includes instruction in molecular and cellular neuroscience, brain science, anatomy and physiology of the central nervous system, molecular and biochemical bases of information processing, behavioral neuroscience, biology of neuropsychiatric disorders, and applications to the clinical sciences and biomedical engineering.', 103963, '7.2', 5818, 234),
('Non-Profit/Public/Organizational Management', 'A program that prepares individuals to manage the business affairs of non-profit corporations, including foundations, educational institutions, associations, and other such organizations, and public agencies and governmental operations.  Includes instruction in business management, principles of public administration, principles of accounting and financial management, human resources management, taxation of non-profit organizations, and business law as applied to non-profit organizations.', 101141, '5.4', 2684, 211),
('Apparel and Textile Marketing Management', 'A program that focuses on marketing research and management as applied to the products and services of the apparel and textile industries.  Includes instruction in applicable principles of textile and apparel design and manufacturing, sales and distribution systems, domestic and international market research, profitability, consumer research, and the design and implementation of marketing campaigns.', 110897, '7.9', 672, 41),
('Norwegian Language and Literature', 'A program that focuses on the Norwegian language and related dialects. Includes instruction in philology; dialects; literature; and applications to business, science/technology, and other settings.', 56350, '22.2', 18, 4),
('Nuclear Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of systems for controlling and manipulating nuclear energy, including nuclear power plant design, fission reactor design, fusion reactor design, reactor control and safety systems design, power transfer systems, containment vessels and structures design; and the analysis of related engineering problems such as fission and fusion processes, human and environmental factors, construction, and operational considerations.', 133118, '3.3', 1110, 38),
('Nuclear Engineering Technology/Technician', 'A program that prepares individuals to apply basic engineering, knowledge and technical skills in support of engineer and other professionals operating nuclear facilities and engaged in nuclear applications and safety procedures.  Includes instruction in physics, nuclear science, nuclear systems, nuclear plant and systems design, radiological safety, radiological applications, and applicable law and regulations.', 78850, '-5.0', 333, 14),
('Nuclear Medical Technology/Technologist', 'A program that prepares individuals, under the supervision of physicians, to employ radioactive and stable nuclides in diagnostic evaluations and therapeutic applications while monitoring for patient health and safety.  Includes instruction in nuclear physics, health physics, instrumentation and statistics, biochemistry, immunology, radiopharmacology, radiation biology, clinical nuclear medicine, radionuclide therapy, computer applications, safety regulations, equipment operation, quality control, laboratory procedures, taking patient histories, patient evaluation and monitoring, emergency first aid, administration and record-keeping, and personnel supervision.', 110583, '17.3', 737, 113),
('Nuclear Physics', 'A program that focuses on the scientific study of the properties and behavior of atomic nuclei.  Includes instruction in nuclear reaction theory, quantum mechanics, energy conservation, nuclear fission and fusion, strong and weak forces, nuclear modeling, nuclear decay, nucleon scattering, pairing, photon and electron reactions, the physics of nuclear effects, statistical methods, and research equipment operation and maintenance.', 125868, '6.0', 1, 2),
('Nuclear/Nuclear Power Technology/Technician', 'A program that prepares individuals to apply scientific principles and technical skills in support of research scientists and operating engineers engaged in the running of nuclear reactors, and in nuclear materials processing and disposal.  Includes instruction in basic nuclear physics and nuclear engineering, monitoring and safety procedures, radioactive materials handling and disposal, equipment maintenance and operation, and record keeping.', 83998, '-2.9', 170, 17),
('Nurse Anesthetist', 'A program that prepares registered nurses to administer anesthetics and provide care for patients before, during and after anesthesia.  Includes instruction in the biochemistry and physics of anesthesia; advanced anatomy and physiology; clinical pharmacology of anesthetics and adjunctive drugs; pain management; acute care and operating room practice; clinical technology and procedures; emergency intervention; patient assessment and education; and legal issues.', 108611, '19.0', 1843, 77),
('Nurse Midwife/Nursing Midwifery', 'A program that prepares registered nurses to independently deliver babies and treat mothers in the prenatal, delivery, and post-delivery periods.  Includes instruction in pre-delivery screening, physician referral, and the care of infants during the delivery and immediate post-delivery phases.', 75495, '19.7', 326, 23),
('Nursing Administration', 'A program that prepares registered nurses to manage Nursing personnel and services in hospitals and other health care delivery agencies.  Includes instruction in principles of health care administration, resource and financial management, health care law and policy, medical personnel management, and managed care operations.', 74609, '16.1', 6319, 212),
('Nursing Assistant/Aide and Patient Care Assistant/Aide', 'A program that prepares individuals to perform routine nursing-related services to patients in hospitals or long-term care facilities, under the training and supervision of a registered nurse or licensed practical nurse.', 26820, '18.0', 45869, 618),
('Nursing Education', 'A program that prepares registered nurses to teach in academic and clinical settings, including staff development. Includes instruction in advanced nursing practice, nursing role development, curriculum and instruction, program and course design, clinical instruction, and evaluation of learning.', 73150, '19.0', 2086, 211),
('Nursing Practice', 'A practice-focused program that prepares registered nurses for increasingly complex evidence-based nursing practice, including translating research into practice, evaluating evidence, applying research in decision-making, and implementing viable clinical innovations to change practice. Includes instruction in healthcare delivery systems, health economics and finance, health policy, research methods, translating evidence into practice, concepts in population health, and nursing leadership.', 75743, '16.9', 4438, 218),
('Nursing Science', 'A research program that focuses on the study of advanced clinical practices, research methodologies, the administration of complex nursing services, and that prepares nurses to further the progress of nursing research through experimentation and clinical applications.', 71044, '16.1', 4408, 149),
('Nutrition Sciences', 'A scientific program that focuses on the utilization of food for human growth and metabolism, in both normal and dysfunctional states, from the interdisciplinary perspective of the agricultural, human, biological, and biomedical sciences.  Includes instruction in food science, biochemistry, physiology, dietetics, food and nutrition studies, biotechnology, biophysics, and the clinical sciences.', 82325, '10.3', 3109, 98),
('Occupational and Environmental Health Nursing', 'A program that prepares registered nurses to deliver nursing health care services to workers and worker populations in clinical settings and at job sites.  Includes instruction in public and community health, occupational safety and health, occupational health surveillance, case management, fitness for duty testing, medication, allergies and immunization, emergency and ambulatory care, and applicable laws and regulations.', 71000, '16.0', 32, 6),
('Occupational Health and Industrial Hygiene', 'A program that prepares public health specialists to monitor and evaluate health and related safety standards in industrial, commercial, and government workplaces and facilities.  Includes instruction in occupational health and safety standards and regulations; health-related aspects of various occupations and work environments; health hazard testing and evaluation; test equipment operation and maintenance; industrial toxicology; worker health and safety education; and the analysis and testing of job-related equipment, behavior practices, and protective devices and procedures.', 99370, '14.4', 308, 29),
('Appliance Installation and Repair Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to repair, install, and service major gas, electric, and microwave consumer appliances such as stoves, refrigerators, dryers, water heaters, washers, dishwashers, and commercial units such as ice makers and coffee makers.', 38820, '-3.0', 291, 18),
('Occupational Safety and Health Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers and other professionals engaged in maintaining job-related health and safety standards.  Includes instruction in safety engineering principles, inspection and monitoring procedures, testing and sampling procedures, laboratory techniques, applications to specific work environments, and report preparation.', 71790, '4.0', 3130, 74),
('Occupational Therapist Assistant', 'A program that prepares individuals, under the supervision of occupational therapists, to direct patient participation in skill-enhancing, learning, and motivational tasks; correct or diminish pathologies; and to provide direct health education and promotion services.  Includes instruction in human life span development, occupational therapy principles and practice skills, treatment planning and implementation, record-keeping and documentation, patient education and intervention, activity and program direction, and assistive services management.', 105218, '23.0', 4927, 228),
('Occupational Therapy/Therapist', 'A program that prepares individuals to assist patients limited by physical, cognitive, psychosocial, mental, developmental, and learning disabilities, as well as adverse environmental conditions, to maximize their independence and maintain optimum health through a planned mix of acquired skills, performance motivation, environmental adaptations, assistive technologies, and physical agents.  Includes instruction in the basic medical sciences, psychology, sociology, patient assessment and evaluation, standardized and non-standardized tests and measurements, assistive and rehabilitative technologies, ergonomics, environmental health, special education, vocational counseling, health education and promotion, and professional standards and ethics.', 101691, '22.1', 7245, 190),
('Ocean Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of systems to monitor, control, manipulate and operate within coastal or ocean environments, such as underwater platforms, flood control systems, dikes, hydroelectric power systems, tide and current control and warning systems, and communications equipment; the planning and design of total systems for working and functioning in water or underwater environments; and the analysis of related engineering problems such as the action of water properties and behavior on physical systems and people, tidal forces, current movements, and wave motion.', 121643, '3.9', 318, 12),
('Oceanography, Chemical and Physical', 'A program that focuses on the scientific study of the chemical components, mechanisms, structure, and movement of ocean waters and their interaction with terrestrial and atmospheric phenomena.  Includes instruction in material inputs and outputs, chemical and biochemical transformations in marine systems, equilibria studies, inorganic and organic ocean chemistry, oceanographic processes, sediment transport, zone processes, circulation, mixing, tidal movements, wave properties, and seawater properties.', 118948, '6.4', 565, 42),
('Office Management and Supervision', 'A program that prepares individuals to supervise and manage the operations and personnel of business offices and management-level divisions.  Includes instruction in employee supervision, management, and labor relations; budgeting; scheduling and coordination; office systems operation and maintenance; office records management, organization, and security; office facilities design and space management; preparation and evaluation of business management data; and public relations.', 56170, '8.0', 5476, 337),
('Oncology and Cancer Biology', 'A program that focuses on the scientific study of carcinogens; the onset of malignancy in cells, tissues, blood, and organs; the genetics of cancer; the anatomy and physiology of cancer cells; and the study of cancer behaviors and treatments.  Includes instruction in gene expression; oncogenes and tumor suppressor genes; viral genes and cancer proliferation; regulation of signal transduction; cancer proteins; hormonal and growth factors in cancer cells; tumor promotion, progression, and metastasis; carcinogen receptors and metabolism; carcinogen ecology; immunological targeting; and studies of genetic, chemical, radiologic and other treatment therapies.', 93730, '8.0', 164, 22),
('Operations Management and Supervision', 'A program that prepares individuals to manage and direct the physical and/or technical functions of a firm or organization, particularly those relating to development, production, and manufacturing.  Includes instruction in principles of general management, manufacturing and production systems, plant management, equipment maintenance management, production control, industrial labor relations and skilled trades supervision, strategic manufacturing policy, systems analysis, productivity analysis and cost control, and materials planning.', 85620, '3.5', 5320, 240),
('Operations Research', 'A program that focuses on the development and application of complex mathematical or simulation models to solve problems involving operational systems, where the system concerned is subject to human intervention.  Includes instruction in advanced multivariate analysis, application of judgment and statistical tests, optimization theory and techniques, resource allocation theory, mathematical modeling, control theory, statistical analysis, and applications to specific research problems.', 102935, '20.3', 1338, 36),
('Ophthalmic Laboratory Technology/Technician', 'A program that prepares individuals, under the supervision of ophthalmologists and optometrists, to cut, grind, edge, and finish corrective lenses and to fabricate eyewear.  Includes instruction in optical theory, applied mathematics, lens surfacing and finishing, tinting and coating, impact resistance treatment and testing, frame construction and repair, prescription interpretation, equipment operation and maintenance, follow-up adjustment, record-keeping, and laboratory safety procedures.', 32970, '10.0', 65, 2),
('Ophthalmic Technician/Technologist', 'A program that prepares individuals to assist ophthalmologists and optometrists in examining and treating patients with vision problems, vision disorders, and eye diseases.  Includes instruction in taking patient histories, administering directed treatments and topical medications, diagnostic test procedures and equipment operation, anatomical and functional ocular measurements, patient care and instruction, ophthalmic and surgical equipment maintenance, safety and sterilization procedures, and office administrative procedures.', 36690, '25.0', 264, 27),
('Opticianry/Ophthalmic Dispensing Optician', 'A program that prepares individuals to adapt and fit corrective eyewear, including eyeglasses and contact lenses, as prescribed by ophthalmologists or optometrists; to assist patients in selecting appropriate frames; and to prepare work orders for ophthalmic laboratory technicians.  Includes instruction in geometrical optics, ophthalmic optics, anatomy of the eye, optical instrumentation, use and maintenance of adjustment and cleaning tools, prescription interpretation, contact lens adaptation and fitting, prosthesis fitting, facial and eye measuring, pathology identification, record-keeping, and patient and business administrative tasks.', 36820, '24.0', 686, 37),
('Optics/Optical Sciences', 'A program that focuses on the scientific study of light energy, including its structure, properties and behavior under different conditions.  Includes instruction in wave theory, wave mechanics, electromagnetic theory, physical optics, geometric optics, quantum theory of light, photon detecting, laser theory, wall and beam properties, chaotic light, non-linear optics, harmonic generation, optical systems theory, and applications to engineering problems.', 125868, '6.0', 215, 17),
('Optometric Technician/Assistant', 'A program that prepares individuals to assist optometrists in providing patient care, administering examinations and treatments, and performing office administrative functions.  Includes instruction in applied anatomy and physiology of the eye, visual testing, patient communication, patient preparation, medications and administration, dispensing and fitting of eyeglasses and contact lenses, record-keeping, and office management skills.', 36690, '25.0', 271, 27),
('Optometry', 'A program that prepares individuals for the independent professional practice of optometry and that focuses on the principles and techniques for examining, diagnosing and treating conditions of the visual system. Includes instruction in prescribing glasses and contact lenses, other optical aids, corrective therapies, patient counseling, physician referral, practice management, and ethics and professional standards.', 115750, '27.0', 1566, 20),
('Applied Behavior Analysis', 'A program that focuses on the application of principles of learning and behavior to enhance the development, abilities, and choices of children and adults; and that prepares individuals to address the behavioral needs of individuals, especially those with developmental disabilities and autism. Includes instruction in behavior analysis and learning, behavioral and functional assessment, developmental psychology, applied behavioral analysis in developmental disabilities and autism, applied behavioral analysis in mental health and aging, research methods, evaluation of interventions, and professional and ethical issues.', 101538, '8.2', 871, 59),
('Oral Biology and Oral and Maxillofacial Pathology', 'A program that focuses on the scientific study of the growth, development, diseases, healing properties, and neurological components of the oral cavity, related tissues and organs, and associated craniofacial areas.  Includes instruction in oral microbiology microanatomy, craniofacial pain, humoral aspects of disease, etiology and histology of caries, plaque ecology, wound healing, oral disease epidemiology, oral manifestations of systemic disease, lesions, normal and pathologic physiology, and related molecular and physical studies.', 171040, '9.0', 151, 24),
('Oral/Maxillofacial Surgery', 'A program that focuses on the advanced study of the diagnosis and intrusive and adjunctive treatment of diseases, injuries, and defects of the oral and maxillofacial regions, including functional and aesthetic aspects.  Includes instruction in pharmacology, analgesia, anesthesia, anxiety control, surgical procedures and techniques, surgical instrumentation, exodontia, oral diseases and malfunctions, soft and hard tissue pathology, dentoalveolar surgery, infection management, and prosthetic implantation.', 233900, '18.0', 31, 15),
('Organic Chemistry', 'A program that focuses on the scientific study of the properties and behavior of hydrocarbon compounds and their derivatives. Includes instruction in molecular conversion and synthesis, molecular synthesis and design, the molecular structure of living cells and systems, the mutual reactivity of organic and inorganic compounds in combination, the spectroscopic analysis of hydrocarbon compounds, and applications to specific problems in research, industry, and health.', 98622, '4.6', 15, 1),
('Organizational Behavior Studies', 'A program that focuses on the scientific study of the behavior and motivations of individuals functioning in organized groups, and its application to business and industrial settings.  Includes instruction in organization theory, industrial and organizational psychology, social psychology, sociology of organizations, reinforcement and incentive theory, employee relations strategies, organizational power and influence, organization stratification and hierarchy, leadership styles, and applications of operations research and other methodologies to organizational analysis.', 67912, '5.6', 5141, 184),
('Organizational Leadership', 'A program that focuses on leadership skills that can be applied to a business, government, non-profit, or educational setting. Includes instruction in organizational planning, dynamics of leadership, finance, team building, conflict resolution and mediation, communication and other management skills.', 91825, '13.4', 7408, 318),
('Ornamental Horticulture', 'A program that focuses on  domesticated plants and plant materials used for decorative and recreational applications and prepares individuals to breed, grow, and utilize ornamental plant varieties for commercial and aesthetic purposes.  Includes instruction in applicable plant science subjects, the environmental design and artistic aspects of horticultural product usage, and the management of horticultural operations.', 51740, '4.8', 194, 33),
('Orthodontics/Orthodontology', 'A program that focuses on the advanced study of the guidance of growing dental structures and the correction of misalignments, disproportionate growth, and traumas caused by genetics, disease, injuries, and dysfunctional behaviors. Includes instruction in craniofacial growth and development, malocclusion, design and fabrication of orthodontic appliances, craniofacial alignment, physiological function and analysis, cephalometrics, model analysis, space analysis, surgical orthodontics, cleft lip and palate, and treatment planning and management.', 221390, '18.0', 255, 34),
('Orthoptics/Orthoptist', 'A program that prepares individuals, under the supervision of ophthalmologists, to analyze, evaluate, and treat specific disorders of vision, eye movement, and eye alignment in children and adults.  Includes instruction in eye anatomy, neuroanatomy, physiology, pharmacology, ophthalmic optics, diagnostic testing and measurement, orthoptic treatment therapy, systemic ocular diseases and disorders, principles of surgery, examination techniques, patient education, child psychology and development, learning disabilities, medical writing, and record-keeping.', 36690, '25.0', 7, 3);
INSERT INTO `majors` (`Name`, `Description`, `Average Salary`, `Expected Growth`, `No of Students`, `No of Offering Schools`) VALUES
('Orthotist/Prosthetist', 'A program that prepares individuals, in consultation with physicians and other therapists, to design and fit orthoses for patients with disabling conditions of the limbs and/or spine, and prostheses for patients who have partial or total absence of a limb or significant superficial deformity.  Includes instruction in biomechanics, gait analysis, pathomechanics, kinesiology, pathology, neuroanatomy, materials science, diagnostic imaging, patient analysis and measurement, impression taking, model rectification, assistive/restorative technology and engineering applications, product finishing, diagnostic and definitive fitting and alignment, power devices, postoperative management, and patient counseling and follow-up.', 107425, '18.6', 326, 18),
('Osteopathic Medicine/Osteopathy', 'A program that prepares individuals for the independent professional practice of osteopathic medicine, involving a combination of medical principles and procedures and osteopathic principles of holistic medicine and the relationship of the musculoskeletal system to general health.  Includes instruction in the basic medical sciences, preventive medicine, family and community medicine, medical informatics, disease systems, organ and physiologic systems, osteopathic principles and practice, osteopathic manipulative treatment, musculoskeletal and skin systems, clinical specialty rotations, medical ethics, and professional standards and practice management.', 196120, '13.6', 5355, 28),
('Pacific Area/Pacific Rim Studies', 'A program that focuses on the history, society, politics, culture, and economics of one or more of the peoples of Australasia and the Pacific Ocean, related island groups and bordering coastal regions, and including pre- and post-colonial migration patterns.', 81700, '15.0', 35, 5),
('Packaging Science', 'A program that focuses on the application of scientific, technological, design, and business principles to the development of packages and packaging materials, including raw material production, conversion of raw materials into usable forms, design, distribution, and post-use recycling and reuse. Includes instruction in principles of packaging, materials sciences, distribution and transportation, engineering and technology, graphic design, packaging regulations, and business and marketing.', 97022, '1.4', 413, 8),
('Painting', 'A program that prepares individuals creatively and technically to express emotions, ideas, or inner visions by the application of paints and related chemical color substances to canvases or other materials.  Includes instruction in color and color mixing, surface preparation, composition, oil and acrylic media, watercolor media, painting techniques, and personal style development.', 72015, '8.9', 922, 85),
('Painting/Painter and Wall Coverer', 'A program that prepares individuals to apply technical knowledge and skills to finish exterior and interior structural surfaces by applying protective or decorative coating materials, such as paint, lacquer, and wallpaper.  Includes instruction in surface preparation; selecting, preparing, and applying paints and other coatings; hanging wallpaper; equipment operation and maintenance; finish selection; safety and clean-up; environmental effects on finishes; adhesion properties; and applicable codes and standards..', 59057, '9.1', 31, 12),
('Paleontology', 'A program that focuses on the scientific study of extinct life forms and associated fossil remains, and the reconstruction and analysis of ancient life forms, ecosystems, and geologic processes. Includes instruction in sedimentation and fossilization processes, fossil chemistry, evolutionary biology, paleoecology, paleoclimatology, trace fossils, micropaleontology, invertebrate paleontology, vertebrate paleontology, paleobotany, field research methods, and laboratory research and conservation methods.', 121378, '6.3', 12, 4),
('Palliative Care Nursing', 'A program that prepares registered nurses to provide a combination of active and compassionate therapies intended to comfort and support patients and their families who are living with life-threatening illness. Includes instruction in pathophysiology, palliative care processes, pain management, pharmacology, loss, grief, death, and bereavement.', 71044, '16.1', 24, 9),
('Paper Science and Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development, and manufacturing of pulp and paper products. Includes instruction in pulp and paper science, pulping and bleaching processes, paper structure and processes, pulp and paper manufacturing, coating technology, surface and colloid science, and fibers.', 120122, '3.8', 32, 5),
('Parasitology', 'A program that focuses on the scientific study of biological organisms living in ecologically exploitative and competitive relationships with host organisms, and the role of parasites in causing injury, disease, and environmental damage.  Includes instruction in vector biology, immunoparasitology, medical parasitology, molecular biology of parasitical associations, veterinary and comparative parasitology, chemotherapeutics, and ecological and systematic parasitology.', 103963, '7.2', 6, 1),
('Parks, Recreation and Leisure Studies', 'A program that focuses on the principles underlying recreational and leisure activities, and the practices involved in providing indoor and outdoor recreational facilities and services for the general public.', 66090, '10.0', 3875, 171),
('Applied Horticulture/Horticulture Operations, General', 'A program that focuses on the general production and processing of domesticated plants, shrubs, flowers, foliage, trees, groundcovers, and related plant materials; the management of technical and business operations connected with horticultural services; and the basic scientific principles needed to understand plants and their management and care.', 51740, '4.8', 1852, 202),
('Parts, Warehousing, and Inventory Management Operations', 'A program that prepares individuals to provide administrative, technical, and managerial support in the operation of warehouses, control of inventory, parts identification, and the performance of counter services for customers.  Includes instruction in record-keeping, equipment operation, database entry, supply logistics, shop operations and math, and customer and supplier relations.', 48210, '2.0', 280, 17),
('Pastoral Studies/Counseling', 'A program that focuses on the theory and principles of pastoral care and prepares ordained clergy to provide non-clinical pastoral counseling to individuals and groups.  Includes instruction in pastoral leadership, counseling psychology; crisis intervention; individual and group procedures; theological and spiritual counseling; pastoral care; and applications to specific types of ministry.', 57071, '8.0', 1585, 148),
('Pathology/Experimental Pathology', 'A program that focuses on the scientific study of the expression, initiation, maintenance and progression of tissue injury and disease, including death, and the relationship of pathogenesis to fundamental molecular and cellular mechanisms.  Includes instruction in immunology, microbiology, gene expression, inflammation, cell injury, apoptosis, immunopathology, molecular markers of disease and toxins, neoplasia, growth regulation, and organ- and system-specific investigations.', 99539, '7.5', 342, 55),
('Pathology/Pathologist Assistant', 'A program that prepares individuals, under the supervision of pathologists, to assist in the performance of autopsies, obtaining and preparing surgical specimens, preparing autopsy reports, and interacting with other clinicians, officials, and individuals.  Includes instruction in anatomy; physiology; medical terminology; general, systemic, forensic, and pediatric pathology; autopsy procedures; surgical technique; medical photography; tissue preparation; record keeping and laboratory administration; interpersonal skills; and applicable standards and regulations.', 45940, '15.0', 89, 5),
('Pediatric Dentistry/Pedodontics', 'A program that focuses on the advanced study of the therapeutic and preventive care of the oral health of children from birth through adolescence, and the care of adults with physical, mental, and emotional disabilities.  Includes instruction in developmental oral biology, preventive medicine, diet therapy and counseling, patient management, pediatric restorative procedures, pulp therapy, trauma management, anesthesia, treatment planning, patient management, and the treatment of handicapped patients.', 172350, '18.0', 106, 19),
('Applied Mathematics, General', 'A program that focuses on the application of mathematics and statistics to the solution of functional problems in fields such as engineering and the applied sciences.  Includes instruction in natural phenomena modeling continuum mechanics, reaction-diffusion, wave propagation, dynamic systems, numerical analysis, controlled theory, asymptotic methods, variation, optimization theory, inverse problems, and applications to specific scientific and industrial topics.', 102967, '15.2', 3303, 230),
('Pediatric Nurse/Nursing', 'A program that prepares registered nurses to provide care for children from infancy through adolescence.  Includes instruction in the administration of medication and treatments, assisting physicians, patient examination and referral, and planning and delivering health maintenance and health education programs.', 72443, '16.9', 353, 45),
('Perfusion Technology/Perfusionist', 'A program that prepares individuals, under the supervision of physicians and nurses, to operate extracorporeal circulation and autotransfusion equipment during medical procedures and surgeries where the support or temporary replacement of a patient''s own respiratory or circulatory system is required.  Includes instruction in equipment selection and operation, physician and medical team consultation, patient condition monitoring, procedural techniques, and principles of respiratory and circulatory physiology.', 101474, '19.7', 80, 9),
('Periodontics/Periodontology', 'A program that focuses on the advanced study of the etiology and treatment of diseases of the gingivae (gum tissue) and supporting bone, nerve, and vascular structures.  Includes instruction in periodontium pathology, diagnostic procedures and equipment, occulsion, nutritional aspects of periodontology, surgical treatments, and patient care and management.', 171040, '9.0', 122, 27),
('Perioperative/Operating Room and Surgical Nurse/Nursing', 'A program that prepares registered nurses to provide care to patients before and during surgery, and provide tableside assistance to surgeons. Includes instruction in operating room safety and preparation, aseptic technique, anesthesia, patient preparation, surgical instruments and procedures, sterilization and disinfecting, surgical drugs and solutions, hemostasis, emergency procedures, and patient/family education.', 71044, '16.1', 124, 14),
('Permanent Cosmetics/Makeup and Tattooing', 'A program that prepares individuals to prepare and apply permanent markings, color, and cosmetic products to the face and body for aesthetic or clinical purposes; to remove unwanted markings; and to function as licensed permanent makeup artists and tattooists.  Includes instruction in client consultation; sterilization and sanitation; skin anatomy, diseases, and disorders; skin preparation and anesthetics; color theory; machine theory and operation; needle selection; applications such as eyebrows, eyeliners, lips, lipliners, beauty marks, and blemish/mark removal; after care; laws and regulations; and business practices.', 29099, '10.1', 4, 2),
('Aquaculture', 'A program that prepares individuals to select, culture, propagate, harvest, and market domesticated fish, shellfish, and marine plants, both freshwater and saltwater.  Includes instruction in the basic principles of aquatic and marine biology; health and nutrition of aquatic and marine life; design and operation of fish farms, breeding facilities, culture beds, and related enterprises; and related issues of safety, applicable regulations, logistics, and supply.', 64878, '-3.1', 154, 16),
('Personality Psychology', 'A program that focuses on the unique organization of fairly permanent characteristics that set the individual apart from other individuals and, at the same time, determine how others respond to that individual.   Includes instruction in Freudian, Skinnerian, Rogerian, and Ellisonian psychology; neo-Freudian psychology; psychological systems, neurophysiology, and psychopharmacology.', 107840, '5.3', 34, 4),
('Petroleum Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of systems for locating, extracting, processing and refining crude petroleum and natural gas, including prospecting instruments and equipment, mining and drilling systems, processing and refining systems and facilities, storage facilities, transportation systems, and related environmental and safety systems.', 137198, '4.7', 2339, 26),
('Petroleum Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers and other professionals engaged in the development and operation of oil and natural gas extraction and processing facilities.  Includes instruction in principles of petroleum extraction and related geology, petroleum field mapping and site analysis, testing and sampling methods, instrument calibration, laboratory analysis, test equipment operation and maintenance, environment and safety monitoring procedures for oil/gas fields and facilities, facility inspection procedures, and report preparation.', 60710, '12.0', 1196, 36),
('Pharmaceutical Marketing and Management', 'A program that combines the study of basic and pharmaceutical sciences with marketing and management studies; and that prepares individuals for careers in pharmaceutical sales, marketing, management, and related fields within the health care industry. Includes instruction in biology, chemistry, pharmaceutics, pharmacology, health care systems, issues and structure of pharmaceutical industry, management, pharmaceutical marketing, pharmaceutical and medical product management, and legal issues.', 133949, '6.4', 99, 7),
('Pharmaceutical Sciences', 'A program that focuses on the basic sciences that underlie drugs and drug therapy and that prepares individuals for further study and/or careers in pharmaceutical science and research, pharmaceutical administration and sales, biotechnology, drug manufacturing, regulatory affairs, and related fields. Includes instruction in mathematics, biology, chemistry, physics, statistics, pharmaceutics, pharmacology and toxicology, dosage formulation, manufacturing, quality assurance, and regulations.', 112603, '4.3', 1126, 42),
('Pharmaceutics and Drug Design', 'A program that focuses on the scientific study of the formulation of medicinal substances into product vehicles capable of being stored, transported, and then introduced into the patient and behaving in ways optimal to therapeutic interaction.  Includes instruction in statistics, biopharmaceutics, drug metabolism, pharmacokinetics, pharmacodynamics, physical pharmacy, pharmacological analysis, drug design and development, pharmacological biotechnology, chemical separations, spectroscopy, drug-host interactions, immunology, quantitative drug measurement, enzymatic transformations, and metabolic excretion.', 119270, '3.0', 421, 36),
('Pharmacoeconomics/Pharmaceutical Economics', 'A program that focuses on the application of economics and policy analysis to the study of the relationship of pharmacy services and pharmaceutical processes and products to the health care system and their impact on health care organizations.  Includes instruction in health economics, pharmacoeconomics, health care systems, health care organization and management, statistics and biostatistics, outcomes research, health care policy, pharmacy services, and pharmaceutical industry operations.', 119270, '3.0', 136, 6),
('Pharmacology', 'A program that focuses on the scientific study of drug interactions on biological systems and organisms and the sources, chemical properties, biological effects, and therapeutic uses of drugs.  Includes instruction in pharmacodynamics, pharmacokinetics, toxicology, drug therapeutics, drug action, bodily responses to drug events, biochemical proliferation and differentiation, apoptosis, cell biology, medicinal chemistry, and studies of specific drugs and drug interactions.', 99539, '7.5', 487, 72),
('Pharmacology and Toxicology', 'A program with an integrated, combined approach to the study of pharmacological and toxicological issues in biology and the biomedical sciences.  Includes instruction in topics such as solvents, xenobiotic metabolism, chemical toxicity, neurotoxicology, immunopharmacology, biotransformation, tissue culture and in vitro studies, biomolecular analysis, bioactivation and inactivation, enzyme regulation, chemoprevention and chemotherapy, industrial  and chemical studies, radiation health, and bioinformatics.', 93730, '8.0', 215, 20),
('Pharmacy', 'A program that prepares individuals for the independent or employed practice of preparing and dispensing drugs and medications in consultation with prescribing physicians and other health care professionals, and for managing pharmacy practices and counseling patients.   Includes instruction in mathematics, physics, chemistry, biochemistry, anatomy, physiology, pharmacology, pharmaceutical chemistry, pharmacognosy, pharmacy practice, pharmacy administration, applicable regulations, and professional standards and ethics.', 117475, '9.0', 15341, 130),
('Pharmacy Administration and Pharmacy Policy and Regulatory Affairs', 'A program that prepares individuals to apply managerial, social, and economic sciences to the study and management of the distribution and use of pharmaceutical products and the provision of pharmacy services.  Includes instruction in research design and methods, statistics, social and organizational behavior, pharmacoeconomics, management of pharmacy services, outcomes research, product planning and reimbursement, cost-benefit analysis, drug marketing, pharmacy and pharmaceutics law and regulation, risk assessment, and organization of the health care system.', 117475, '9.0', 356, 25),
('Pharmacy Technician/Assistant', 'A program that prepares individuals, under the supervision of pharmacists, to prepare medications, provide medications and related assistance to patients, and manage pharmacy clinical and business operations.  Includes instruction in medical and pharmaceutical terminology, principles of pharmacology and pharmaceutics, drug identification, pharmacy laboratory procedures, prescription interpretation, patient communication and education, safety procedures, record-keeping, measurement and testing techniques, pharmacy business operations, prescription preparation, logistics and dispensing operations, and applicable standards and regulations.', 58220, '12.2', 14685, 713),
('Philosophy', 'A program that focuses on ideas and their logical structure, including arguments and investigations about abstract and real phenomena.  Includes instruction in logic, ethics, aesthetics, epistemology, metaphysics, symbolism, and history of philosophy, and applications to the theoretical foundations and methods of other disciplines.', 75140, '12.0', 9316, 891),
('Philosophy and Religious Studies, General', 'A general program that combines the study of philosophy and religious studies. Includes instruction in logic; ethics; epistemology; symbolism; phenomenology; the sociology, psychology, philosophy, anthropology, literature, and art of religion; and world religions.', 75140, '12.0', 148, 45),
('Phlebotomy Technician/Phlebotomist', 'A program that prepares individuals, under the supervision of physicians and other health care professionals, to draw blood samples from patients using a variety of intrusive procedures.  Includes instruction in basic vascular anatomy and physiology, blood physiology, skin puncture techniques, venipuncture, venous specimen collection and handling, safety and sanitation procedures, and applicable standards and regulations.', 32770, '25.0', 8132, 347),
('Arabic Language and Literature', 'A program that focuses on the Arabic language. Includes instruction in philology; Classical Arabic; Modern Standard Arabic; dialects; and applications to business, science/technology, and other settings.', 56350, '22.2', 270, 44),
('Photographic and Film/Video Technology/Technician and Assistant', 'A program that prepares individuals to apply technical knowledge and skills to the operation and maintenance of camera and lighting equipment and the production of finished still, video, and film products under the supervision of photographers, directors, and editors.  Includes instruction in equipment setup and maintenance; lighting; power supplies; studio and film set tasks such as camera operator, grip, and best boy; plate and negative handling and development; laboratory procedures; and digital software applications.', 46630, '12.0', 1028, 96),
('Photography', 'A program that focuses on the principles and techniques of communicating information, ideas, moods, and feelings through the creation of images on photographic film, plates, and digital images and that may prepare individuals to be professional photographic artists.  Includes instruction in camera and equipment operation and maintenance, film and plate developing, light and composition, films and printing media, color and special effects, photographic art, photographic history, use of computer applications to record or enhance images and applications to the photography of various subjects.', 64417, '8.3', 3253, 259),
('Photojournalism', 'A program that focuses on the use of still and motion photography in journalism and prepares individuals to function as news photographers and photographic editors.  Includes instruction in photography, journalism, studio procedures and techniques, camera and equipment operation and technique, news editing, print and film editing, news scene composition, subject surveillance, media law and policy, news team field operations, and professional standards and ethics.', 51770, '2.7', 185, 19),
('Physical and Biological Anthropology', 'A program that focuses on the application of the biological sciences and anthropology to the study of the adaptations, variability, and the evolution of human beings and their living and fossil relatives.  Includes instructions in anthropology, human and mammalian anatomy, cell biology, paleontology, human culture and behavior, neuroscience, forensic anthropology, anatomical reconstruction, comparative anatomy, and laboratory science and methods.', 109991, '4.1', 47, 7),
('Physical Chemistry', 'A program that focuses on the scientific study of understanding and predicting the behavior of chemical systems ranging from nuclear particles to atoms, molecules, clusters, biological materials and macroscopic assemblies.  Includes instruction in quantum mechanics, spectroscopy, thermodynamics, statistical mechanics, reaction dynamics, group theory, collision theory, and polymer science.', 98622, '4.6', 11, 3),
('Physical Education Teaching and Coaching', 'A program that prepares individuals to teach physical education programs and/or to coach sports at various educational levels.', 55902, '6.3', 10598, 606),
('Physical Fitness Technician', 'A program that prepares individuals for employment in health and fitness clubs, wellness centers, public and private recreation facilities, hospitals and corporate fitness programs where they will perform a variety of instructional and administrative duties. Includes instruction in human anatomy and physiology, fitness techniques, exercise science, personal training, nutrition, and customer service.', 41506, '9.2', 1759, 128),
('Physical Sciences', 'A program that focuses on the major topics, concepts, processes, and interrelationships of physical phenomena as studied in any combination of physical science disciplines.', 64444, '5.8', 3685, 223),
('Physical Therapy Technician/Assistant', 'A program that prepares individuals, under the supervision of a physical therapist, to implement physical therapy treatment care plans, train patients, conduct treatment interventions, use equipment, and observe and record patient progress.  Includes instruction in applied anatomy and physiology, applied kinesiology, principles and procedures of physical therapy, basic neurology and orthopedics, physical therapy modalities, documentation skills, psychosocial aspects of health care, wound and injury care, electrotherapy, working with orthotics and prostheses, and personal and professional ethics.', 55250, '41.0', 7439, 374),
('Physical Therapy/Therapist', 'A program that prepares individuals to alleviate physical and functional impairments and limitations caused by injury or disease through the design and implementation of therapeutic interventions to promote fitness and health.  Includes instruction in functional anatomy and physiology, kinesiology, neuroscience, pathological physiology, analysis of dysfunction, movement dynamics, physical growth process, management of musculoskeletal disorders, clinical evaluation and measurement, client assessment and supervision, care plan development and documentation, physical therapy modalities, rehabilitation psychology, physical therapy administration, and professional standards and ethics.', 99012, '27.1', 11598, 254),
('Physician Assistant', 'A program that prepares individuals to practice medicine, including diagnoses and treatment therapies, under the supervision of a physician.  Includes instruction in the basic medical and clinical sciences and specialized preparation in fields such as family medicine, pediatrics, obstetrics, gynecology, general surgery, psychiatry, and behavioral medicine; the delivery of health care services to homebound patients, rural populations, and underserved populations; and community health services.', 109100, '22.9', 8106, 184),
('Physics, General', 'A general program that focuses on the scientific study of matter and energy, and the formulation and testing of the laws governing the behavior of the matter-energy continuum.  Includes instruction in classical and modern physics, electricity and magnetism, thermodynamics, mechanics, wave properties, nuclear processes, relativity and quantum theory, quantitative methods, and laboratory methods.', 65656, '6.0', 11242, 885),
('Physics Teacher Education', 'A program that prepares individuals to teach physics programs at various educational levels.', 61353, '6.3', 119, 129),
('Physiological Psychology/Psychobiology', 'A program that focuses on the scientific course study of the biological bases of psychological functioning, and their application to experimental and therapeutic research problems.  Includes instruction in functional neuroanatomy, neural system development, biochemical neural regulatory mechanisms, neurological biophysics, memory storage and retrieval, physiology of cognition and perception, physiological bases of psychopathology and behavioral disorders, psychopharmacology, comparative psychobiology, and specialized experimental design and research methods.', 107840, '5.3', 1212, 29),
('Physiology, General', 'A general program that focuses on the scientific study of the functional dynamics, morphology, and biochemical and biophysical communications within organisms and between living systems at all levels of complexity and integration.  Includes instruction in reproduction, growth, hormonal action, vascular function, respiration, digestion, sensory perception and processing, sensorimotor integration, signal encoding and conveyance, homeostasis, physical function and malfunction, evolutionary physiology, and disease processes.', 93730, '8.0', 2422, 76),
('Pipefitting/Pipefitter and Sprinkler Fitter', 'A program that prepares individuals to design, install, and test industrial and commercial piping systems and automatic fire and exposure protection systems.  Includes instruction in water systems, steam systems, heating and cooling systems, lubricating systems, piping materials, installation tools operation and maintenance, valve installation and repair, technical mathematics, blueprint interpretation, and applicable codes and standards.', 61771, '10.9', 485, 40),
('Planetary Astronomy and Science', 'A program that focuses on the scientific study of planets, small objects, and related gravitational systems.  Includes instruction in the structure and composition of planetary surfaces and interiors, planetary atmospheres, satellites, orbital mechanics, asteroids and comets, solar system evolution and dynamics, planetary evolution, gravitational physics, and radiation physics.', 128614, '4.0', 54, 9),
('Plant Genetics', 'A program that focuses on the scientific study of the genetics of multicellular plants and fungi as related to botanical research as well as to applications in comparative genetics, ecology and evolutionary studies, clinical studies, and industrial research.  Includes instruction in molecular genetics, gene expression, gene regulation, genomics, epigenetic phenomena, DNA recombination and repair, genetic interactions at the microbial and higher levels, and molecular evolution.', 103963, '7.2', 21, 3),
('Plant Nursery Operations and Management', 'A program that prepares individuals to operate and manage outdoor plant farms, tree and shrub nurseries, and related facilities that develop domesticated plant products for propagation, harvesting, and transplantation.  Includes instruction in applicable principles of plant science, farm and business management, nursery operations, equipment operation and maintenance, safety procedures, and personnel supervision.', 48808, '4.7', 191, 38),
('Plant Pathology/Phytopathology', 'A program that focuses on the scientific study of plant diseases and plant health, and the development of disease control mechanisms.  Includes instruction in plant anatomy and physiology, pathogenesis, molecular plant virology, molecular genetics, bacterial epidemiology, causal agent identification, host/agent interactions, disease resistance and response mechanisms, developing plant disease treatments, disease prevention, and disease physiology and control.', 103963, '7.2', 156, 25),
('Plant Physiology', 'A program that focuses on the scientific study of plant internal dynamics and systems, plant-environment interaction, and plant life cycles and processes.  Includes instruction in cell and molecular biology; plant nutrition; plant respiration; plant growth, behavior, and reproduction; photosynthesis; plant systemics; and ecology.', 103963, '7.2', 14, 5),
('Plant Protection and Integrated Pest Management', 'A program that focuses on the application of scientific principles to the control of animal, insect and weed infestation of domesticated plant populations and other settings, including agricultural crops; the prevention/reduction of attendant economic loss; and the control of environmental pollution and degradation related to pest infestation and pest control measures. Includes instruction in entomology, applicable animal sciences, plant pathology and physiology, weed science, crop science, and environmental toxicology.', 76471, '5.3', 87, 19),
('Plant Sciences, General', 'A general program that focuses on the scientific principles that underlie the breeding, cultivation, and production of agricultural plants, and the production, processing, and distribution of agricultural plant products.  Includes instruction in the plant sciences, crop cultivation and production, and agricultural and food products processing.', 65215, '0.0', 584, 40),
('Architectural Drafting and Architectural CAD/CADD', 'A program that prepares individuals to apply technical knowledge and skills to develop working drawings and electronic simulations for architectural and related construction projects.  Includes instruction in basic construction and structural design, architectural rendering, architectural-aided drafting (CAD), layout and designs, architectural blueprint interpretation, building materials, and basic structural wiring diagramming.', 53470, '-3.0', 1244, 170),
('Platemaker/Imager', 'A program that prepares individuals to apply technical knowledge and skills to prepare film, digital data, and surfaces to reproduce printed or graphic images.  Includes instruction in platemaking, stripping, camerawork, imposition, digital imaging, computer direct-to-plate and direct-to-press, and related processes.', 40060, '-25.0', 14, 5),
('Playwriting and Screenwriting', 'A program that focuses on the principles and techniques for communicating dramatic information, ideas, moods, and feelings through the composition of creative written works for the theatre, film, and/or television. Includes instruction in creative writing craft, scene writing, script development, stage and/or camera instructions, line and moment analysis, script reading, script editing, and the creation of full productions.', 74389, '8.2', 517, 47),
('Plumbing Technology/Plumber', 'A program that prepares individuals to practice as licensed plumbers by applying technical knowledge and skills to lay out, assemble, install, and maintain piping fixtures and systems for steam, natural gas, oil,  hot water, heating, cooling, drainage, lubricating, sprinkling, and industrial processing systems in home and business environments.  Includes instruction in source determination, water distribution, waster removal, pressure adjustment, basic physics, technical mathematics, blueprint reading, pipe installation, pumps, welding and soldering, plumbing inspection, and applicable codes and standards.', 61080, '11.0', 1400, 133),
('Podiatric Medicine/Podiatry', 'A program that prepares individuals for the independent professional practice of podiatric medicine, involving the prevention, diagnosis, and treatment of diseases, disorders, and injuries to the foot and lower extremities.  Includes instruction in the basic medical sciences, anatomy of the lower extremity, functional orthopedics, foot biomechanics, podiatric radiology, dermatology, podiatric surgery, podopediatrics, sports medicine, physical diagnosis, emergency medicine and traumatology, practice management, and professional standards and ethics.', 136180, '14.0', 574, 9),
('Architectural Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of materials, systems, and methods used to construct and equip buildings intended for human habitation or other purposes.', 120871, '4.0', 824, 26),
('Polish Language and Literature', 'A program that focuses on the Polish language.  Includes instruction in philology; dialects; literature; and applications to business, science/technology, and other settings.', 56350, '22.2', 9, 3),
('Political Communication', 'A program that focuses on human and media communication in the political process and that prepares individuals to function as members of political and public affairs organizations, political campaign staffs, and related government and media entities.  Includes instruction in media effects, political speaking and debating, political advertising and marketing, image management, political journalism, opinion polling, and aspects of print and broadcast media related to the production and distribution of media messages in political settings.', 63955, '4.1', 96, 10),
('Political Economy', 'A program that focuses on the interaction between politics and economics in the formation of public policy.  Includes instruction in microeconomics; macroeconomics; political theory; American, comparative, and international political economy; and quantitative methods.', 110020, '4.5', 257, 19),
('Political Science and Government, General', 'A  general program that focuses on the systematic study of political institutions and behavior.  Includes instruction in political philosophy, political theory, comparative government and politics, political parties and interest groups, public opinion, political research methods, studies of the government and politics of specific countries, and studies of specific political institutions and processes.', 110161, '4.2', 42646, 1233),
('Polymer Chemistry', 'A program that focuses on the scientific study of synthesized macromolecules and their interactions with other substances.  Includes instruction in molecular bonding theory, polymerization, properties and behavior of unstable compounds, the development of tailored polymers, transition phenomena, and applications to specific industrial problems and technologies.', 98622, '4.6', 84, 9),
('Polymer/Plastics Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of synthesized macromolecular compounds and their application to specific engineering uses, including the development of industrial materials with tailored properties, the design of lightweight structural components, the use of liquid or solid polymers, and the analysis and control of polymerization processes.', 130732, '3.6', 278, 14),
('Portuguese Language and Literature', 'A program that focuses on the Portuguese language and related dialects. Includes instruction in philology; Metropolitan Portuguese; Luso-Brazilian Portuguese; dialects; and applications in business, science/technology, and other settings.', 56350, '22.2', 102, 32),
('Poultry Science', 'A program that focuses on the application of biological and chemical principles to the production and management of poultry animals and the production and handling of poultry products.  Includes instruction in avian sciences, nutrition sciences, food science and technology, biochemistry, hatchery design, and related aspects of human and animal health and safety.', 65353, '-2.4', 141, 12),
('Architectural History and Criticism, General', 'A general program that focuses on the aesthetic, technical, and social development of the built environment and the architectural profession from earliest times to the present.  Includes instruction in the principles of architecture and related fields; art history; historiography of architecture; architectural theory and criticism; related aspects of the history of technology and social and economic history; and various period, cultural, and stylistic specializations.', 82174, '6.8', 122, 21),
('Pre-Theology/Pre-Ministerial Studies', 'A program that prepares individuals to enter a seminary or other program leading to religious ordination, or a related religious vocation.', 57071, '8.0', 241, 49),
('Prepress/Desktop Publishing and Digital Imaging Design', 'A program that prepares individuals to apply technical knowledge and skills to the layout, design and typographic arrangement of printed and/or electronic graphic and textual products.  Includes instruction in printing and lithographic equipment and operations, computer hardware and software, digital imaging, print preparation, page layout and design, desktop publishing, and applicable principles of graphic design and web page design.', 41107, '-23.9', 930, 138),
('Printing Management', 'A program that prepares individuals to apply technical and managerial knowledge and skills to the processes and procedures of managing printing operations from initial design through finished product distribution.  Includes instruction in the principles of graphic communications design and production; quality control; printing operations management; computerization; printing plant management; business finance and marketing; logistics and distribution; personnel supervision and leadership; and professional standards in the graphic communications industry.', 37547, '-14.3', 78, 8),
('Printing Press Operator', 'A program that prepares individuals to apply technical knowledge and skills to set up, operate, and maintain printing presses.', 37547, '-14.3', 33, 6),
('Printmaking', 'A program that prepares individuals creatively and technically to express emotions, ideas, or inner visions by rendering art concepts onto surfaces and transferring images, via ink or dyes, onto paper or fabric.  Includes instruction in monochrome and color printing; tonality; chemistry; equipment set-up and maintenance; techniques such as serigraphy, lithography, intaglio, woodcut, block, stencil, relief, etching, and composite; and personal style development.', 72462, '9.7', 202, 55),
('Professional, Technical, Business, and Scientific Writing', 'A program that focuses on professional, technical, business, and scientific writing; and that prepares individuals for academic positions or for professional careers as writers, editors, researchers, and related careers in business, government, non-profits, and the professions. Includes instruction in theories of rhetoric, writing, and digital literacy; document design, production, and management; visual rhetoric and multimedia composition; documentation development; usability testing; web writing; and publishing in print and electronic media.', 68978, '3.2', 1756, 158),
('Programs for Foreign Lawyers', 'A program that prepares lawyers educated outside the United States to understand U. S. or Canadian law and jurisprudence.', 136260, '6.0', 1244, 46),
('Project Management', 'A program that prepares individuals to apply quantitative and qualitative knowledge, skills, tools, and techniques to manage projects in a wide range of fields and occupations.  Includes instruction in project planning, risk management, cost and time management, contracts and procurement, accounting, statistics, decision making, and human resources.', 107732, '4.9', 3106, 225),
('Prosthodontics/Prosthodontology', 'A program that focuses on the advanced study of the restoration and maintenance of teeth, oral function, and aesthetic form through the use of single or compound materials, structures, and artificial devices.  Includes instruction in implant dentistry, surgical procedures, denture design and fabrication, fixed and removable prosthodontics, restorative techniques, occlusion therapy and devices, geriatric dentistry, cosmetic dentistry, and tempromandibular joint dysfunction.', 161020, '18.0', 85, 19),
('Psychiatric/Mental Health Nurse/Nursing', 'A program that prepares registered nurses to promote mental health and provide nursing care to patients with mental, emotional or behavioral disorders, in mental institutions or other settings.  Includes instruction in psychopathology, behavioral health, counseling and intervention strategies, psychoeducation, mental health assessment and dual diagnosis, stabilization and management of psychotic illness, psychiatric care and rehabilitation, substance abuse, and crisis intervention.', 72443, '16.9', 369, 69),
('Psychiatric/Mental Health Services Technician', 'A program that prepares individuals, under the supervision of psychiatrists, psychologists, nurses, and other mental health care professionals, to provide direct patient care services, assist in developing and implementing treatment plans, administer medications, and perform related administrative functions.  Includes instruction in mental health theory, applied psychopathology, patient communication and management, crisis intervention, psychotropic medication, mental health treatment procedures, substance abuse, record-keeping, clinical administrative skills, and applicable standards and regulations.', 31873, '5.0', 3165, 110),
('Psychoanalysis and Psychotherapy', 'A program that prepares individuals to practice the provision of psychoanalytic counseling to individuals and groups based on the psychodynamic principles evolved from authorities such as Freud, Adler, and Jung.  Includes instruction in self-analysis, personality theory, dream analysis, free association and transference theory and techniques, psychodynamic theory, developmental processes, applications to specific clinical conditions, practice management, and professional standards and ethics.', 76040, '20.0', 16, 3),
('Psychology, General', 'A general program that focuses on the scientific study of individual and collective behavior, the physical and environmental bases of behavior, and the analysis and treatment of behavior problems and disorders.  Includes instruction in the principles of the various subfields of psychology, research methods, and psychological assessment and testing methods.', 101521, '8.2', 132401, 1680),
('Psychology Teacher Education', 'A program that prepares individuals to teach general psychology at the secondary school level.', 60440, '6.0', 17, 20),
('Psychometrics and Quantitative Psychology', 'A program that focuses on the mathematical and statistical procedures used in psychological test construction and validation; the general problems of the measurement of behavior; and the application of quantitative methods to research design and other methodological topics.', 107840, '5.3', 32, 11),
('Architecture', 'A program that prepares individuals for the independent professional practice of architecture and to conduct research in various aspects of the field.  Includes instruction in architectural design, history, and theory; building structures and environmental systems; project and site planning; construction; professional responsibilities and standards; and related cultural, social, economic, and environmental issues.', 120543, '3.9', 10480, 159),
('Public Finance', 'A program that prepares individuals to manage the financial assets and budgets of public sector organizations.  Includes instruction in public trusts and investments; the laws and procedures used to plan, prepare and administer public agency budgets; and the preparation and analysis of public budget projections and policies.', 115859, '8.4', 25, 5),
('Public Health Education and Promotion', 'A program that focuses on  the application of educational and communications principles and methods to the promotion of preventive health measures and the education of targeted populations on health issues, and prepares individuals to function as public health educators and health promotion specialists.  Includes instruction in human development, health issues across the life span, population-specific health issues, principles and methods of public health education, administration of health education campaigns and programs, evaluation methods, public communications, and applications to specific public health subjects and issues.', 90239, '16.9', 3475, 132),
('Public Health/Community Nurse/Nursing', 'A program that prepares registered nurses to promote health and provide preventive and curative nursing services for groups or communities under the supervision of a public health agency.  Includes instruction in community and rural health, family therapy and intervention, disease prevention, health education, and community health assessment.', 71044, '16.1', 249, 38),
('Public Policy Analysis, General', 'A program that focuses on the systematic analysis of public policy issues and decision processes.  Includes instruction in the role of economic and political factors in public decision-making and policy formulation, microeconomic analysis of policy issues, resource allocation and decision modeling, cost/benefit analysis, statistical methods, and applications to specific public policy topics.', 56043, '1.4', 4859, 140),
('Public Relations, Advertising, and Applied Communication', 'A general program that focuses on organizational communication, public relations, and advertising; and that prepares individuals to function in a wide range of public and private sector positions requiring the skills of persuasive communication. Includes instruction in communications, public relations, and advertising theory; principles and techniques of persuasion; message/image design; marketing strategy; professional writing; public speaking and multi-media presentation skills; digital communications; and applied research.', 79942, '6.4', 1822, 99),
('Public/Applied History', 'A program that focuses on the application of history and administrative skills to the recording of public events and the management of related historical resources. Includes instruction in historical research methods, the planning and administration of public history projects, and applications to specific problems in public organizations, government agencies, foundations, and other facilities.', 105109, '4.5', 242, 44),
('Publishing', 'A program that focuses on the process of managing the creation, publication, and distribution of print and electronic books and other text products and prepares individuals to manage the editorial, technical, and business aspects of publishing operations.  Includes instruction in product planning and design, editing, author relations, business and copyright law, publishing industry operations, contracting and purchasing, product marketing, electronic publishing and commerce, history of publishing, and professional standards and ethics.', 64910, '-5.0', 233, 13);
INSERT INTO `majors` (`Name`, `Description`, `Average Salary`, `Expected Growth`, `No of Students`, `No of Offering Schools`) VALUES
('Quality Control Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers and other professionals engaged in maintaining consistent manufacturing and construction standards.  Includes instruction in quality control systems management principles, technical standards applicable to specific engineering and manufacturing projects, testing procedures, inspection procedures, related instrumentation and equipment operation and maintenance, and report preparation.', 39410, '0.0', 687, 70),
('Rabbinical Studies', 'A program that prepares individuals for ordination as Rabbis. Includes instruction in Talmud, Halacha, Liturgy and Rituals, Rabbinical Thought, Jewish Ethics, Jewish Education, Pastoral Counseling and Homiletics.', 57071, '8.0', 181, 14),
('Radiation Biology/Radiobiology', 'A program that focuses on the  effects of radiation on organisms and biological systems.  Includes instruction in particle physics, ionization, and biophysics of radiation perturbations, cellular and organismic repair systems, genetic and pathological effects of radiation, and the measurement of radiation dosages.', 103963, '7.2', 32, 7),
('Radiation Protection/Health Physics Technician', 'A program that prepares individuals, under the supervision of health physicists, occupational safety and health specialists, and public health officials, to monitor and control radiation exposure and implement preventive measures in health care, work, and natural environments.  Includes instruction in radiation physics, environmental radioactivity, radiological instrumentation, electronics of radiation detection equipment, radioactive waste management and control, safety and handling procedures, decontamination procedures, radioactivity testing and analysis, and communications skills.', 59220, '5.0', 83, 11),
('Archives/Archival Administration', 'A program that prepares individuals to identify, manage, preserve, and make available records with long-term value for documentation, legal, research, and other purposes. Includes instruction in appraisal and collection development, information and records management, archival preservation, access systems, management of electronic records, archival outreach, and legal and ethical issues.', 110410, '4.0', 42, 10),
('Radio and Television', 'A program that focuses on the theories, methods, and techniques used to plan, produce, and distribute audio and video programs and messages, and that prepares individuals to function as staff, producers, directors, and managers of radio and television shows and media organizations.  Includes instruction in media aesthetics; planning, scheduling, and production; writing and editing; performing and directing; personnel and facilities management; marketing and distribution; media regulations, law, and policy; and principles of broadcast technology.', 78784, '6.3', 7346, 216),
('Radio and Television Broadcasting Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to the production of radio and television programs, and related operations, under the supervision of broadcast and studio managers, directors, editors, and producers.  Includes instruction in sound, lighting, and camera operation and maintenance; power and feed control; studio operations; production preparation; broadcast engineering; related computer applications; and specialized applications such as news, entertainment, live talk, sports, commercials, and taping.', 61286, '4.8', 1781, 122),
('Radiologic Technology/Science - Radiographer', 'A program that prepares individuals, under the supervision of physicians, to provide medical imaging services to patients and attending health care professionals.  Includes instruction in applied anatomy and physiology, patient positioning, radiographic technique, radiation biology, safety and emergency procedures, equipment operation and maintenance, quality assurance, patient education, and medical imaging/radiologic services management.', 58520, '9.0', 9014, 460),
('Railroad and Railway Transportation', 'A program that prepares individuals to apply technical knowledge and skills to the operation of railroads and other aspects of the railway industry, including railroad and railyard service. Includes instruction in railway culture, operating skills, General Code of Operation rules, conductor service, signal systems, switching, transportation of hazardous materials, safety, and railway telecommunications systems.', 57996, '1.2', 399, 5),
('Range Science and Management', 'A program that focuses on the scientific study of rangelands, arid regions, grasslands, and other areas of low productivity, as well as the principles of managing such resources for maximum benefit and environmental balance.  Includes instruction in livestock management, wildlife biology, plant sciences, ecology, soil science, and hydrology.', 71881, '6.1', 225, 24),
('Reading Teacher Education', 'A program that prepares individuals to diagnose reading difficulties and to teach reading programs at various educational levels.', 60080, '6.1', 6646, 409),
('Real Estate', 'A program that prepares individuals to develop, buy, sell, appraise, and manage real estate. Includes instruction in land use development policy, real estate law, real estate marketing procedures, agency management, brokerage, property inspection and appraisal, real estate investing, leased and rental properties, commercial real estate, and property management.', 64430, '5.7', 3613, 232),
('Receptionist', 'A program that prepares individuals to perform frontline public relations duties for a business, organization, or answering service.  Includes instruction in telephone answering techniques, responding to information requests, keeping caller and/or visitor records, placing business calls, operating telephone switchboards and/or other communications equipment, relaying incoming and interoffice calls, schedule maintenance, and public relations skills.', 32885, '10.0', 302, 39),
('Regional Studies (US, Canadian, Foreign)', 'A program that focuses on the defined geographic subregions and subcultures within modern and historical countries and societies. Includes such topics as Acadian Studies, French Canadian and Quebec Studies, Southern (U.S.) Studies, Appalachian (U.S.) Studies, New England Studies, Southwestern Studies, Northern Studies, and others.', 81700, '15.0', 68, 24),
('Registered Nursing/Registered Nurse', 'A program that generally prepares individuals in the knowledge, techniques and procedures for promoting health, providing care for sick, disabled, infirmed, or other individuals or groups.  Includes instruction in the administration of medication and treatments, assisting a physician during treatments and examinations, Referring patients to physicians and other health care specialists, and planning education for health maintenance.', 71044, '16.1', 231312, 2076),
('Rehabilitation Aide', 'A program that prepares individuals to assist in rehabilitation services under the supervision of physical therapists, occupational therapists, speech-language pathologists, and other therapeutic professionals, and to perform routine functions in support of rehabilitation. Includes instruction in roles and responsibilities of rehabilitation providers, basic function of the human body, disabling conditions, therapeutic skills, client management, and communication skills.', 33509, '21.8', 178, 15),
('Rehabilitation Science', 'A program that focuses on human function, disability, and rehabilitation from the perspectives of the health sciences, social sciences, psychology, engineering, and related fields. Includes instruction in psychological, social, and cultural aspects of disability and rehabilitation; sensory and motor function and dysfunction; biomechanics and kinesiology; assistive technology; rehabilitation instrumentation and methodology; statistics; and health and rehabilitation policy.', 86807, '15.4', 879, 31),
('Religion/Religious Studies', 'A program that focuses on the nature of religious belief and specific religious and quasi-religious systems.  Includes instruction in phenomenology; the sociology, psychology, philosophy, anthropology, literature and art of religion; mythology; scriptural and textual studies; religious history and politics; and specific studies of particular faith communities and their behavior.', 75140, '12.0', 5449, 607),
('Religious Education', 'A program that focuses on the theory and practice of providing educational services to members of faith communities, within the context of a particular religion, and that prepares individuals to serve as religious educators.  Includes instruction in planning and teaching lessons, organizing and supervising instructional activities, designing and developing instructional materials, and administering religious education programs and facilities.', 61353, '8.3', 1930, 162),
('Religious/Sacred Music', 'A program that focuses on the history, theory, composition, and performance of music for religious or sacred purposes, and that prepares individuals for religious musical vocations such as choir directors, cantors, organists, and chanters.', 67495, '7.7', 537, 171),
('Reproductive Biology', 'A program that focuses on the scientific study of reproductive processes and biogenesis in animals and human beings.  Includes instruction in reproductive ecology and behavior, reproductive system physiology, endocrinology, developmental biology, neuroendocrinology, evolution and types of reproductive systems, reproductive genetics, physiopathology of reproductive processes, and applications of molecular biology and biophysics to the study of reproductive physiology.', 93730, '8.0', 17, 5),
('Resort Management', 'A program that prepares individuals to plan, manage, and market comprehensive vacation facilities and services and related products.  Includes instruction in hospitality administration, hotel/motel management, restaurant and food services management, facilities planning, leisure studies, recreation administration, marketing, recreation equipment and grounds operations and maintenance, business finance, insurance and taxation, event management and guest services, personnel management, travel and logistics management, safety and health services, professional standards and ethics, and applications to specific vacation types and locations.', 57810, '8.0', 303, 29),
('Respiratory Therapy Technician/Assistant', 'A program that prepares individuals to administer general respiratory care procedures under the supervision of respiratory therapists in a variety of clinical settings.  Includes instruction in patient data collection and monitoring, airway management, installation of nebulizers and other respiratory assistance devices, application and monitoring of breathing gases, equipment operation and maintenance, safety and sanitation procedures, and applicable regulations.', 49720, '-19.0', 612, 44),
('Restaurant/Food Services Management', 'A program that prepares individuals to plan, manage, and market restaurants, food services in hospitality establishments, food service chains and franchise networks, and restaurant supply operations.  Includes instruction in hospitality administration, food services management, wholesale logistics and distribution, franchise operations, business networking, personnel management, culinary arts, business planning and capitalization, food industry operations, marketing and retailing, business law and regulations, finance, and professional standards and ethics.', 54265, '5.4', 1808, 85),
('Retail Management', 'A program that prepares individuals to manage the operations of a wide variety of retail businesses, including department stores; independent and chain stores; fashion, food and beverage, and pharmaceutical establishments; and online retail businesses. Includes instruction in retail management, merchandise management, customer service management, marketing, organizational behavior, accounting, finance, business law, and personnel management.', 92089, '6.0', 693, 74),
('Retailing and Retail Operations', 'A program that prepares individuals to perform operations associated with retail sales in a variety of settings.  Includes instruction in over-the-counter and other direct sales operations in business settings, basic bookkeeping principles, customer service, team/staff leadership and supervision, floor management, and applicable technical skills.', 50363, '5.8', 939, 103),
('Administrative Assistant and Secretarial Science, General', 'A program that generally prepares individuals to perform the duties of administrative assistants and/or secretaries and stenographers.  Includes instruction in business communications, principles of business law, word processing and data entry, office machines operation and maintenance, office procedures, public relations, secretarial accounting, filing systems and records management, and report preparation.', 39781, '1.0', 12504, 932),
('Rhetoric and Composition', 'A program that focuses on the humanistic and scientific study of rhetoric, composition, literacy, and language/linguistic theories and their practical and pedagogical applications. Includes instruction in historical and contemporary rhetoric/composition theories; composition and criticism of written, visual, and mixed-media texts; analysis of literacy practices in cultural and cross-cultural contexts; and writing program administration.', 67969, '1.7', 3609, 168),
('Robotics Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers and other professionals engaged in developing and using robots.  Includes instruction in the principles of robotics, design and operational testing, system maintenance and repair procedures, robot computer systems and control language, specific system types and applications to specific industrial tasks, and report preparation.', 56320, '1.0', 304, 53),
('Romance Languages, Literatures, and Linguistics, General', 'A general program that focuses on one or more of the Romance languages of Western, Central, and Southern Europe.  Includes instruction in philology; linguistics; dialects and pidgins; literature; and applications to business, science/technology, and other settings.', 60127, '7.2', 371, 42),
('Roofer', 'A program that prepares individuals to apply technical knowledge and skills to prepare, install, and maintain exterior roofing materials and roofs.  Includes instruction in building materials, flashing, lag bolts, site safety, equipment operation and maintenance, layering, site preparation, basic internal structural design, finishing, waterproofing, and applicable codes and standards.', 61999, '10.7', 138, 3),
('Rural Sociology', 'A program that focuses on the structure and function of rural societies. Includes instruction in sociological theory, research methods, statistics, sociology of agriculture, community development, social and economic development, demography, rural poverty, gender roles in rural societies, and environmental sociology.', 109627, '4.4', 39, 1),
('Russian Language and Literature', 'A program that focuses on the Russian language. Includes instruction in philology; dialects; literature; and applications to business, science/technology, and other settings.', 56350, '22.2', 533, 137),
('Russian, Central European, East European and Eurasian Studies', 'A program that focuses on the history, society, politics, culture, and economics of the region encompassing Russia, Central Europe, Eastern Europe, and Eurasia, including the Balkan, Baltic, Caucasus, and Central Asian states that were republics of the former Soviet Union.', 81700, '15.0', 77, 23),
('Sales, Distribution, and Marketing Operations, General', 'A program that focuses on the general process and techniques of direct wholesale and retail buying and selling operations and introduces individuals to related careers.  Includes instruction in the principles of entrepreneurial economics, basic sales skills, the distribution channels for goods and services, and supervised practical application experiences.', 66221, '5.0', 2765, 201),
('Scandinavian Studies', 'A program that focuses on the history, society, politics, culture, and economics of one or more of the peoples of Scandinavia, defined as Northern Europe including Denmark, Finland, Iceland, Norway, Sweden, related island groups (including Greenland), and borderlands.', 81700, '15.0', 34, 8),
('School Psychology', 'A  program that prepares individuals to apply clinical and counseling psychology principles to the diagnosis and treatment of student behavioral problems.  Includes instruction in child and/or adolescent development; learning theory; testing, observation and other procedures for assessing educational, personality, intelligence and motor skill development; therapeutic intervention strategies for students and families; identification and classification of disabilities and disorders affecting learning; school psychological services planning; supervised counseling practice; ethical standards; and applicable regulations.', 101740, '8.1', 2873, 199),
('Science Teacher Education/General Science Teacher Education', 'A program that prepares individuals to teach general science programs, or a combination of the biological and physical science subject matter areas, at various educational levels.', 61959, '6.6', 1553, 375),
('Science, Technology and Society', 'A program that focuses on the contemporary social and public policy ramifications of science and technology, the interrelationship of science and engineering with the public policy process, and the social and ethical dimensions of scientific and technological enterprises.', 136570, '3.0', 880, 59),
('Sculpture', 'A program that prepares individuals creatively and technically to express emotions, ideas, or inner visions by creating three-dimensional art works.  Includes instruction in the analysis of form in space; round and relief concepts; sculptural composition; modern and experimental methods; different media such as clay, plaster, wood, stone, and metal; techniques such as carving, molding, welding, casting, and modeling; and personal style development.', 72462, '9.7', 403, 83),
('Secondary Education and Teaching', 'A program that prepares individuals to teach students in the secondary grades, which may include grades seven through twelve, depending on the school system or state regulations.  May include preparation to teach a comprehensive curriculum or specific subject matter.', 60440, '6.0', 11214, 647),
('Secondary School Administration/Principalship', 'A program that focuses on educational administration at the junior high, secondary, or senior high school (7-12) levels, and prepares individuals to serve as principals and masters of secondary schools.  Includes instruction in secondary school education, program and facilities planning, budgeting and administration, public relations, human resources management, adolescent growth and development, counseling skills, applicable law and regulations, school safety, policy studies, and professional standards and ethics.', 92940, '6.0', 473, 42),
('Security and Loss Prevention Services', 'A program that prepares individuals to perform routine inspection, patrol and crime prevention services for private clients.  Includes instruction in the provision of personal protection as well as property security.', 63978, '17.5', 1147, 75),
('Security System Installation, Repair, and Inspection Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to install and repair household, business, and industrial security alarms, sensors, video and sound recording devices, identification systems, protective barriers, and related technologies.', 44860, '13.0', 95, 5),
('Art Teacher Education', 'A program that prepares individuals to teach art and art appreciation programs at various educational levels.', 61012, '6.4', 1918, 413),
('Semiconductor Manufacturing Technology', 'A program that prepares individuals to apply basic engineering principles and technical skills to operate and monitor equipment for the fabrication of semiconductors or microchips from silicon wafers, and to troubleshoot, maintain, and repair the specialized equipment used in this process. Includes instruction in AC and DC circuits, digital fundamentals, solid state devices, manufacturing processes, vacuum principles and technology, industrial electronics, quality assurance, and semiconductor manufacturing technology.', 58269, '-2.9', 14, 3),
('Sheet Metal Technology/Sheetworking', 'A program that prepares individuals to apply technical knowledge and skills to form, shape, bend and fold extruded metals, including the creation of new products, using hand tools and machines such as cornice brakes, forming rolls, and squaring shears.', 40187, '-10.1', 225, 36),
('Sign Language Interpretation and Translation', 'A program that prepares individuals to function as simultaneous interpreters of American Sign Language', 48360, '29.0', 1858, 150),
('Slavic Languages, Literatures, and Linguistics, General', 'A general program that focuses on one or more of the Slavic languages of Central and Eastern Europe.  Includes instruction in philology; linguistics; dialects and pidgins; literature; and applications to business, science/technology, and other settings.', 56350, '22.2', 138, 25),
('Slavic Studies', 'A program that focuses on the history, society, politics, culture, and economics of one or more of the Slavic peoples inhabiting Europe, Asia, and in immigrant groups elsewhere, including the study of the emergence and migration patterns of Slavic culture, languages, and populations.', 81700, '15.0', 7, 2),
('Art Therapy/Therapist', 'A program that prepares individuals, in consultation with other rehabilitation team members or in private practice, to use drawing and other art media forms to assess, treat, and rehabilitate individuals with mental, emotional, developmental, or physical disorders.  Includes instruction in art, history and theory of art therapy, art therapeutic techniques, psychopathology, patient assessment and diagnosis, cultural diversity issues, legal and ethical practice issues, and professional standards and regulations.', 114510, '19.0', 715, 64),
('Small Engine Mechanics and Repair Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to repair, service, and maintain small internal-combustion engines used on portable power equipment such as lawnmowers, chain saws, rotary tillers, and snowmobiles.', 36478, '4.2', 361, 40),
('Social Science Teacher Education', 'A program that prepares individuals to teach specific social science subjects and programs at various educational levels.', 61396, '6.5', 610, 129),
('Social Sciences, General', 'A program that focuses on the general study of human social behavior and social institutions using any of the methodologies common to the social sciences and/or history, or an undifferentiated program of study in the social sciences.', 74281, '5.3', 19884, 527),
('Art/Art Studies, General', 'A general program that focuses on the introductory study and appreciation of the visual arts.  Includes instruction in art, photography, and other visual communications media.', 60779, '6.2', 20237, 881),
('Sociology and Anthropology', 'A program that combines sociology and anthropology to study how society is organized, the origins and development of social institutions, social change, social organizations, race, class, gender and culture.', 108496, '4.5', 511, 40),
('Somatic Bodywork', 'A program that prepares individuals to promote physical and emotional balance and well-being through the application of skilled touch principles and techniques.  Includes instruction in therapeutic massage and other hands-on touch methods, anatomy and physiology, structural/functional integration and various holistic health systems (Rolfing/Structural Integration, colon hydrotherapy, Breema, Hellerwork, lymphatic drainage, Rosen Method, hydrotherapy, and others), client counseling, practice management, and applicable regulations and professional standards.', 43170, '22.0', 109, 6),
('Artificial Intelligence', 'A program that focuses on the symbolic inference, representation, and simulation by computers and software of human learning and reasoning processes and capabilities, and the computer modeling of human motor control and motion. Includes instruction in computing theory, cybernetics, human factors, natural language processing, and applicable aspects of engineering, technology, and specific end-use applications.', 104670, '16.8', 169, 11),
('South Asian Languages, Literatures, and Linguistics, General', 'A general program that focuses on one or more of the languages, literatures, and linguistics of the peoples of the Indian subcontinent and associated borderlands and island groups.', 56350, '22.2', 13, 3),
('Southeast Asian Studies', 'A program that focuses on the history, society, politics, culture, and economics of one or more of the peoples of Southeast Asia, defined as including Brunei, Cambodia, Indonesia, Laos, Malaysia, The Philippines, Singapore, Thailand, and Viet Nam; related borderlands and island groups; and including the study of migration patterns and overseas diasporas.', 81700, '15.0', 14, 7),
('Spanish and Iberian Studies', 'A program that focuses on the history, society, politics, culture, and economics of the peoples of the Iberian Peninsula and related island groups and border regions from earliest times to the present, with particular emphasis on the development of Spain and Portugal but including other historical and current cultures.', 81700, '15.0', 36, 13),
('Spanish Language and Literature', 'A program that focuses on the Spanish language and related dialects. Includes instruction in philology; Modern Castillan; Latin American and regional Spanish dialects; and applications in business, science/technology, and other settings.', 60127, '7.2', 13144, 976),
('Special Education and Teaching, General', 'A general program that focuses on the design and provision of teaching and other educational services to children or adults with special learning needs or disabilities, and that may prepare individuals to function as special education teachers.  Includes instruction in diagnosing learning disabilities, developing individual education plans, teaching and supervising special education students, special education counseling, and applicable laws and policies.', 59798, '6.3', 21202, 765),
('Arts, Entertainment,and Media Management, General', 'A program that prepares individuals to organize and manage various aspects of the visual arts, performing arts, and entertainment media industries.  Includes instruction in business and financial management, marketing and fund-raising, labor relations for the arts, event promotion and management, product and artist management, and applicable law.', 103857, '5.4', 1264, 59),
('Speech Communication and Rhetoric', 'A program that focuses on the scientific, humanistic, and critical study of human communication in a variety of formats, media, and contexts.  Includes instruction in the theory and practice of interpersonal, group, organizational, professional, and intercultural communication; speaking and listening; verbal and nonverbal interaction; rhetorical theory and criticism; performance studies; argumentation and persuasion; technologically mediated communication; popular culture; and various contextual applications.', 64251, '3.9', 41358, 913),
('Speech Teacher Education', 'A program that prepares individuals to teach speech and language arts programs at various educational levels.', 60080, '6.1', 72, 48),
('Speech-Language Pathology/Pathologist', 'A program that prepares individuals to evaluate the speaking, language interpretation, and related physiological and cognitive capabilities of children and/or adults and develop treatment and rehabilitative solutions in consultation with clinicians and educators.  Includes instruction in the anatomy and physiology of speech and hearing, biomechanics of swallowing and vocal articulation, communications disorders, psychology of auditory function and cognitive communication, language assessment and diagnostic techniques, and rehabilitative and management therapies.', 98580, '19.8', 4856, 127),
('Sport and Fitness Administration/Management', 'A program that prepares individuals to apply business, coaching and physical education principles to the organization, administration and management of athletic programs and teams, fitness/rehabilitation facilities and health clubs, sport recreation services, and related services.  Includes instruction in program planning and development; business and financial management principles; sales, marketing and recruitment; event promotion, scheduling and management; facilities management; public relations; legal aspects of sports; and applicable health and safety standards.', 41482, '7.1', 13441, 558),
('Asian Bodywork Therapy', 'A program that prepares individuals to provide relief and improved health and well-being based on Chinese medical principles through one or more of the traditional bodywork therapies of Asia.  Includes instruction in acupressure, AMMA(r) Therapy, Chi Nei Tsang, Five Element Shiatsu, Integrative Eclectic Shiatsu, Japanese Shiatsu, Jin Shin Do(r) Bodymind Acupressure(tm), Macrobiotic Shiatsu, Anma Therapy, Thai massage, Tui na, Zen Shiatsu, Qigong, Okazaki(r) Restorative Massage, principles of Western and Chinese medicine, patient counseling and observation, practice management, applicable regulations, and professional standards and ethics.', 90267, '20.0', 81, 6),
('Sports Communication', 'A program that focuses on the methods and techniques for communicating about sports in a variety of formats, media, and contexts; and that prepares individuals to be sports reporters and writers, photojournalists, radio and television announcers, producers and directors, recreational sports promoters, and public relations specialists.  Includes instruction in sports writing, photography, broadcast journalism, sports production, game rules, media and public relations, and sports promotion.', 63260, '2.7', 141, 26),
('Sports Studies', 'A program that focuses on the psychological, sociological, and historical aspects of sport and physical activity. Includes instruction in theory of sport, sport psychology, sport in American society, gender and race/ethnicity and sport, and sports history.', 66090, '10.0', 323, 41),
('Sterile Processing Technology/Technician', 'A program that prepares individuals to clean, sterilize, and assemble surgical instruments, equipment, and supplies for use in operating rooms and other medical and surgical facilities. Includes instruction in sterilization; infection control; decontamination; and surgical instrumentation processing, distribution, and record-keeping.', 42267, '14.7', 554, 36),
('Structural Biology', 'A program that focuses on the scientific study of submolecular and molecular components and assemblies of living systems and how they are organized into functional units such as cells and anatomic tissues.  Includes instruction in glycoprotein, carbohydrate, protein, and nucleic acid structures and chemistry; cytoskeletal structure; nuclear and intracellular structures; molecular recognition; molecular chaperones; transcription and folding; multicellular organization; microtubules and microfilaments; cell differentiation; immunophysics; and DNA sequencing.', 76230, '4.0', 5, 5),
('Structural Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of materials and systems used in building load-bearing structures for various purposes and in different environments, including buildings, roads, rail lines, bridges, dams, conduits, offshore platforms and work stations, and other structural shells; and the analysis of structural problems such as, failure, fabrication, safety, and natural hazards.', 108788, '6.2', 410, 18),
('Substance Abuse/Addiction Counseling', 'A program that prepares individuals to help prevent substance abuse, counsel individuals and families with drug and alcohol problems, and perform intervention and therapeutic services for persons suffering from addiction.  Includes instruction in individual and group counseling skills, psychology of addiction, sociology, crisis intervention, substance abuse identification methodologies, substance abuse treatment modalities, substance abuse prevention and treatment resources, pharmacology and behavioral aspects of abused substances, treatment evaluation, patient observation and education, group dynamics, professional standards and ethics, and applicable law and regulations.', 44206, '20.8', 6000, 361),
('Surgical Technology/Technologist', 'A program that prepares individuals, under the supervision of physicians and surgical nurses, to maintain, monitor, and enforce the sterile field and adherence to aseptic technique by preoperative, surgical team, and postoperative personnel.  Includes instruction in instrument and equipment sterilization and handling, surgical supplies management, wound exposure and closure, surgical computer and robot operation and monitoring, maintenance of hemostasis, and patient and team scrubbing.', 89882, '17.6', 8439, 531),
('Surveying Technology/Surveying', 'A program that prepares individuals to apply mathematical and scientific principles to the delineation, determination, planning and positioning of land tracts, land and water boundaries, land contours and features; and the preparation of related maps, charts and reports.  Includes instruction in applied geodesy, computer graphics, photointerpretation, plane and geodetic surveying, mensuration, traversing, survey equipment operation and maintenance, instrument calibration, and basic cartography.', 53846, '-1.5', 614, 115),
('Asian Studies/Civilization', 'A program that focuses on the history, society, politics, culture, and economics of one or more of the peoples of the Asian Continent, including the study of the Asian diasporas overseas.', 81700, '15.0', 1201, 148),
('Swedish Language and Literature', 'A program that focuses on the Swedish language and related dialects. Includes instruction in philology; literature; and applications to business, science/technology, and other settings.', 56350, '22.2', 3, 1),
('System, Networking, and LAN/WAN Management/Manager', 'A program that prepares individuals to oversee and regulate the computer system and performance requirements of an entire organization or network of satellite users.  Includes instruction in performance balancing; redundancy; local area (LAN) and wide area (WAN) network management; system migration and upgrading; outage control; problem diagnosis and troubleshooting; and system maintenance, budgeting, and management.', 75708, '11.3', 5758, 270),
('Systems Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of total systems solutions to a wide variety of engineering problems, including the integration of human, physical, energy, communications, management, and information requirements as needed, and the application of requisite analytical methods to specific situations.', 121643, '3.9', 3385, 102),
('Tax Law/Taxation', 'An advanced, professional study of tax law and taxation procedures in U.S. or Canadian jurisdictions affecting individuals and corporations.', 136260, '6.0', 908, 31),
('Taxation', 'A program that prepares individuals to provide tax advice and management services to individuals and corporations.  Includes instruction in tax law and regulations, tax record systems, individual and corporate income taxation, tax planning, partnerships and fiduciary relationships, estates and trusts, property depreciation, capital gains and losses, dispositions, transfers, liquidity, valuation, and applications to specific tax problems.', 73356, '9.8', 1894, 106),
('Teacher Assistant/Aide', 'A program that prepares individuals to assist a teacher in regular classroom settings or in providing instruction and supervision to special student populations, such as bilingual/bicultural students, special education students, adult learners, and students learning English.  Includes instruction in techniques of general classroom supervision, maintaining order, assisting with lessons and carrying out related assignments.', 26550, '6.0', 2317, 239),
('Teacher Education, Multiple Levels', 'A program that prepares individuals to teach students at more than one educational level, such as a combined program in elementary/secondary, early childhood/elementary, elementary/middle school, or junior high/high school teacher education.', 58843, '6.0', 7644, 311),
('Teaching English as a Second or Foreign Language/ESL Language Instructor', 'A program that focuses on the principles and practice of teaching English to students who are not proficient in English or who do not speak, read or write English, and that may prepare individuals to function as teachers and administrators in such programs.', 58515, '6.0', 5580, 350),
('Assistive/Augmentative Technology and Rehabilitation Engineering', 'A program that prepares individuals to apply the principles of psychology, engineering, and occupational therapy to the design and implementation of technological interventions and systems to promote patient rehabilitation and function.  Includes instruction in ergonomics, seating and mobility design, universal and near environment systems design, rehabilitation research, rehabilitation biomechanics, access and communications design, microprocessor-based technologies, neurological trauma, standards and testing, and service delivery management.', 69316, '7.0', 34, 8),
('Technical Teacher Education', 'A program that prepares individuals to teach specific vocational technical education programs at various educational levels.', 58688, '5.4', 511, 59),
('Technical Theatre/Theatre Design and Technology', 'A program that prepares individuals to apply artistic, technical and dramatic principles and techniques to the communication of dramatic information, ideas, moods, and feelings through technical theatre methods.  Includes instruction in set design, lighting design, sound effects, theatre acoustics, scene painting, property management, costume design, and technical direction and production and use of computer applications to support these functions.', 74352, '10.6', 1061, 163),
('Technology Teacher Education/Industrial Arts Teacher Education', 'A program that prepares individuals to teach technology education/industrial arts programs at various educational levels.', 59616, '5.9', 788, 95),
('Telecommunications Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development, and maintenance of telecommunications technology, networks, and systems. Includes instruction in telecommunications, computer networking, communications networks and systems, signals, circuits, fiber optics, and wireless systems and technology.', 116188, '2.5', 386, 21),
('Telecommunications Management', 'A program that prepares individuals to apply business skills to design, implement, and manage the voice, video, and data networking systems of organizations. Includes instruction in telecommunications concepts and technologies, network operations and management, wireless communications and mobile computing, cybersecurity, regulation and public policy, business practices and management, and written and oral communications.', 107732, '4.9', 12, 11),
('Telecommunications Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills to help design and implement telecommunications systems.  Includes instruction in communications protocol, data networking, digital compression algorithms, digital signal processing, Internet access, object-oriented and relational databases, and programming languages.', 61870, '-2.0', 783, 64),
('Textile Sciences and Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of systems to test and manufacture fibers and fiber products, both synthetic and natural; to develop new and improved fibers, textiles and their uses; and to the analysis of related engineering problems such as structural factors, molecular synthesis, chemical manufacturing, weaves, strength and stress, useful life, dyes, and applications to composite systems.', 130732, '3.6', 319, 4),
('Astronomy', 'A general program that focuses on the planetary, galactic, and stellar phenomena occurring in outer space.  Includes instruction in celestial mechanics, cosmology, stellar physics, galactic evolution, quasars, stellar distribution and motion, interstellar medium, atomic and molecular constituents of astronomical phenomena, planetary science, solar system evolution, and specific methodologies such as optical astronomy, radioastronomy, and theoretical astronomy.', 128614, '4.0', 478, 86),
('Theatre Literature, History and Criticism', 'A program that focuses on the study of the history, literature, theory, and analysis of written plays, theatrical productions, and theatre methods and organization.  Includes instruction in historical method; critical theory; literary analysis; the study of themes and archetypes in dramatic literature; the history of acting, directing, and technical theatre; and the study of specific historical and cultural styles and traditions.', 76710, '11.0', 45, 19),
('Theatre/Theatre Arts Management', 'A program that prepares individuals to apply business management principles to the management of theatres and production corporations.  Includes instruction in theatrical production, theatre design and planning, fund-raising and promotion, investment strategies, human resources management, theatre operations management, marketing, public relations, financial management and insurance, and applicable laws and regulations.', 101479, '6.1', 218, 42),
('Theoretical and Mathematical Physics', 'A program that focuses on the scientific and mathematical formulation and evaluation of the physical laws governing, and models describing, matter-energy phenomena, and the analysis of related experimental designs and results.  Includes instruction in classical and quantum theory, relativity theory, field theory, mathematics of infinite series, vector and coordinate analysis, wave and particle theory, advanced applied calculus and geometry, analyses of continuum, cosmology, and statistical theory and analysis.', 125868, '6.0', 10, 10),
('Tool and Die Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to operate machine tools used in the forming of metal components, as well as the fabrication of special tools, dies, jigs and fixtures used in cutting, working and finishing metal components.', 51130, '-13.0', 940, 58),
('Topology and Foundations', 'A program that focuses on the properties of unaltered geometric configurations under conditions of continuous, multi-directional transformations.  Includes instruction in mathematical logic, proof theory, model theory, set theory, combinatorics, continua, homotopy, homology, links, and transformation actions.', 106984, '9.9', 2, 1),
('Tourism and Travel Services Management', 'A program that prepares individuals to manage travel-related enterprises and related convention and/or tour services.  Includes instruction in travel agency management, tour arranging and planning, convention and event planning, travel industry operations and procedures, tourism marketing and promotion strategies, travel counseling, travel industry law, international and domestic operations, and travel and tourism policy.', 110679, '4.0', 1527, 100),
('Tourism and Travel Services Marketing Operations', 'A program that prepares individuals to provide direct retail services to hotel and motel clients and customers in a variety of settings.  Includes instruction in the principles of hotel/motel operations, customer sales and assistance operations and techniques, telephone operations, and basic office management.', 38750, '-12.0', 284, 39),
('Toxicology', 'A program that focuses on the scientific study of poisons and other biohazards; their interactions with organisms and their food and respiratory systems; and their prevention, management, and counteraction.  Includes instruction in toxicological biochemistry, toxic agents and transporters, toxin fate, toxicokinetics and metabolism, toxin classification, molecular toxic mechanisms, extracellular matrices and cell function, bacterial pathogenesis and mutagenesis, pathophysiology and apoptosis, cell stress and injury, studies of specific toxins, and studies of specific organ systems and physiological functions in relation to toxicological problems.', 99539, '7.5', 238, 41),
('Astrophysics', 'A program that focuses on the theoretical and observational study of the structure, properties, and behavior of stars, star systems and clusters, stellar life cycles, and related phenomena.  Includes instruction in cosmology, plasma kinetics, stellar physics, convolution and non-equilibrium radiation transfer theory, non-Euclidean geometries, mathematical modeling, galactic structure theory, and relativistic astronomy.', 126678, '4.8', 212, 39),
('Trade and Industrial Teacher Education', 'A program that prepares individuals to teach specific vocational trades and industries programs at various educational levels.', 58688, '5.4', 923, 60),
('Transportation and Highway Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of total systems for the physical movement of people, materials and information, including general network design and planning, facilities planning, site evaluation, transportation management systems, needs projections and analysis, and analysis of costs.', 108788, '6.2', 116, 16),
('Transportation/Mobility Management', 'A program that prepares individuals to plan, administer, and coordinate physical transportation operations, networks, and systems.  Includes instruction in transportation systems and technologies; traffic logistics and engineering; multi- and intermodal transportation systems; regional integration; facilities design and construction; transportation planning and finance; demand analysis and forecasting; carrier management; behavioral issues; transportation policy and law; intelligent systems; and applications to aviation, maritime, rail, and highway facilities and systems.', 95130, '2.0', 653, 50),
('Truck and Bus Driver/Commercial Vehicle Operator and Instructor', 'A program that prepares individuals to apply technical knowledge and skills to drive trucks and buses, delivery vehicles, for-hire vehicles and other commercial vehicles, or to instruct commerical vehicle operators. Includes instruction in operating gas, diesel, or electrically-powered vehicles; loading and unloading cargo or passengers; reporting delays or accidents on the road; verifying load against shipping papers; arranging transportation for personnel; and keeping records of receipts and fares.', 38871, '5.3', 20193, 211),
('Athletic Training/Trainer', 'A program that prepares individuals to work in consultation with, and under the supervision of physicians to prevent and treat sports injuries and associated conditions.  Includes instruction in the identification, evaluation, and treatment of athletic injuries and illnesses; first aid and emergency care; therapeutic exercise; anatomy and physiology; exercise physiology; kinesiology and biomechanics; nutrition; sports psychology; personal and community health; knowledge of various sports and their biomechanical and physiological demands; and applicable professional standards and regulations.', 46940, '21.0', 5091, 442),
('Turkish Language and Literature', 'A program that focuses on the Turkish language in either or both of its pre-modern and modern variants. Includes instruction in philology; Ottoman Turkish; Modern Turkish; dialects; and applications to business, science/technology, and other settings.', 56350, '22.2', 1, 3),
('Upholstery/Upholsterer', 'A program that prepares individuals to apply technical knowledge and skills to install springs, filling, padding, covering and finishing on items such as furniture, automobile seats, caskets, mattresses, and bedsprings.', 33550, '-4.0', 153, 16),
('Ural-Altaic and Central Asian Studies', 'A program that focuses on the history, society, politics, culture, and economics of one or more of the peoples and countries of Inner/Central Asia, including the Turkic and Mongolian inhabitants of the Caspian, Amur, Tien Shan, Baikal, Gobi, Siberian, and Manchurian areas and the historical Silk Road, in terms of their past and present development.', 81700, '15.0', 7, 2),
('Uralic Languages, Literatures, and Linguistics', 'A program that focuses on Uralic languages, including, but not limited to, Finnish, Estonian, Karelian, and Sami. Includes instruction in philology; oral and written literatures; and applications to business, science/technology, and other settings.', 56350, '22.2', 3, 1);
INSERT INTO `majors` (`Name`, `Description`, `Average Salary`, `Expected Growth`, `No of Students`, `No of Offering Schools`) VALUES
('Urban Forestry', 'A program that prepares individuals to apply the principles of forestry and related sciences to the development, care, and maintenance of individual trees and forested areas within or close to areas of dense human habitation.  Includes instruction in urban environments; effects of pollution on tree species; environmental design and landscaping; urban pest infestation; urban forest management; and applicable policies and regulations.', 65570, '7.8', 72, 15),
('Urban Ministry', 'A program that prepares the ordained clergy and other religious professionals to provide spiritual, counseling, and leadership services to individuals and groups in urban communities. Includes instruction in bible study and theology, pastoral leadership and care, urban structure and context, inner city ministry, counseling ministries, family studies, homiletics, social ethics, and community organizing.', 48150, '6.0', 100, 17),
('Urban Studies/Affairs', 'A program that focuses on the application of social science principles to the study of urban institutions and the forces influencing urban social and political life.  Includes instruction in urban theory, the development and evolution of urban areas, urban sociology, principles of urban and social planning, and the politics and economics of urban government and services.', 107575, '4.1', 1590, 119),
('Vehicle and Vehicle Parts and Accessories Marketing Operations', 'A program that prepares individuals to perform operations connected with the distribution and sale of replacement parts and other end-use supplies in the automotive, marine, and aviation industries.  Includes instruction in wholesaling and retailing, principles of vehicular technologies, storage and distribution, customer sales and service skills, and principles of consumer research and sales forecasting.', 32750, '7.0', 74, 9),
('Vehicle Emissions Inspection and Maintenance Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to test, repair, service, and maintain vehicle emission systems in accordance with relevant laws and regulations.', 40720, '5.0', 7, 1),
('Atmospheric Physics and Dynamics', 'A program that focuses on the scientific study of the processes governing the interactions, movement, and behavior of atmospheric phenomena and related terrestrial and solar phenomena.  Includes instruction in cloud and precipitation physics, solar radiation transfer, active and passive remote sensing, atmospheric electricity and acoustics, atmospheric wave phenomena, turbulence and boundary layers, solar wind, geomagnetic storms, coupling, natural plasma, and energization.', 123717, '4.7', 1, 1),
('Vehicle Maintenance and Repair Technologies, General', 'A program that generally prepares individuals to apply technical knowledge and skills in the adjustment, maintenance, part replacement, and repair of vehicles and mobile equipment.', 51069, '5.0', 359, 14),
('Veterinary Infectious Diseases', 'A program that focuses on the scientific study of zoonotic infectious diseases, disease mechanisms, and prevention and treatment strategies.  Includes instruction in disease pathogenesis, vector biology, mycobacterial infection, blood parasites, retroviruses, food-borne diseases, new infectious agents, ecotoxicology, mechanisms of disease transfer, antibody resistance, comparative pathology, communicable diseases, and disease prevention and eradication.', 99000, '9.0', 5, 1),
('Atmospheric Sciences and Meteorology, General', 'A general program that focuses on the scientific study of the composition and behavior of the atmospheric envelopes surrounding the earth, the effect of earth''s atmosphere on terrestrial weather, and related problems of environment and climate.  Includes instruction in atmospheric chemistry and physics, atmospheric dynamics, climatology and climate change, weather simulation, weather forecasting, climate modeling and mathematical theory; and studies of specific phenomena such as clouds, weather systems, storms, and precipitation patterns.', 123717, '4.7', 896, 68),
('Veterinary Medicine', 'A program that prepares individuals for the independent professional practice of veterinary medicine, involving the diagnosis, treatment, and health care management of animals and animal populations and the prevention and management of zoonosis.  Includes instruction in the veterinary basic sciences, infectious and noninfectious disease, diagnostic procedures, veterinary clinical medicine, obstetrics, radiology, anesthesiology, surgery, toxicology, animal health and preventive medicine, clinical nutrition, practice management, and professional standards and ethics.', 110346, '16.3', 2815, 29),
('Veterinary Microbiology and Immunobiology', 'A program that focuses on the scientific study of the microbial causation and immunologic processes related to animal disease, prevention, and treatment.  Includes instruction in bacteriology, mycology, virology, immune response mechanisms, humoral and cell function, cancer defenses, immune system dysfunction, immunologic diseases, parasitology, pathogenesis, and disease vectors.', 99000, '9.0', 28, 2),
('Veterinary Pathology and Pathobiology', 'A program that focuses on the scientific study of the development and process of disease in domestic and wild animals and applications to diagnosis, prevention, and treatment.  Includes instruction in pathogenesis, immunoparasitology, viral therapy, inherited metabolic diseases, environmental toxicology, anatomical and clinical pathology, necropsy and biopsy techniques, clinical laboratory analysis, pathological interpretation, and disease diagnosis.', 99000, '9.0', 26, 6),
('Veterinary Physiology', 'A program that focuses on  the scientific study of the functional dynamics of animal biological systems and their relationship to the diagnosis and treatment of disease and injury.  Includes instruction in mammalian and non-mammalian physiology, laboratory physiology, physiological responses to the environment, endocrinology, animal biotechnology, mechanisms of hormone action, organ systems, metabolism, and pathophysiology.', 99000, '9.0', 4, 2),
('Atomic/Molecular Physics', 'A program that focuses on the scientific study of the behavior of matter-energy phenomena at the level of atoms and molecules. Includes instruction in chemical physics, atomic forces and structure, molecular orbital theory, magnetic resonance, molecular bonding, phase equilibria, quantum theory of solids, and applications to the study of specific elements and higher compounds.', 125868, '6.0', 24, 7),
('Veterinary Sciences/Veterinary Clinical Sciences, General', 'An integrated program of study in one or more of the veterinary medical or clinical sciences or a program undifferentiated as to title.', 110346, '16.3', 409, 28),
('Veterinary/Animal Health Technology/Technician and Veterinary Assistant', 'A program that prepares individuals, under the supervision of veterinarians, laboratory animal specialists, and zoological professionals, to provide patient management, care, and clinical procedures assistance as well as owner communication.  Includes instruction in animal nursing care, animal health and nutrition, animal handling, clinical pathology, radiology, anesthesiology, dental prophylaxis, surgical assisting, clinical laboratory procedures, office administration skills, patient and owner management, and applicable standards and regulations.', 86183, '19.0', 8998, 296),
('Virology', 'A program that focuses on the scientific study of subcellular pieces of genetic material, called viruses, that inhabit living cells in parasitical relationships and their role in disease.  Includes instruction in virus taxonomy and systematics, viral structures, viral genetics, prions, virus/host cell interaction, viral pathogenesis, and applications to specific topics such as cancer biology.', 103963, '7.2', 22, 4),
('Vision Science/Physiological Optics', 'A program that focuses on the scientific study of vision, visual processes, and related phenomena and clinical research and treatment modalities.  Includes instruction in ocular anatomy and physiology, microbiology of the eye, electrophysiology, neurophysiology, corneal physiology, photochemistry, psychophysics, visual biophysics and motor systems, sensory mechanisms and photoreception, eye circulation and metabolism, geometric and physical optics, ocular development across the life span, visual stimuli and perception, color vision, eye motility, biometrics and measurement techniques, visual pathology, and environmental issues.', 93730, '8.0', 188, 12),
('Visual and Performing Arts, General', 'A general, undifferentiated program that focuses on the visual and performing arts and that may prepare individuals in any of the visual artistic media or performing disciplines.', 62749, '7.7', 3070, 301),
('Viticulture and Enology', 'A program that focuses on the application of scientific and agribusiness principles to the production of grapes, the making of wine, and the wine business. Includes instruction in grapes and wines of the world; grape production; winemaking technology; plant biology; chemistry; food science, safety, and packaging; soil science; pest management; and marketing and business management.', 66817, '0.9', 370, 34),
('Vocational Rehabilitation Counseling/Counselor', 'A program that prepares individuals to counsel and assist disabled individuals and recovering patients in order to achieve their greatest physical, mental, social, educational, and vocational potential. Includes instruction in patient evaluation and testing, rehabilitation program planning, patient support services and referral, job analysis, adjustment psychology, rehabilitation services provision, patient counseling and education, applicable law and regulations, and professional standards and ethics.', 86807, '15.4', 1551, 66),
('Watchmaking and Jewelrymaking', 'A program that prepares individuals to apply technical knowledge and skills to make repairs, and maintain timepieces, time-measuring devices, and jewelry items.  Includes instruction in mechanical timekeeping systems, digital timekeeping systems, timesetting, casting, engraving, polishing, stonesetting, soldering, fine microscopic work, equipment and tool maintenance, redesign and restyling techniques, and customer relations.', 41939, '-11.8', 132, 12),
('Water Quality and Wastewater Treatment Management and Recycling Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers and other professionals engaged in developing and using water storage, waterpower, and wastewater treatment systems.  Includes instruction in water storage, power and/or treatment systems and equipment; testing and inspection procedures; system maintenance procedures; and report preparation.', 46790, '6.0', 870, 84),
('Water Resources Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of systems for collecting, storing, moving, conserving and controlling surface- and groundwater, including water quality control, water cycle management, management of human and industrial water requirements, water delivery, and flood control.', 108788, '6.2', 80, 13),
('Water, Wetlands, and Marine Resources Management', 'A program that prepares individuals to apply the principles of marine/aquatic biology, oceanography, natural resource economics, and natural resources management to the development, conservation, and management of freshwater and saltwater environments.  Includes instruction in subjects such as wetlands, riverine, lacustrian, coastal, and oceanic water resources; water conservation and use; flood control; pollution control; water supply logistics; wastewater management; aquatic and marine ecology; aquatic and marine life conservation; and the economic and recreational uses of water resources.', 65868, '7.0', 258, 26),
('Web Page, Digital/Multimedia and Information Resources Design', 'A program that prepares individuals to apply HTML, XML, Javascript, graphics applications, and other authoring tools to the design, editing, and publishing (launching) of documents, images, graphics, sound, and multimedia products on the World Wide Web.  Includes instruction in Internet theory, web page standards and policies, elements of web page design, user interfaces, vector tools, special effects, interactive and multimedia components, search engines, navigation, morphing, e-commerce tools, and emerging web technologies.', 59872, '10.5', 6034, 645),
('Web/Multimedia Management and Webmaster', 'A program that prepares individuals to develop and maintain web servers and the hosted web pages at one or a group of web sites, and to function as designated webmasters.  Includes instruction in computer systems and networks, server installation and maintenance, web page design and editing, information resources management, web policy and procedures, Internet applications of information systems security, user interfacing and usability research, and relevant management and communications skills.', 70660, '27.0', 1105, 150),
('Welding Engineering Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills to the design and engineering of welding and joining systems and the implementation of welding processes.  Includes instruction in materials science; computer-aided design; welding design; welding processes; welding metallurgy; automation and robotics; and codes, inspections, testing, and quality assurance.', 44353, '3.4', 165, 17),
('Welding Technology/Welder', 'A program that prepares individuals to apply technical knowledge and skills to join or cut metal surfaces.  Includes instruction in arc welding, resistance welding, brazing and soldering, cutting, high-energy beam welding and cutting, solid state welding, ferrous and non-ferrous materials, oxidation-reduction reactions, welding metallurgy, welding processes and heat treating, structural design, safety, and applicable codes and standards.', 40562, '1.3', 35969, 854),
('Western European Studies', 'A program that focuses on the history, society, politics, culture, and economics of one or more of the peoples of historical Western Europe, defined as including Britain, Ireland, France, the Low Countries, the Iberian Peninsula, Italy, the Western Mediterranean, and related island groups and borderlands.', 81700, '15.0', 58, 6),
('Wildland/Forest Firefighting and Investigation', 'A program focusing on the application of fire science, firefighting and investigation to the prevention, control and mitigation of wildland fires and the analysis of causes.  Includes instruction in fire science and behavior, wildland environments, meteorology, wildland fire hydraulics and dynamics, water and chemical supply systems, wildland firefighting operations, airborne firefighting, firebreak engineering, communications systems, wildland arson, forensic procedures, wildland fire prevention, investigation techniques, case management and preparation.', 49306, '5.0', 25, 11),
('Audiology/Audiologist and Speech-Language Pathology/Pathologist', 'An integrated program that prepares individuals to work as both audiologists and speech-language pathologists. Includes instruction in a variety of communication disorder studies, audiology, speech pathology, language acquisition, and the design and implementation of comprehensive therapeutic and rehabilitative solutions to communications problems.', 97788, '20.2', 7575, 154),
('Wildlife Biology', 'A program that focuses on the application of biological principles to the study of vertebrate wildlife, wildlife habitats, and related ecosystems in remote and urban areas.  Includes instruction in animal ecology; adaptational biology; urban ecosystems; natural and artificial habitat management; limnology; wildlife pathology; and vertebrate zoological specializations such as mammalogy, herpetology, ichthyology, ornithology, and others.', 64230, '4.0', 441, 28),
('Wildlife, Fish and Wildlands Science and Management', 'A program that prepares individuals to conserve and manage wilderness areas and the flora, marine and aquatic life therein, and manage wildlife reservations and zoological/aquarium facilities for recreational, commercial, and ecological purposes. Includes instruction in wildlife biology, marine/aquatic biology, environmental science,  freshwater and saltwater ecosystems, natural resources management and policy, outdoor recreation and parks management, the design and operation of natural and artificial wildlife habitats, applicable law and regulations, and related administrative and communications skills.', 63870, '5.2', 2146, 96),
('Wine Steward/Sommelier', 'A program that prepares individuals to manage wine selection, purchasing, storage, sales, and service for a variety of establishments in the hospitality industry. Includes instruction in wine production, wine regions of the world, wine tasting, food and wine matching, service techniques, and wine program management.', 55643, '5.4', 160, 6),
('Women''s Ministry', 'A program that prepares non-ordained women to provide spiritual, counseling, and leadership services to other women in local churches, parachurch organizations, and other settings. Includes instruction in foundations of women''s ministry, women''s ministry in the local church, spiritual formation, women''s evangelism and discipleship, bible study and theology, homiletics, lay counseling, women''s issues, and leadership training.', 45160, '4.0', 9, 7),
('Women''s Studies', 'A program that focuses on the history, sociology, politics, culture, and economics of women, and the development of modern feminism in relation to the roles played by women in different periods and locations in North America and the world.  Programs may focus on literature, philosophy, and the arts as much as on social studies and policy.', 81700, '15.0', 2494, 356),
('Woodworking, General', 'A program that generally prepares individuals to apply technical knowledge and skills to lay out and shape stock; assemble wooden articles or subassemblies; mark, bind, saw, carve, and sand wooden products; repair wooden articles, and use a variety of hand and power tools.', 29090, '-2.0', 70, 9),
('Word Processing', 'A program that prepares individuals to perform text typing, table construction, and document formatting tasks on personal computers at a high rate of accuracy and proficiency.  Includes instruction in keyboarding skills, word processor operation, textual draft interpretation, audio and tape dictation, and specific word processing program software.', 38710, '-16.0', 71, 21),
('Writing, General', 'A program that focuses on writing for applied and liberal arts purposes. Includes instruction in writing and document design in multiple genres, modes, and media; writing technologies; research, evaluation, and use of information; editing and publishing; theories and processes of composing; rhetorical theories, traditions, and analysis; communication across audiences, contexts, and cultures; and practical applications for professional, technical, organizational, academic, and public settings.', 68978, '3.2', 1030, 117),
('Yoga Teacher Training/Yoga Therapy', 'A program that prepares individuals to function as professional instructors in the spiritual and physical therapy of Yoga in private, institutional, and clinical settings.  Includes instruction in the principles of Ayurveda, philosophy of Yoga, warm-up and progressive exercises, breathing exercises, meditation, Yamas and Niyamas, instructional techniques, posture adjustment, student/client counseling and assessment, advanced Yoga disciplines and styles, business practices, and professional standards and ethics.', 40970, '8.0', 102, 10),
('Youth Ministry', 'A program that prepares the ordained clergy and other religious professionals to provide spiritual, counseling, and leadership services to children, adolescents, and young adults.  Includes instruction in child and adolescent psychology, human growth and development, family studies, communication skills, religious education, youth counseling, small group leadership, planning and organizing youth activities, volunteer supervision, and youth evangelism and worship.', 47265, '5.4', 673, 127),
('Auditing', 'A program that prepares individuals, including certified accountants, to perform independent internal and external appraisals to evaluate organizational financial and operational activities, ensure compliance with laws and policies, safeguard assets, and promote effective planning and resource allocation.  Includes instruction in advanced accounting, audit tools and techniques, sampling, risk and control, audit planning, audit function management, law and regulations, environmental auditing, information technology applications, professional standards and ethics, and specific industry and service sector problems.', 75733, '11.0', 155, 21),
('Autobody/Collision and Repair Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to repair, reconstruct and finish automobile bodies, fenders, and external features.  Includes instruction in structure analysis, damage repair, non-structural analysis, mechanical and electrical components, plastics and adhesives, painting and refinishing techniques, and damage analysis and estimating.', 45349, '7.6', 6590, 405),
('Automation Engineer Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers and other professionals engaged in developing, installing, calibrating, modifying and maintaining automated systems. Includes instruction in computer systems; electronics and instrumentation; programmable logic controllers (PLCs); electric, hydraulic and pneumatic control systems; actuator and sensor systems; process control; robotics; applications to specific industrial tasks; and report preparation.', 56320, '1.0', 459, 52),
('Adult and Continuing Education and Teaching', 'A program that prepares individuals to teach adult students in various settings, including basic and remedial education programs, continuing education programs, and programs designed to develop or upgrade specific employment-related knowledge and skills.', 45048, '13.2', 1524, 95),
('Automotive Engineering Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers and other professionals engaged in developing, manufacturing and testing self-propelled ground vehicles and their systems.  Includes instruction in vehicular systems technology, design and development testing, prototype and operational testing, inspection and maintenance procedures, instrument calibration, test equipment operation and maintenance, and report preparation.', 40720, '5.0', 1370, 73),
('Aviation/Airway Management and Operations', 'A program that prepares individuals to apply technical knowledge and skills to the management of aviation industry operations and services.  Includes instruction in airport operations, ground traffic direction, ground support and flightline operations, passenger and cargo operations, flight safety and security operations, aviation industry regulation, and related business aspects of managing aviation enterprises.', 95130, '2.0', 1560, 95),
('Avionics Maintenance Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to repair, service, and maintain all types of aircraft operating, control, and electronic systems.  Includes instruction in flight instrumentation, aircraft communications and homing systems, radar and other sensory systems, navigation aids, and specialized systems for various types of civilian and military aircraft.', 53681, '-3.6', 566, 47),
('Baking and Pastry Arts/Baker/Pastry Chef', 'A program that prepares  individuals to serve as professional bakers and pastry specialists in restaurants or other commercial baking establishments.  Includes instruction in bread and pastry making, bread and pastry handling and storage, cake and pastry decorating, baking industry operations, product packaging and marketing operations, and counter display and service.', 34578, '7.8', 7912, 245),
('Banking and Financial Support Services', 'A program that prepares individuals to perform a wide variety of customer services in banks, insurance agencies, savings and loan companies, and related enterprises.  Includes instruction in communications and public relations skills, business equipment operation, and technical skills applicable to the methods and operations of specific financial or insurance services.', 33409, '-3.6', 1168, 158),
('Banking, Corporate, Finance, and Securities Law', 'An advanced, professional study of the law and process related to the regulation of businesses and the financial services industry.  Includes instruction in corporate law, antitrust law,  securities law and regulation, negotiation, incorporation, partnerships, trusts, and related topics', 136260, '6.0', 274, 23),
('Barbering/Barber', 'A program that prepares individuals to shave and trim facial/neck hair and beards, cut and dress hair, fit hairpieces, give facial and scalp massages, apply cosmetic treatments, and to prepare for licensure as professional barbers at various levels.  Includes instruction in facial shaving; beard and mustache shaping and trimming; shampooing; hair cutting; hair styles and styling art; facial treatments and massage; chemical applications; hair and scalp anatomy and physiology; hairpiece and toupee fitting; equipment operation; health and safety; customer service; and shop business practices.', 29140, '10.0', 8073, 366),
('Bartending/Bartender', 'A program that prepares individuals to professionally prepare mixed alcoholic and non-alcoholic beverages and related products and manage bars, lounges, and beverage service operations in the hospitality industry.  Includes instruction in mixology, oenology, accounting and cash management, inventory and cellar management, bar and lounge management, applicable laws and regulations, customer service, and labor/employment regulations.', 24110, '10.0', 663, 6),
('Behavioral Aspects of Health', 'A program that focuses on the biological, behavioral, and socio-cultural determinants of health and health behavior, and the interventions and policies aimed at improving community and population health. Includes instruction in behavioral sciences, public health practice and policy, human services, and research methods.', 90239, '16.9', 282, 18),
('Bible/Biblical Studies', 'A program that focuses on the Christian and/or Jewish Bible and related literature, with an emphasis on understanding and interpreting the theological, doctrinal, and ethical messages contained therein.  May include preparation for applying these studies in various religious vocations.', 61353, '8.3', 5273, 241),
('Adult Health Nurse/Nursing', 'A program that prepares registered nurses to provide general care for adult patients.  Includes instruction in adult primary care, adult pathophysiology, clinical management of medication and treatments, patient assessment and education, patient referral, and planning adult health maintenance programs.', 72443, '16.9', 1865, 104),
('Bilingual and Multilingual Education', 'A program that focuses on the design and provision of teaching and other educational services to bilingual/bicultural children or adults, and/or the design and implementation of educational programs having the goal of producing bilingual/bicultural individuals.  Includes preparation to serve as teachers and administrators in bilingual/bicultural education programs.', 57755, '6.1', 1065, 92),
('Biochemical Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the study of biochemical processes in living organisms, properties of biological materials, and processes using biochemical agents such as cells, enzymes, and antibodies. Includes instruction in biology, chemistry, physics, biochemistry, thermodynamics, fluid dynamics, bioprocesses, and chemical engineering.', 120122, '3.8', 66, 5),
('Biochemistry and Molecular Biology', 'A program of study that combines the biological sub-disciplines of biochemistry and molecular biology. Includes instruction in general biology, general and organic chemistry, physics, biochemistry, molecular biology, immunology, microbiology, genetics, and cellular biology.', 102024, '7.3', 1016, 79),
('Bioengineering and Biomedical Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of biomedical and health systems and products such as integrated biomedical systems, instrumentation, medical information systems, artificial organs and prostheses, and health management and care delivery systems.', 131360, '5.6', 9217, 204),
('Bioinformatics', 'A program that focuses on the application of computer-based technologies and services to biological, biomedical, and biotechnology research.  Includes instruction in algorithms, network architecture, principles of software design, human interface design, usability studies, search strategies, database management and data mining, digital image processing, computer graphics and animation, CAD, computer programming, and applications to experimental design and analysis and to specific quantitative, modeling, and analytical studies in the various biological specializations.', 99175, '15.2', 594, 101),
('Accounting and Business/Management', 'An integrated or combined program in accounting and business administration/management that prepares individuals to function as accountants and business managers.', 93411, '10.1', 2662, 169),
('Biological and Physical Sciences', 'A program that is either a general synthesis of one or more of the biological and physical sciences, or a specialization which draws from the biological and physical sciences.', 136570, '3.0', 24658, 368),
('Biological/Biosystems Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and management of biological systems; and includes applications to biology, biochemistry, ecology, and microbiology. Includes instruction in organic chemistry; microbiology; biochemistry; chemical, biological, biochemical, and process engineering; thermodynamics; process control; kinetics and reactor design; electric circuits; biosystem modeling; and bioelectronics and instrumentation.', 119894, '5.0', 278, 12),
('Biology Technician/Biotechnology Laboratory Technician', 'A program that prepares individuals to apply scientific principles and technical skills in support of biologists and biotechnologists in research, industrial, and government settings.  Includes instruction in fermentation technology, cell culturing, protein purification, biologic synthesis, assaying and testing, quality control, industrial microbiology, bioprocessing, chromatography and bioseparation, genetic technology, laboratory and hazardous materials safety, and computer applications.', 45230, '5.0', 765, 100),
('Biomedical Sciences, General', 'A general, program that focuses on the integrative scientific study of biological issues related to health and medicine, or a program in one or more of the biomedical sciences that is undifferentiated as to title.  Includes instruction in any of the basic medical sciences at the research level; biological science research in biomedical faculties; and general studies encompassing a variety of the biomedical disciplines.', 93730, '8.0', 5846, 189),
('Biomedical Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers engaged in developing biological or medical systems and products.  Includes instruction in instrument calibration, design and installation testing, system safety and maintenance procedures, procurement and installation procedures, and report preparation.', 57892, '2.2', 1398, 116),
('Biometry/Biometrics', 'A program that focuses on the application of statistics and other computational methods to the study of problems in the biological sciences and related fields in agriculture and natural resources.  Includes instruction in computational biology, mathematical statistics, matrix algebra, applied calculus, experimental design, linear modeling, sampling theory, stochastic processes, spatial and temporal analysis, longitudinal analysis, sparse/unbalanced data and complex error, and applications to such topics as population genetics, animal breeding, forest genetics, population dynamics, wildlife biometry, ecology, and agricultural and natural resource management.', 103963, '7.2', 79, 12),
('Biopsychology', 'A program that focuses on biological and psychological linkages, especially the linkages between biochemical and biophysical activity and the functioning of the central nervous system.', 136570, '3.0', 189, 31),
('Biostatistics', 'A program that focuses on the application of descriptive and inferential statistics to biomedical research and clinical, public health, and industrial issues related to human populations.  Includes instruction in mathematical statistics, modeling, clinical trials methodology, disease and survival analysis, longitudinal analysis, missing data analysis, spatial analysis, computer tomography, biostatistics consulting, and applications to such topics as genetics, oncology, pharmacokinetics, physiology, neurobiology, and biophysics.', 106771, '13.6', 916, 72),
('Biotechnology', 'A program that focuses on the application of the biological sciences, biochemistry, and genetics to the preparation of new and enhanced agricultural, environmental, clinical, and industrial products, including the commercial exploitation of microbes, plants, and animals.  Includes instruction in bioinformatics, gene identification, phylogenetics and comparative genomics, bioinorganic chemistry, immunoassaying, DNA sequencing, xenotransplantation, genetic engineering, industrial microbiology, drug and biologic development, enzyme-based production processes, patent law, biotechnology management and marketing, applicable regulations, and biotechnology ethics.', 103963, '7.2', 3006, 230),
('Blasting/Blaster', 'A program that prepares individuals to apply technical knowledge and skills in using a variety of explosive materials to aid in the construction process.  Includes instruction in safety procedures for storing, handling, placement, charge power determination, drilling, pounding, building demolition, preparing rocky surfaces for building foundations and demolition of explosives.', 66616, '9.9', 5, 1),
('Blood Bank Technology Specialist', 'A program that prepares individuals to perform routine and specialized blood testing procedures, collect and process blood donations, and support physicians and other clinicians administering transfusion therapy.  Includes instruction in basic cellular biology, immunohematology, blood bank procedures, blood typing, antigen and antibody identification tests, hemolytic and transfusion responses and diseases, donor selection, blood drawing and storage, blood separation, viral marker testing, laboratory and personnel supervision, safety and sterilization, and applicable laws and regulations.', 80277, '18.5', 173, 13),
('Boilermaking/Boilermaker', 'A program that prepares individuals to apply technical knowledge and skills to fabricate and repair steam boiler components.  Includes instruction in principles of steam power, material selection, welding, riveting, sealing materials, pressure testing, pipefitting, and applicable codes and standards.', 60660, '9.0', 26, 3),
('Advanced General Dentistry', 'A program that focuses on the advanced study of dental clinical techniques and dental practice issues.  Includes instruction in subjects such as the history of dentistry, advanced dental practice management, dental ethics and jurisprudence, social and behavioral science studies of dentistry, advanced restorative dentistry, oral medicine, oral radiology, advanced clinical procedures and technology, and others.', 172350, '18.0', 126, 18),
('Botany/Plant Biology', 'A program that focuses on the scientific study of plants, related microbial organisms, and plant habitats and ecosystem relations.  Includes instruction in plant anatomy and structure, phytochemistry, cytology, plant genetics, plant morphology and physiology, plant ecology, plant taxonomy and systematics, paleobotany, and applications of biophysics and molecular biology.', 103963, '7.2', 409, 57),
('Broadcast Journalism', 'A program that focuses on the methods and techniques for reporting, producing, and delivering news and news programs via radio, television, and video/film media; and that prepares individuals to be professional broadcast journalists, editors, producers, directors, and managers.  Includes instruction in the principles of broadcast technology; broadcast reporting; on- and off-camera and microphone procedures and techniques; program, sound, and video/film editing; program design and production; media law and policy; and professional standards and ethics.', 61400, '-3.8', 1205, 92),
('Buddhist Studies', 'A program that focuses on the philosophy preached by Siddartha Gautama, the Buddha, in ancient India and subsequently interpreted by his disciples and apostles; together with the intellectual, cultural, social, and ritual developments of the faith and its branches.  Includes instruction in Buddhist sacred literature (Tripitaka, etc.) and study of one or more of the main branches including Early Buddhism, Hinayana, Theravada, Madhyamaka, Yogacara, Pure Land, Shingon, Tendai, Nichiren Shu, Zen, Tibetan, Chinese, Korean, Vietnamese, and others.', 75140, '12.0', 2, 3),
('Building/Home/Construction Inspection/Inspector', 'A program that prepares individuals to apply industrial, labor, and governmental standards and laws to the oversight of construction projects and the maintenance of completed buildings and other structures.  Includes instruction in construction processes and techniques, materials analysis, occupational safety and health, industry standards, building codes and specifications, blueprint interpretation, testing equipment and procedures, communication skills, accident investigation, and documentation.', 65800, '9.7', 301, 51),
('Building/Property Maintenance', 'A program that prepares individuals to apply technical knowledge and skills to keep a building functioning, and to service a variety of structures including commercial and industrial buildings and mobile homes. Includes instruction in the basic maintenance and repair skills required to service  building systems, such as air conditioning, heating, plumbing, electrical, major appliances, and other mechanical systems.', 46258, '7.0', 2133, 135),
('Advanced Legal Research/Studies, General', 'An integrated or undifferentiated program in one or more of  the legal research or advanced practice fields.', 136260, '6.0', 2095, 62),
('Business Administration and Management, General', 'A program that generally prepares individuals to plan, organize, direct, and control the functions and processes of a firm or organization.  Includes instruction in management theory, human resources management and behavior, accounting and other quantitative methods, purchasing and logistics, organization and production, marketing, and business decision-making.', 111861, '6.8', 323627, 2764),
('Business and Personal/Financial Services Marketing Operations', 'A program that prepares individuals to perform marketing and operational tasks associated with the provision of personal and financial services.  Includes instruction in banking, marketing research, advertising, promotional campaign organization, insurance, media relations, and applicable technical and administrative skills.', 102860, '10.0', 774, 12),
('Business Family and Consumer Sciences/Human Sciences', 'A program that focuses on the relationship between the economy and the consuming individual and family.  Includes instruction in consumption theory and practice, the production and distribution of retail goods and services, and the management of business enterprises.', 56899, '4.2', 151, 4),
('Business Statistics', 'A program that focuses on the application of mathematical statistics to the description, analysis, and forecasting of business data.  Includes instruction in statistical theory and methods, computer applications, data analysis and display, long- and short-term forecasting methods, and market performance analysis.', 84071, '15.4', 481, 29),
('Business/Corporate Communications', 'A program that prepares individuals to function in an organization as a composer, editor and proofreader of business or business-related communications.', 75544, '3.1', 905, 72),
('Business/Office Automation/Technology/Data Entry', 'A program that prepares individuals to support business information operations by using computer equipment to enter, process, and retrieve data for a wide variety of administrative purposes.  Includes instruction in using basic business software and hardware, business computer networking, principles of desktop publishing, preparing mass mailings, compiling and editing spreadsheets, list maintenance, preparing tables and graphs, receipt control, and preparing business performance reports.', 30810, '-4.0', 3044, 273),
('CAD/CADD Drafting and/or Design Technology/Technician', 'A program that prepares individuals to apply technical skills and advanced computer software and hardware to the creation of graphic representations and simulations in support of engineering projects.  Includes instruction in engineering graphics, two-dimensional and three-dimensional engineering design, solids modeling, engineering animation, computer-aided drafting (CAD), computer-aided design (CADD), and auto-CAD techniques.', 56000, '-3.1', 2555, 281),
('Cardiopulmonary Technology/Technologist', 'A program that prepares individuals, under the supervision of physicians and nurses, to perform both cardiovascular and pulmonary diagnostic and therapeutic procedures.  Includes instruction in cardiopulmonary pharmacology; anatomy and physiology of the heart, peripheral vascular system, and lungs; pulmonary and cardiovascular disease and dysfunction; peripheral vascular Doppler procedures; invasive and non-invasive cardiology; pulmonary function tests; blood gas analysis; echocardiograph procedures; bronchoscopy; patient management; patient history taking and record-keeping; applications to clinical research; and emergency procedures.', 56100, '22.0', 46, 6),
('Cardiovascular Science', 'A program that focuses on the scientific study of the structure and functioning of the heart, vascular system, and blood in animals and human beings and the disorders and diseases associated with the cardiovascular system.  Includes instruction in cardiovascular physiology, blood physiology, vasculature, vascular metabolism, neural control of cardiovascular function, microvascular permeability and membrane transport, cardiac contraction mechanisms, homeostasis, and applications to topics such as arteriosclerosis, heart disease, diabetes, vascular remodeling, transplantation, transfusion, and pacemakers and artificial organs.', 93730, '8.0', 56, 5),
('Cardiovascular Technology/Technologist', 'A program that prepares individuals to perform invasive, noninvasive, and peripheral examinations of the cardiovascular system at the request of physicians to aid in diagnoses and therapeutic treatments.  Includes instruction in reviewing and recording patient histories and clinical data, patient care, investigative and examination procedures, diagnostic procedures, data analysis and documentation, physician consultation, equipment operation and monitoring, and professional standards and ethics.', 101474, '19.7', 1380, 98),
('Caribbean Studies', 'A program that focuses on the history, society, politics, culture, and economics of one or more of the peoples inhabiting the major islands and archipelagoes of the Caribbean Sea and related coastal borderlands, including immigration patterns and Pre-Columbian, colonial, and modern societies.', 81700, '15.0', 1, 1),
('Carpentry/Carpenter', 'A program that prepares individuals to apply technical knowledge and skills to lay out, cut, fabricate, erect, install, and repair wooden structures and fixtures, using hand and power tools.  Includes instruction in technical mathematics, framing, construction materials and selection, job estimating, blueprint reading, foundations and roughing-in, finish carpentry techniques, and applicable codes and standards.', 55746, '7.8', 3695, 287),
('Advertising', 'A program that focuses on the creation, execution, transmission, and evaluation of commercial messages in various media intended to promote and sell products, services, and brands; and that prepares individuals  to function as advertising assistants, technicians, and managers.  Includes instruction in advertising theory, marketing strategy, advertising design and production methods, campaign methods and techniques, media management, related principles of business management, and applicable technical and equipment skills.', 92058, '7.5', 5877, 151),
('Casino Management', 'A program that prepares individuals to manage casinos and gaming establishments. Includes instruction in casino operations, casino security and surveillance, principles of the gaming industry, ethics, and gaming law.', 50489, '-0.1', 25, 12),
('Cell/Cellular Biology and Histology', 'A program that focuses on the scientific study of the structure, function, and regulation of cells as individual units and as components of larger systems.  Includes instruction in cell chemistry, cellular dynamics, cellular replication and reproduction, cell anatomy, membrane function, organelles, cell adhesion and extracellular matrices, cell dynamics and motility, meiosis and mytosis, signal transduction, regulation, recognition and defense mechanisms, the cell cycle, cell metabolism and respiration, gene expression, and studies of cell types and characteristics.', 99039, '7.5', 641, 37),
('Ceramic Arts and Ceramics', 'A program that prepares individuals creatively and technically to express emotions, ideas, or inner visions by producing art works out of clay and similar materials.  Includes instruction in handbuilt and wheelthrown techniques; molding; slips and glazes; trimming and decorating; firing and kiln operation; oxidation; mixed media; ceramic murals; and personal style development.', 72462, '9.7', 284, 70),
('Ceramic Sciences and Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of inorganic non-metallic materials, such as porcelains, cements, industrial ceramics, ceramic superconductors, abrasive, and related materials and systems.', 130732, '3.6', 115, 5),
('Aeronautical/Aerospace Engineering Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers and other professionals engaged in developing, manufacturing and testing aircraft, spacecraft and their systems.  Includes instruction in aircraft/spacecraft systems technology, design and development testing, prototype and operational testing, inspection and maintenance procedures, instrument calibration, test equipment operation and maintenance, and report preparation.', 68620, '4.0', 643, 30),
('Chemical and Biomolecular Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of systems at the interface of chemical engineering and biology, with an emphasis at the molecular level, such as biopharmaceutical processes, protein engineering, metabolic engineering, gene therapy, biomaterials, cell and tissue engineering, and drug delivery. Includes instruction in chemical engineering, thermodynamics, organic chemistry, biochemistry, momentum and heat transfer, cellular and molecular biotechnology, process design, and chemical reactor design.', 120122, '3.8', 190, 12),
('Chemical Physics', 'A program that focuses on the scientific study of structural phenomena combining the disciplines of physical chemistry and atomic/molecular physics. Includes instruction in heterogeneous structures, alignment and surface phenomena, quantum theory, mathematical physics, statistical and classical mechanics, chemical kinetics, and laser physics.', 98238, '5.5', 54, 29),
('Chemical Technology/Technician', 'A program that prepares individuals to apply scientific principles and technical skills in support of chemical and biochemical research and industrial operations.  Includes instruction in principles of chemistry and biochemistry, technical mathematics, computer applications, radiochemistry, industrial biochemistry, chemical instrumentation, physical chemistry, laboratory research methods, industrial processing methods and equipment, and test equipment operation and maintenance.', 51260, '-4.3', 2188, 73),
('Chemistry, General', 'A general program that focuses on the scientific study of the composition and behavior of matter, including its micro- and macro-structure, the processes of chemical change, and the theoretical description and laboratory simulation of these phenomena.', 65870, '5.8', 20722, 1303);
INSERT INTO `majors` (`Name`, `Description`, `Average Salary`, `Expected Growth`, `No of Students`, `No of Offering Schools`) VALUES
('Aeronautics/Aviation/Aerospace Science and Technology, General', 'A program that focuses on the general study of aviation and the aviation industry, including in-flight and ground support operations.  Includes instruction in the technical, business, and general aspects of air transportation systems.', 95130, '2.0', 3512, 67),
('Child Care and Support Services Management', 'A program that focuses on the provision and management of child care services and that prepares individuals to plan, design, and manage child care facilities and programs that meet children''s developmental needs and interests and that provide safe and healthy environments.  Includes instruction in child development and psychology; home- and institution-based child care; identification of diseases, injuries, and psychological trauma and applicable referrals; parent relations; personnel and business management principles; and related laws and policies.', 32857, '6.8', 4310, 312),
('Child Care Provider/Assistant', 'A program that prepares individuals to be primary providers of home, family, residential, or institutional-based child care services.   Includes instruction in child growth and development, nutrition, recreation, planning and supervision of play and learning activities, child abuse and neglect prevention, parent-child relationships, and applicable legal and administrative requirements.', 22310, '6.0', 18809, 493),
('Child Development', 'A program that focuses on the intellectual, social, emotional, and biological development of children and the planning and design of related human services.  Includes instruction in parent-child relations, parenting practices, special needs of children, parental and environmental influences on child development, external support services, and related public policy issues.', 51820, '11.0', 4631, 242),
('Children and Youth Library Services', 'A program that prepares individuals to provide library and information services and programming for children and young adults. Includes instruction in information needs of children and young adults, resources and services for children and young adults, literature for youth, storytelling, multi-ethnic materials, library management, and information technology for librarians.', 59437, '2.2', 13, 2),
('Children''s and Adolescent Literature', 'A program that focuses on the scholarly study of children''s and adolescent literature and that may enhance the professional work of teachers, librarians, publishers, booksellers, and creative writers.  Includes instruction in period and genre studies, author studies, literary criticism, studies of various types of literary text, book artists, and children''s films.', 67969, '1.7', 57, 6),
('Chinese Language and Literature', 'A program that focuses on the languages of China and associated dialects and literature. Includes instruction in philology; linguistics; dialects and pidgins; and applications to business, science/technology, and other settings.', 56350, '22.2', 800, 119),
('Chinese Studies', 'A program that focuses on the history, society, politics, culture, and economics of one or more of the peoples of present-day China and its historical predecessors, related borderlands and island groups, and the overseas Chinese diaspora.', 81700, '15.0', 109, 26),
('Chiropractic Assistant/Technician', 'A program that prepares individuals, under the supervision of a chiropractor, to provide patient management, examination, and treatment services.  Includes instruction in the principles and procedures of chiropractic, radiographic X-Ray procedures and techniques, X-Ray film analysis and media studies, orthopedic and neurological testing, clinical laboratory procedures, patient management and education, office administrative skills, and applicable law and regulations.', 31910, '24.0', 21, 8),
('Cinematography and Film/Video Production', 'A program that prepares individuals to communicate dramatic information, ideas, moods, and feelings through the making and producing of films and videos. Includes instruction in theory of film, film technology and equipment operation, film production, film directing, film editing, cinematographic art, film audio, techniques for making specific types of films and/or videos, media technologies, computer image making, multi-media production, and the planning and management of film/video operations.', 81128, '10.2', 8198, 262),
('City/Urban, Community and Regional Planning', 'A program that prepares individuals to apply principles of planning, analysis, and architecture to the development and improvement of urban areas and surrounding regions, and to function as professional planners.  Includes instruction in principles of architecture; master plan development; service, communications, and transportation systems design; community and commercial development; zoning; land use planning; applied economics; policy analysis; applicable laws and regulations; and professional responsibilities and managerial duties.', 128466, '2.9', 3188, 125),
('Civil Drafting and Civil Engineering CAD/CADD', 'A program that prepares individuals to apply technical knowledge and skills to develop working drawing and electronic simulations in support of civil engineers, geological engineers, and related professionals.  Includes instruction in basic civil engineering principles, geological and seismographic mapping, machine drafting, computer-aided drafting (CAD), pipe drafting, survey interpretation, and blueprint reading.', 53470, '-3.0', 132, 26),
('Civil Engineering Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of civil engineers engaged in designing and executing public works projects such as highways, dams, bridges, tunnels and other facilities.  Includes instruction in site analysis, structural testing procedures, field and laboratory testing procedures, plan and specification preparation, test equipment operation and maintenance, and report preparation.', 51330, '5.0', 1520, 168),
('Classics and Classical Languages, Literatures, and Linguistics, General', 'A general program that focuses on the literary culture of the ancient Graeco-Roman world and the Greek and Latin languages and literatures and their development prior to the fall of the Roman Empire.', 56350, '22.2', 1586, 254),
('Clinical and Industrial Drug Development', 'A program that focuses on the scientific application of pharmacology, pharmaceutics, and industrial management to the development, production, marketing, and distribution of pharmaceutical products.  Includes instruction in industrial microbiology, plasmids, expression vectors, protein chemistry, assay and evaluation, drug synthesis and purification, quality control, industrial management, production security, patent procedures, intellectual property regulations and issues, patent enforcement and defense, and research design and testing.', 119270, '3.0', 196, 7),
('Clinical Child Psychology', 'A program that focuses on the developmental processes of children and associated disorders and that prepares individuals for the independent professional practice of clinical child psychology.  Includes instruction in developmental neuropsychology, child psychopathology, testing of children and adolescents, pediatric psychology, psychosocial variables in child development, clinical skills, family therapy, behavioral assessment and intervention, clinical skills, consultation, professional standards and ethics, and applications to topics such as infancy, childhood, and adolescence.', 103521, '7.5', 111, 12),
('Clinical Laboratory Science/Medical Technology/Technologist', 'A program that prepares individuals to conduct and supervise complex medical tests, clinical trials, and research experiments; manage clinical laboratories; and consult with physicians and clinical researchers on diagnoses, disease causation and spread, and research outcomes. Includes instruction in the theory and practice of hematology, clinical chemistry, microbiology, immunology, immunohematology, physiological relationships to test results, laboratory procedures and quality assurance controls, test and research design and implementation, analytic techniques, laboratory management, data development and reporting, medical informatics, and professional standards and regulations.', 89413, '16.6', 3575, 344),
('Clinical Nurse Leader', 'A program that prepares registered nurses for careers as clinical nurse leaders in which they work as part of an interdisciplinary team that provides direct medical care for patients based on evidence-based practice and research. Includes instruction in pharmacology, pathophysiology, epidemiology, research in nursing methods, advanced health assessment, statistics, and clinical practice management.', 71000, '16.0', 343, 36),
('Clinical Nurse Specialist', 'A program that prepares registered nurses to deliver direct patient and client care in clinical settings.  Includes instruction in clinical pharmacotherapeutics, advanced clinical practice, holistic nursing, nursing practice and health care policy, administration and consultation services, health assessment, patient stabilization and care, and patient education.', 71044, '16.1', 417, 49),
('Clinical Pastoral Counseling/Patient Counseling', 'A program that prepares individuals, including but not limited to, ordained clergy and other counseling professionals to respond to the emotional and/or spiritual needs of patients and families in health care emergencies and other situations, and to consult with and counsel other health care professionals. Includes instruction in advanced interpersonal communication; individual and small group counseling; interdisciplinary teamwork; crisis management; extended care relationships; self-analysis; medical ethics; pastoral care art; spiritual dimensions of human growth and health; counseling psychology and therapy; and applications to grief, death, emotional collapse, injury, individual/family adjustment, and chronic illness situations.', 45860, '17.8', 244, 27),
('Clinical Research Coordinator', 'A program that prepares individuals for careers as clinical research administrators or clinical research coordinators where they work under the supervision of a Principal Investigator to organize, coordinate and administer clinical research trials. Includes instruction in pharmacology, medical terminology, foundations of clinical research, project management, ethics, research design and data management, and legal and regulatory compliance .', 108879, '9.9', 255, 19),
('Clinical, Hospital, and Managed Care Pharmacy', 'A program that prepares individuals to deliver specialized pharmacy services and produce pharmaceutical products in clinical settings in conjunction with other health care professionals.  Includes instruction in biostatistics; clinical pharmacokinetics; biopharmaceutics; neuropharmacology; pharmacodynamics; drug metabolism; clinical sampling and research design; drug delivery systems; chemotherapy; pharmacotherapy; clinical pharmacy management; medical and research ethics; and applications to nuclear, nutrition support, oncology, psychiatric, and therapeutic pharmacy.', 119270, '3.0', 8, 5),
('Aerospace, Aeronautical and Astronautical/Space Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of aircraft, missiles, space vehicles, and their systems; applied research on flight and orbital characteristics; and the development of systems and procedures for the launching, guidance, and control of air and space vehicles.', 129409, '2.5', 5719, 83),
('Clinical/Medical Laboratory Technician', 'A program that prepares individuals, under the supervision of clinical laboratory scientists/medical technologists, to perform routine medical laboratory procedures and tests and to apply preset strategies to record and analyze data.  Includes instruction in general laboratory procedures and skills; laboratory mathematics; medical computer applications; interpersonal and communications skills; and the basic principles of hematology, medical microbiology, immunohematology, immunology, clinical chemistry, and urinalysis.', 80277, '18.5', 4384, 320),
('Cognitive Psychology and Psycholinguistics', 'A program that focuses on the scientific study of the mechanisms and processes of learning and thinking, and associated information encoding, decoding, processing and transmitting systems.  Includes instruction in theories of cognition and intelligence; studies of cognitive processes such as memory, sensation, perception, pattern recognition, problem solving, and conceptual thinking; cybernetics; psycholinguistics; and the study of biological and social communications mechanisms and processes.', 107840, '5.3', 122, 18),
('Aesthetician/Esthetician and Skin Care Specialist', 'A program that prepares individuals to cleanse, depilate, massage, and beautify the human body and to function as licensed estheticians and skin care specialists.  Includes instruction in skin anatomy, physiology, and health; principles of nutrition; decontamination and infection control; health and safety; facial and body massage; body wrapping and spa treatments; temporary hair removal including waxing and tweezing; color and skin analysis; client consultation and care; applicable laws and regulations; business practices; and sometimes related alternative healing regimens.', 35300, '12.0', 16431, 674),
('Commercial and Advertising Art', 'A program in the applied visual arts that prepares individuals to use artistic techniques to effectively communicate ideas and information to business and consumer audiences via illustrations and other forms of digital or printed media.  Includes instruction in concept design, layout, paste-up, and techniques such as engraving, etching, silkscreen, lithography, offset, drawing and cartooning, painting, collage, and computer graphics.', 54052, '1.1', 4750, 346),
('Commercial Photography', 'A program in the applied visual arts that prepares individuals to use artistic techniques to effectively communicate ideas and information to business and consumer audiences, and recording events and people, via digital, film, still and video photography.  Includes instruction in specialized camera and equipment operation and maintenance, applications to commercial and industrial needs, and photography business operations.', 64417, '8.3', 2292, 125),
('Communication, General', 'A program that focuses on the comprehensive study of communication, and that spans the study of  mass communication/media studies, old and new media technologies, social and political applications, and speech communication and rhetoric. Includes instruction in interpersonal, group, organizational, and intercultural communication; theories of communication; critical thinking, argumentation, and persuasion; written communication; printed, electronic, and digital media; rhetorical tradition and criticism; media, society, and culture; consequences and effects of mass media; media social science and criticism; and quantitative and qualitative methods of inquiry.', 63224, '1.0', 9627, 264),
('Communication Sciences and Disorders, General', 'A program that focuses on the application of biomedical, psychological, and physical principles to the study of the scientific bases, development, and treatment of speech, language, hearing, and cognitive communication problems caused by disease, injury, or disability. Includes instruction in language science, hearing science, speech and voice science, biology of communication, behavioral linguistics, psychology, and applications to the development of diagnostic and rehabilitative strategies and technologies.', 97788, '20.2', 6978, 122),
('Communications Systems Installation and Repair Technology', 'A program that prepares individuals to apply technical knowledge and skills to assemble, install, operate, maintain, and repair one- and two- way communications equipment and systems, including television cable systems and mobile or stationary communication devices.  Includes instruction in diagnostic techniques, the use of testing equipment and the principles of mechanics, electricity, and electronics as they relate to the repair of communications systems.', 53255, '-1.7', 403, 51),
('African Languages, Literatures, and Linguistics', 'A program that focuses on one or more of the languages native to the African continent, including, but not limited to, Bantu languages, Nilo-Saharan languages, Niger-Congo languages, Khoisan languages, and the Chadic and Ethiopic languages of the Hamito-Semitic language family. Includes instruction in philology, dialects, and oral and written literatures.', 56350, '22.2', 9, 2),
('Community Health and Preventive Medicine', 'A program that prepares public health specialists to plan and manage health services in local community settings, including the coordination of related support services, government agencies, and private resources.  Includes instruction in public health, community health services and delivery, health behavior and cultural factors, local government operations, human services, health communication and promotion, health services administration in local settings, environmental health, preventive and comparative medicine, epidemiology, biostatistics, family and community health, and applicable law and regulations.', 97332, '16.7', 1735, 61),
('Community Psychology', 'A program that prepares individuals to apply psychological principles to the analysis of social problems, and the implementation of intervention strategies for addressing these problems.  Includes instruction in social ecology, primary and secondary prevention of social pathologies, social intervention strategies and tactics, large group counseling, social services systems behavior, creating settings, cultural stress, and the dynamics of social change.', 107840, '5.3', 760, 43),
('Comparative Literature', 'A program that focuses on two or more literary traditions in the original languages or in translation.  Includes instruction in comparative linguistics; applicable foreign languages; English/French language and literature; literary criticism; and applications to genre, period, national, and textual studies as well as literary forms such as poetry, prose, and drama.', 71210, '10.0', 1231, 102),
('Computational and Applied Mathematics', 'A program that focuses on the application of a broad range of mathematical and computational methods to modeling, analysis, algorithm development, and simulation for the solution of complex scientific and engineering problems. Includes instruction in numerical analysis, discrete mathematics, operations research, optimization, differential equations, statistics, scientific computation, and applications to specific scientific and industrial topics.', 103220, '15.4', 212, 21),
('Computational Biology', 'A program that focuses on computational theoretical approaches to understanding biological systems, including computational models of biological processes, computational management of large-scale projects, database development and data-algorithm development, and high-performance computing, as well as statistical and mathematical analyses.', 93645, '4.6', 92, 18),
('Computational Science', 'A program that focuses on the study of scientific computing and its application.  Includes instruction in scientific visualization, multi-scale analysis, grid generation, data analysis, applied mathematics, numerical algorithms, high performance parallel computing, and numerical modeling and simulation with applications in science, engineering and other disciplines in which computation plays an integral role.', 96821, '3.0', 131, 24),
('Computer and Information Sciences, General', 'A general program that focuses on computing, computer science, and information science and systems. Such programs are undifferentiated as to title and content and are not to be confused with specific programs in computer science, information science, or related support services.', 98660, '13.0', 32964, 1058),
('Computer and Information Systems Security/Information Assurance', 'A program that prepares individuals to assess the security needs of computer and network systems, recommend safeguard solutions, and manage the implementation and maintenance of security devices, systems, and procedures.  Includes instruction in computer architecture, programming, and systems analysis; networking; telecommunications; cryptography; security system design; applicable law and regulations; risk assessment and policy analysis; contingency planning; user access issues; investigation techniques; and troubleshooting.', 99476, '11.0', 10505, 634),
('African-American/Black Studies', 'A program that focuses on the history, sociology, politics, culture, and economics of the North American peoples descended from the African diaspora; focusing on the United States, Canada, and the Caribbean, but also including reference to Latin American elements of the diaspora.', 81700, '15.0', 941, 190),
('Computer Engineering Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of computer engineers engaged in designing and developing computer systems and installations.  Includes instruction in computer electronics and programming, prototype development and testing, systems installation and testing, solid state and microminiature circuitry, peripheral equipment, and report preparation.', 61870, '-2.0', 1521, 151),
('Computer Graphics', 'A program that focuses on the software, hardware, and mathematical tools used to represent, display, and manipulate topological, two-, and three-dimensional objects on a computer screen and that prepares individuals to function as computer graphics specialists.  Includes instruction in graphics software and systems; digital multimedia; graphic design; graphics devices, processors, and standards; attributes and transformations; projections; surface identification and rendering; color theory and application; and applicable geometry and algorithms.', 70799, '-4.3', 2501, 157),
('Computer Hardware Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development, and evaluation of computer hardware and related peripheral equipment.  Includes instruction in computer circuit and chip design, circuitry, computer systems design, computer equipment design, computer layout planning, testing procedures, and related computer theory and software topics.', 129977, '3.7', 161, 6),
('Computer Installation and Repair Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to assemble, install, operate, maintain, and repair computers and related instruments.  Includes instruction in power supplies, number systems, memory structure, buffers and registers, microprocessor design, peripheral equipment, programming, and networking.', 45975, '1.2', 3309, 218),
