('Computer Technology/Computer Systems Technology', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of professionals who use computer systems.  Includes instruction in basic computer design and architecture, programming, problems of specific computer applications, component and system maintenance and inspection procedures, hardware and software problem diagnosis and repair, and report preparation.', 61870, '-2.0', 2359, 180),
('Concrete Finishing/Concrete Finisher', 'A program that prepares individuals to prepare, construct, and finish buildings, components, and related structures using compound masonry mixtures of stone, gravel, sand, cement, and water. Includes instruction in site preparation, applied mathematics, mixing formulas and applications, job estimation, concrete design, finishing techniques, mold preparation, reinforcement installation, site safety, and equipment operation and maintenance.', 60885, '10.7', 11, 7),
('Condensed Matter and Materials Physics', 'A program that focuses on the scientific study of macroscopic physical phenomena and properties that arise from basic microscopic interactions.  Includes instruction in low-temperature and solid-state physics, x-ray physics, liquids and soft materials, including the study of semiconductors, metals, superliquids, magnets, superconductors, glasses, gels, polymers, colloids, neural networks, and macromolecules.', 125868, '6.0', 12, 3),
('Construction Engineering', 'A program that prepares individuals to apply scientific, mathematical, and management principles to the planning, design, and building of facilities and structures.  Includes instruction in civil engineering, structural principles, site analysis, computer-assisted design, geology, evaluation and testing, materials, contracting, project management, graphic communications, and applicable laws and regulations.', 95783, '6.6', 602, 36),
('Construction Engineering Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers, engineering contractors and other professionals engaged in the construction of buildings and related structures.  Includes instruction in basic structural engineering principles and construction techniques, building site inspection, site supervision, construction personnel supervision, plan and specification interpretation, supply logistics and procurement, applicable building codes, and report preparation.', 77844, '6.6', 2632, 157),
('Construction Management', 'A program that prepares individuals to manage, coordinate, and supervise the construction process from concept development through project completion on timely and economic bases.  Includes instruction in commercial, residential, mechanical, highway/heavy civil, electrical, environmental, industrial, and specialty construction; facilities management; project planning; budgeting and cost control; logistics and materials management; personnel management and labor relations; site safety; construction contracting; construction processes and techniques; organization and scheduling; and applicable codes and regulations.', 97510, '5.0', 2533, 161),
('Construction/Heavy Equipment/Earthmoving Equipment Operation', 'A program that prepares individuals to apply technical knowledge and skills to operate and maintain a variety of heavy equipment, such as a crawler tractors, motor graders and scrapers, shovels, rigging devices, hoists, and jacks.  Includes instruction in digging, ditching, sloping, stripping, grading, and backfiling, clearing and excavating.', 46314, '7.9', 1466, 64),
('Consumer Economics', 'A program that focuses on the application of micro- and macro-economic theory to consumer behavior and individual and family consumption of goods and services.  Includes instruction in modeling, economic forecasting, indexing, price theory, and analysis of individual commodities and services and/or groups of related commodities and services.', 51820, '11.0', 172, 10),
('Consumer Merchandising/Retailing Management', 'A program that focuses on product and service promotion from the perspective of individual and family consumers and that prepares individuals to function as consumer management and marketing consultants in for-profit and non-profit enterprises.  Includes instruction in applied market research, consumer behavior, product sourcing and distribution, profitability, customer feedback and evaluation methods, promotion and retailing campaign development, and applications to specific domestic and international consumer markets.', 71396, '8.0', 266, 20),
('Cooking and Related Culinary Arts, General', 'A program that focuses on the general study of the cooking and related culinary arts, and that may prepare individuals for a variety of jobs within the food service industry.  Includes instruction in food preparation, cooking techniques, equipment operation and maintenance, sanitation and safety, communication skills, applicable regulations, and principles of food service management.', 28753, '11.1', 4071, 139),
('Corrections', 'A program that prepares individuals to study the theories and principles, of correctional science and to function as professional corrections officers and other workers in public and/or private incarceration facilities.', 54008, '4.4', 5715, 242),
('Accounting and Finance', 'An integrated or combined program in accounting and finance that prepares individuals to function as accountants and financial managers or analysts.', 92917, '9.9', 1854, 99),
('Agricultural and Food Products Processing', 'A program that prepares individuals to receive, inspect, store, process, and package agricultural products in the form of human food consumables, animal or plant food, or other industrial products.  Includes instruction in the nutrient and industrial properties of various agricultural products; logistics and storage procedures; chemical and mechanical processing operations; packaging; safety and health requirements; and related technical and business principles.', 57254, '-2.5', 159, 22),
('Corrections Administration', 'A program that prepares individuals to plan and manage institutional facilities and programs for housing and rehabilitating prisoners in the public and/or private sectors.  Includes instruction in the principles and practice of correction, facilities planning and management, safety and security, social and health services, staff and inmate management, budgeting, communication skills, correctional psychology, and applications to specific types of correctional facilities approaches.', 63201, '7.6', 170, 20),
('Cosmetology, Barber/Styling, and Nail Instructor', 'A program that prepares cosmetologists, barbers, stylists, nail technicians, and other grooming specialists to teach their specializations in licensed and accredited schools of cosmetology and barbering, and to prepare for licensure as instructors.  Includes instruction in cosmetology arts and sciences teaching principles; student learning styles; professional curricula development; instructional planning; instructional methods and aids; student counseling and career assistance; test development; and classroom/clinic management.', 28785, '10.0', 2035, 759),
('Cosmetology/Cosmetologist, General', 'A program that generally prepares individuals to cut, trim, and style scalp, facial, and body hair; apply cosmetic preparations; perform manicures and pedicures; massage the head and extremities; and prepare for practice as licensed cosmetologists in specialized or full-service salons.  Includes instruction in hair cutting and styling, manicuring, pedicuring, facial treatments, shampooing, chemical applications, esthetics, shop management, sanitation and safety, customer service, and applicable professional and labor laws and regulations.', 28659, '10.2', 77073, 1844),
('Costume Design', 'A program that prepares individuals to design and select costumes for characters in theatre and the performing arts and to serve as part of a production team. Includes instruction in costume design, script analysis, theory and criticism, period styles, history of costume, stage makeup, rendering, and costume construction.', 76137, '9.7', 54, 10),
('Counseling Psychology', 'A program that prepares individuals for the independent professional practice of psychological counseling, involving the rendering of therapeutic services to individuals and groups experiencing psychological problems and exhibiting distress symptoms.  Includes instruction in counseling theory, therapeutic intervention strategies, patient/counselor relationships, testing and assessment methods and procedures, group therapy, marital and family therapy, child and adolescent therapy, supervised counseling practice, ethical standards, and applicable regulations.', 101740, '8.1', 11052, 338),
('Court Reporting/Court Reporter', 'A program that prepares individuals to record and transcribe examinations, testimony, judicial orders and instructions, legal opinions, and other formal proceedings via print or electronic methods.  Includes instruction in legal terminology, legal transcription, shorthand, verbatim recording, equipment operation and procedures, applicable regulations, and professional standards and ethics.', 54720, '2.0', 691, 70),
('Creative Writing', 'A program that focuses on the process and techniques of original composition in various literary forms such as the short story, poetry, the novel, and others.  Includes instruction in technical and editorial skills, criticism, and the marketing of finished manuscripts.', 67969, '1.7', 7188, 411),
('Credit Management', 'A program that prepares individuals to perform and/or manage operations concerning personal and corporate credit, collateral, loan processing, and related financial agency communications.  Includes instruction in general finance and banking principles, insurance, real estate, taxation, business law and regulations, quantitative methods, financial computer systems applications, database management, communications skills, business and office management, and professional standards and ethics.', 108229, '7.5', 6, 5),
('Criminal Justice/Law Enforcement Administration', 'A program that prepares individuals to apply theories and practices of organization management and criminal justice to the administration of public law enforcement agencies and operations.  Includes instruction in law enforcement history and theory, operational command leadership, administration of public police organizations, labor relations, incident response strategies, legal and regulatory responsibilities, budgeting, public relations, and organizational leadership.', 104652, '4.5', 32585, 856),
('Criminal Justice/Police Science', 'A program that prepares individuals to perform the duties of police and public security officers, including patrol and investigative activities, traffic control, crowd control and public relations, witness interviewing, evidence collection and management, basic crime prevention methods, weapon and equipment operation and maintenance, report preparation and other routine law enforcement responsibilities.', 63038, '4.5', 32533, 705),
('Criminal Justice/Safety Studies', 'A program that focuses on the criminal justice system, its organizational components and processes, and its legal and public policy contexts.  Includes instruction in criminal law and policy, police and correctional systems organization, the administration of justice and the judiciary, and public attitudes regarding criminal justice issues.', 77614, '5.3', 49765, 924),
