('Agricultural Business and Management, General', 'A  general program that focuses on modern business and economic principles involved in the organization, operation, and management of agricultural enterprises.', 87380, '3.5', 2027, 119),
('Curriculum and Instruction', 'A program that focuses on the curriculum and related instructional processes and tools, and that may prepare individuals to serve as professional curriculum specialists.  Includes instruction in curriculum theory, curriculum design and planning, instructional material design and evaluation, curriculum evaluation, and applications to specific subject matter, programs or educational levels.', 64870, '7.0', 19395, 458),
('Customer Service Management', 'A program that prepares individuals to supervise and monitor customer service performance and manage frontline customer support services, call centers/help desks, and customer relations.  Includes instruction in customer behavior, specialized information technology and systems management, developing and using customer service databases, user surveys and other feedback mechanisms, strategic and performance planning and analysis, operations management, personnel supervision, and communications and marketing skills.', 56170, '8.0', 498, 37),
