('Cytotechnology/Cytotechnologist', 'A program that prepares individuals to work with pathologists to detect changes in body cells that may indicate, and permit diagnosis of, the early development of cancers and other diseases.  Includes instruction in biochemistry, microbiology, applied mathematics, microscopy, slide preparation, identification of cellular structures and abnormalities, and laboratory procedures and safety.', 89413, '16.6', 108, 29),
