('Dental Clinical Sciences, General', 'An integrated or undifferentiated program that generally prepares dentists in one or more of the oral sciences and advanced/graduate dentistry specialties.', 116211, '18.7', 403, 33),
('Dental Hygiene/Hygienist', 'A program that prepares individuals to clean teeth and apply preventive materials, provide oral health education and treatment counseling to patients, identify oral pathologies and injuries, and manage dental hygiene practices.  Includes instruction in dental anatomy, microbiology, and pathology; dental hygiene theory and techniques; cleaning equipment operation and maintenance; dental materials; radiology; patient education and counseling; office management; supervised clinical training; and professional standards.', 92423, '19.0', 8354, 365),
('Dental Laboratory Technology/Technician', 'A program that prepares individuals, under the supervision of dentists, to design and construct dental prostheses such as caps, crowns, bridges, dentures, splints, and orthodontic appliances.  Includes instruction in dental anatomy, dental materials, ceramics technology, impressions, complete dentures, partial dentures, orthodontics, crowns and bridges, sculpture, bonding and assembly techniques, and equipment operation.', 101683, '17.6', 461, 43),
('Dental Materials', 'A program that focuses on the scientific study of the biomaterials and inert and active compounds used in dental procedures; the development of dental materials; and their effects on the living tissues of the oral cavity and systemic bodily health.  Includes instruction in materials science, dental bioengineering, biocompatibility of materials, physics and mechanics of dental materials, elastic and plastic deformation, surface bonding, and applications to fixed and removable prostheses and restorative procedures.', 171040, '9.0', 2, 2),
('Dentistry', 'A program that prepares individuals for the independent professional practice of dentistry/dental medicine, encompassing the evaluation, diagnosis, prevention, and treatment of diseases, disorders, and conditions of the oral cavity, maxillofacial area, and adjacent structures and their impact on the human body and health.  Includes instruction in the basic biomedical sciences, occlusion, dental health and prevention, oral pathology, cariology, operative dentistry, oral radiology, principles of the various dental specialties, pain management, oral medicine, clinic and health care management, patient counseling, and professional standards and ethics.', 135259, '18.6', 5934, 65),
('Agricultural Economics', 'A program that focuses on the application of economics to the analysis of resource allocation, productivity, investment, and trends in the agricultural sector, both domestically and internationally.  Includes instruction in economics and related subfields as well as applicable agricultural fields.', 104536, '6.0', 2279, 58);
INSERT INTO `majors` (`Name`, `Description`, `Average Salary`, `Expected Growth`, `No of Students`, `No of Offering Schools`) VALUES
('Development Economics and International Development', 'A program that focuses on the systematic study of the economic development process and its application to the problems of specific countries and regions.  Includes instruction in economic development theory, industrialization, land reform, infrastructural development, investment policy, the role of governments and business in development, international development organizations, and the study of social, health, and environmental influences on economic development.', 110996, '4.3', 696, 44),
('Developmental and Child Psychology', 'A program that focuses on the scientific study of the psychological growth and development of individuals from infancy through adulthood.  Includes instruction in cognitive and perceptual development, emotional development, personality development, the effects of biological maturation on behavior, theories of cognitive growth and related research methods, testing and assessment methods for different age levels, research on child and adolescent behavior therapy, and the psychology of aging.', 101740, '8.1', 1050, 66),
('Developmental Services Worker', 'A program that prepares individuals to apply practical knowledge and skills to support individuals with a variety of physical, mental or developmental disabilities in a family or community setting. Includes instruction in health care, basic nutrition, pharmacology, nursing, autism, mental health, psychology, sociology, behavioral analysis, communication, intervention, counseling and community services, and developmental services, such as literacy and life skills training.', 33190, '11.0', 69, 8),
('Agricultural Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of systems, equipment and facilities for production, processing, storage, handling, distribution and use of food, feed, and fiber. Includes applications to aquaculture, forestry, human and natural resources.', 134620, '3.9', 1441, 49),
('Diagnostic Medical Sonography/Sonographer and Ultrasound Technician', 'A program that prepares individuals, under the supervision of physicians, to utilize medical ultrasound techniques to gather sonographic data used to diagnose a variety of conditions and diseases.  Includes instruction in obtaining, reviewing, and integrating patient histories and data; patient instruction and care; anatomic, physiologic and pathologic data recording; sonographic data processing; sonography equipment operation; and professional standards and ethics.', 103382, '20.8', 5120, 292),
('Dietetic Technician', 'A program that prepares individuals, under the supervision of registered dietitians and nutritionists, to implement nutritional and dietetic plans and provide direct client and patient services.  Includes instruction in human nutrition, client interviewing and record keeping, dietary planning, food preparation and safety, food worker supervision, food service establishment monitoring and inspection, and applicable procedures and regulations.', 29170, '13.0', 408, 43),
('Dietitian Assistant', 'A program that prepares individuals to assist registered dietitians in planning, preparing and serving meals to individuals with specific dietary needs.  Includes instruction in equipment use, food preparation, diet regulations, food handling, safety and sanitary standards and administrative techniques and procedures.', 29170, '13.0', 179, 29),
('Digital Arts', 'A general, undifferentiated program that focuses on the use of computerized digital images as the primary medium of expression in the visual and performing arts, and that may prepare individuals for a wide variety of careers using new media, including graphic design, digital animation, motion graphics, 3D visualization, game and interactive media design, music and sound design, video production, web design, photography, and other fields.', 61700, '4.0', 1539, 129),
('Agricultural Mechanics and Equipment/Machine Technology', 'A program that prepares individuals to maintain and repair specialized farm, ranch, and agribusiness power equipment and vehicles.  Includes instruction in the principles of diesel, combustion, electrical, steam, hydraulic, and mechanical systems and their application to the maintenance of terrestrial and airborne crop-spraying equipment; tractors and hauling equipment; planting and harvesting equipment; cutting equipment; power sources and systems for silos; irrigation and pumping equipment; dairy, feeding, and shearing operations; and processing systems.', 52982, '3.5', 797, 37),
('Disability Studies', 'A program that focuses on the nature, meaning, and consequences of what it is to be defined as disabled and explores the historical, cultural, economic, physiological, and socio-political dynamics of disability. Includes instruction in disability rights, legal issues, and public policy; literature, philosophy, and the arts; and/or research in the social sciences, education, and health sciences addressing social and experiential aspects of disability.', 81700, '15.0', 118, 12),
('Diver, Professional and Instructor', 'A program that prepares individuals to apply technical knowledge and skills to function as professional deep-water or scuba divers, diving instructors, or diving support personnel.  Includes instruction in the use of diving equipment and related specialized gear; diving safety procedures; operation and maintenance of underwater life-support systems; underwater communication systems; decompression systems; underwater salvage; exploration, rescue, and photography; and installation and fitting of underwater mechanical systems and their maintenance, repair or demolition.', 54640, '37.0', 948, 10),
('Divinity/Ministry', 'A program that prepares individuals for ordination as ministers or priests in any of the Christian religious traditions.  Includes instruction in the theology and polity of a particular church, church law, liturgy and ritual, principles of pastoral ministry, homiletics, evangelism, church/parish organization and management, Christian ethics, church history, and related studies.', 57071, '8.0', 7188, 264),
('Dog/Pet/Animal Grooming', 'A program that prepares individuals to provide cosmetic services for household pets, show animals, work animals and animal athletes.  Includes instruction in skin, coat, and pelt grooming and styling; skin care; hoof, nail, and claw care; animal massage; minor first aid and veterinary referral; animal grooming products and applications; health and safety; and applicable regulations.', 23630, '11.0', 73, 6),
('Agricultural Mechanization, General', 'A program that generally prepares individuals to sell, select, and service agricultural or agribusiness technical equipment and facilities, including computers, specialized software, power units, machinery, equipment structures, and utilities.  Includes instruction in agricultural power systems, planning and selecting materials for the construction of support facilities, mechanical practices associated with irrigation and water conservation, erosion control, and agricultural data processing systems.', 50262, '6.8', 525, 34),
('Drafting and Design Technology/Technician, General', 'A program that prepares individuals to generally apply technical skills to create working drawings and computer simulations for a variety of applications.  Includes instruction in specification interpretation, dimensioning techniques, drafting calculations, material estimation, technical communications, computer applications, and interpersonal communications.', 56000, '-3.1', 6388, 518),
('Drama and Dance Teacher Education', 'A program that prepares individuals to teach drama and/or dance programs at various educational levels.', 61012, '6.4', 207, 84),
('Drawing', 'A program that prepares individuals creatively and technically to express emotions, ideas, or inner visions through representation by lines made on a surface.  Includes instruction in eye-hand coordination; line, value, shape, and perspective; figure and still life drawing; the use of media such as pen and ink, pencil, charcoal, pastel, and brush; and personal style development.', 62348, '4.7', 375, 65),
('Driver and Safety Teacher Education', 'A program that prepares individuals to teach driver and safety education programs at various educational levels.', 58359, '6.3', 5, 2),
('Drywall Installation/Drywaller', 'A program that prepares individuals to apply technical knowledge and skills to install, tape, and plaster drywall installations in interior and exterior construction jobs. Includes instruction in drywall handling and transport, cutting and mounting, taping and spackling, finishing, job analysis and estimation, site safety, tool operation and maintenance, blueprint and specification interpretation, and applicable codes and standards.', 63709, '9.3', 169, 7),
('Dutch/Flemish Language and Literature', 'A program that focuses on the Dutch language and related dialects. Includes instruction in philology; literature; Dutch Creoles; and applications to business, science/technology, and other settings.', 56350, '22.2', 1, 3),
('E-Commerce/Electronic Commerce', 'A program that prepares individuals to plan, manage, supervise, and market electronic business operations, products, and services provided online via the Internet.  Includes instruction in business administration, information technology, information resources management, web design, computer and Internet law and policy, computer privacy and security, e-trading, insurance, electronic marketing, investment capital planning, enterprise operations, personnel supervision, contracting, and product and service networking.', 50119, '6.2', 582, 111),
('Agricultural Power Machinery Operation', 'A program that prepares individuals to operate specialized farm, ranch, and agribusiness power equipment of a stationary, mobile, and/or hand-operated nature.  Includes instruction in operating specialized equipment such as terrestrial and airborne crop-spraying equipment; tractors and hauling equipment; planting and harvesting equipment; cutting equipment; power sources and systems for silos, irrigation, pumping, and applications such as dairy, feeding and shearing operations; processing equipment; and applicable electrical, mechanical, and safety principles.', 42582, '6.1', 171, 11),
('Early Childhood Education and Teaching', 'A program that prepares individuals to teach students ranging in age from infancy through eight years (grade three), depending on the school system or state regulations.  Includes preparation to teach all relevant subject matter.', 39088, '6.7', 30613, 1044),
('East Asian Languages, Literatures, and Linguistics, General', 'A general program that focuses on one or more of the languages of East Asia, including, but not limited to, the Sino-Tibetan, Japanese, and Korean languages. Includes instruction in philology; linguistics; dialects and pidgins; literature; and applications to business, science/technology, and other settings.', 56350, '22.2', 310, 21),
('East Asian Studies', 'A program that focuses on the history, society, politics, culture, and economics of one or more of the peoples of East Asia, defined as including China, Korea, Japan, Mongolia, Taiwan, Tibet, related borderlands and island groups, and including the study of the East Asian diasporas overseas.', 81700, '15.0', 688, 91),
('Ecology and Evolutionary Biology', 'A program that focuses on the scientific study of the relationships and interactions across levels of biological organization--genes and genomes, organisms, species, and ecosystems--and how these change over time, including the origins and history of species, the processes by which biodiversity has evolved, and the ecological context in which this evolution takes place. Includes instruction in animal, plant, population, functional, evolutionary, and ecosystem ecology; ecological and evolutionary genetics; molecular evolution; population and conservation biology; animal and plant diversity; biometry; and scientific and research ethics.', 103963, '7.2', 507, 22),
('Econometrics and Quantitative Economics', 'A program that focuses on the systematic study of mathematical and statistical analysis of economic phenomena and problems.  Includes instruction in economic statistics, optimization theory, cost/benefit analysis, price theory, economic modeling, and economic forecasting and evaluation.', 110996, '4.3', 845, 48),
('Economics, General', 'A general program that focuses on the systematic study of the production, conservation and allocation of resources in conditions of scarcity, together with the organizational frameworks related to these processes.  Includes instruction in economic theory, micro- and macroeconomics, comparative economic systems, money and banking systems, international economics, quantitative analytical methods, and applications to specific industries and public policy issues.', 109328, '4.5', 39837, 832),
('Education, General', 'A program that focuses on the general theory and practice of learning and teaching, the basic principles of educational psychology, the art of teaching, the planning and administration of educational activities, school safety and health issues, and the social foundations of education.', 68200, '9.0', 30098, 753),
('Agricultural Production Operations, General', 'A program that focuses on the general planning, economics, and use of facilities, natural resources, equipment, labor, and capital to produce plant and animal products, and that may prepare individuals for work in farming, ranching, and agribusiness.', 64878, '-3.1', 729, 57),
('Education Policy Analysis', 'A program that focuses on the systematic analysis of public policy issues related to education and educational systems at the local, state, national, and international levels. Includes instruction in social and cultural issues in education, contemporary educational policies, history of education, economics of education, international and comparative education, education and social change, educational research and evaluation methods, and applications to specific public policy topics.', 75197, '5.8', 35, 6),
('Education/Teaching of Individuals in Early Childhood Special Education Programs', 'A program that focuses on the design and provision of teaching and other educational services to infant and pre-school age children with special learning needs or disabilities, and that prepares individuals to teach such students.  Includes instruction in diagnosing learning disabilities, developing individual education plans, teaching and supervising special education students, special education counseling, and applicable laws and policies.', 58210, '9.0', 1539, 145),
('Education/Teaching of Individuals in Elementary Special Education Programs', 'A program that focuses on the design and provision of teaching and other educational services to children with special learning needs or disabilities who are in the elementary grades. Includes instruction in diagnosing learning disabilities; developing individual education plans; curriculum development, instructional strategies, and classroom management for elementary special education; and teaching elementary education subject matter.', 58640, '6.0', 1339, 52),
('Education/Teaching of Individuals in Junior High/Middle School Special Education Programs', 'A program that focuses on the design and provision of teaching and other educational services to children with special learning needs or disabilities who are in junior high/middle school. Includes instruction in diagnosing learning disabilities; developing individual education plans; curriculum development, instructional strategies, and classroom management for middle school special education; and principles of middle school instruction in specific subjects.', 60300, '6.0', 142, 12),
('Education/Teaching of Individuals in Secondary Special Education Programs', 'A program that focuses on the design and provision of teaching and other educational services to children with special learning needs or disabilities who are in the secondary grades. Includes instruction in diagnosing learning disabilities; developing individual education plans; curriculum development, instructional strategies, and classroom management for secondary grades special education; content, methods, and modifications in specific subject areas; issues in vocational education; and promoting successful transitions to postsecondary settings.', 62180, '6.0', 615, 31),
('Education/Teaching of Individuals Who are Developmentally Delayed', 'A program that focuses on the design of educational services for children or adults who exhibit slow social, physical, cognitive, or emotional growth patterns related to age, or a combination of such factors that affect learning, and that prepares individuals to teach such students.  Includes instruction in identification of developmental delay patterns, developing individual education plans, teaching and supervising developmentally delayed students, counseling, and applicable laws and policies.', 59798, '6.3', 211, 9),
('Education/Teaching of Individuals with Emotional Disturbances', 'A program that focuses on the design of educational services for children or adults with emotional conditions which adversely affect their educational performance and that may prepare individuals to teach such students.  Includes instruction in identifying students with emotional disturbances, developing individual education plans, teaching and supervising emotionally disturbed students, counseling, and applicable laws and policies.', 59798, '6.3', 260, 32),
('Education/Teaching of Individuals with Hearing Impairments Including Deafness', 'A program that focuses on the design of educational services for children or adults with hearing impairments including deafness which adversely affect their educational performance, and that may prepare individuals to teach such students.  Includes instruction in identifying students with hearing impairments, including deafness, developing individual education plans, teaching and supervising hearing-impaired students, counseling, and applicable laws and policies.', 58734, '8.4', 398, 49),
('Education/Teaching of Individuals with Mental Retardation', 'A program that focuses on the design of educational services for children or adults with mental disabilities which adversely affect their educational performance and that may prepare individuals to teach such students.  Includes instruction in identifying students with mental retardation, developing individual education plans, teaching and supervising mentally handicapped students, counseling, and applicable laws and policies.', 59798, '6.3', 275, 29),
('Education/Teaching of Individuals with Multiple Disabilities', 'A program that focuses on the design of educational services for children or adults with multiple disabilities which adversely affect their educational performance and that may prepare individuals to teach such students.  Includes instruction in identifying students with multiple disabilities, developing individual education plans, teaching and supervising students with multiple handicaps, counseling, and applicable laws and policies.', 59798, '6.3', 477, 28),
('Education/Teaching of Individuals with Orthopedic and Other Physical Health Impairments', 'A program that focuses on the design of educational services for children or adults with orthopedic and other health impairments which adversely affect their educational performance and that may prepare individuals to teach such students.  Includes instruction in identifying physically disabled students, developing individual education plans, teaching and supervising students with orthopedic and other health impairments, counseling, and applicable laws and policies.', 59798, '6.3', 85, 10),
('Education/Teaching of Individuals with Specific Learning Disabilities', 'A program that focuses on the design of educational services for children or adults with specific learning disabilities which adversely affect their educational performance and that may prepare individuals to teach such students.  Includes instruction in identifying students with specific learning disabilities, developing individual education plans, teaching and supervising students with specific learning disabilities, counseling, and applicable laws and policies.', 59798, '6.3', 532, 72),
('Education/Teaching of Individuals with Speech or Language Impairments', 'A program that focuses on the study and design of educational services for children or adults with speech and language impairments which adversely affect their educational performance and that may prepare individuals to teach such students.  Includes instruction in identifying students with speech and language impairments, developing individual education plans, teaching and supervising students with speech disabilities, counseling, and applicable laws and policies.', 59798, '6.3', 481, 27),
('Education/Teaching of Individuals with Vision Impairments Including Blindness', 'A program that focuses on the design of educational services for children or adults with visual disabilities which adversely affect their educational performance and that may prepare individuals to teach such students.  Includes instruction in identifying students with visual impairments, developing individual education plans, teaching and supervising blind or visually handicapped students, counseling, and applicable laws and policies.', 59798, '6.3', 145, 19),
('Educational Psychology', 'A program that focuses on the application of psychology to the study of the behavior of individuals in the roles of teacher and learner, the nature and effects of learning environments, and the psychological effects of methods, resources, organization and non-school experience on the educational process.  Includes instruction in learning theory, human growth and development, research methods, and psychological evaluation.', 107840, '5.3', 1962, 114),
('Educational/Instructional Technology', 'A program that focuses on integrating technology into educational curricula. Includes instruction in foundations of educational technology, computer applications, utilizing technology for assessment, multimedia instruction, web-based instruction, distance education, and designing and producing educational software and materials.', 63738, '7.1', 5791, 288),
('Electrical and Electronics Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of electrical and electronic systems and their components, including electrical power generation systems; and the analysis of problems such as superconductor, wave propagation, energy storage and retrieval, and reception and amplification.', 113715, '1.3', 29409, 393),
('Electrical and Power Transmission Installation/Installer, General', 'A program that generally prepares individuals to apply technical knowledge and skills to install indoor and outdoor residential, commercial, and industrial electrical systems, and associated power transmission lines.  Includes instruction in electricity, safety procedures, wiring, insulation and grounding, schematic blueprint interpretation, equipment operation and maintenance, and applicable codes and standards.', 65841, '6.2', 1408, 76),
('Agricultural/Farm Supplies Retailing and Wholesaling', 'A program  that prepares individuals to sell agricultural products and supplies, provide support services to agricultural enterprises, and purchase and market agricultural products.  Includes instruction in basic business management, marketing, retailing and wholesaling operations, and applicable principles of agriculture and agricultural operations.', 43768, '-2.9', 351, 22),
('Electrical, Electronic and Communications Engineering Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of electrical, electronics and communication engineers.  Includes instruction in electrical circuitry, prototype development and testing, systems analysis and testing, systems maintenance, instrument calibration, and report preparation.', 61870, '-2.0', 10786, 686),
('Electrical/Electronics Drafting and Electrical/Electronics CAD/CADD', 'A program that prepares individuals to apply technical knowledge and skills to develop working schematics and representations in support of electrical/electronic engineers, computer engineers, and related professionals.  Includes instruction in basic electronics, electrical systems and computer layouts; electrode-mechanical drafting; manufacturing circuitry; computer-aided drafting (CAD); and electrical systems specification interpretation.', 62890, '5.0', 63, 14),
('Electrocardiograph Technology/Technician', 'A program that prepares individuals, under the supervision of physicians and nurses, to administer EKG and ECG diagnostic examinations and report results to the treatment team.  Includes instruction in basic anatomy and physiology, the cardiovascular system, medical terminology, cardiovascular medications and effects, patient care, EKG and ECG administration, equipment operation and maintenance, interpretation of cardiac rhythm, patient record management, and professional standards and ethics.', 101474, '19.7', 766, 49),
('Electrolysis/Electrology and Electrolysis Technician', 'A program that prepares individuals to permanently remove hair from the human scalp, face, and body using specialized charged solid needle probes, and to function as licensed electrologists and electrolysis technicians.  Includes instruction in direct current electrolysis, alternating current/high frequency thermolysis, blend/dual modality treatments, equipment theory and operation, safety and sanitation, client evaluation and care, laws and regulations, and business practices.', 28770, '10.0', 187, 13),
('Electromechanical Engineering', 'A program that prepares individuals to apply scientific and mathematical principles to the problems associated with combining electrical and mechanical components with special emphasis on manufacturing and automated processes. Includes instruction in applied mechanics, instrumentation and monitoring, machine design, automated control techniques, fluid and thermal dynamics, circuit analysis, and solid state electronics.', 106645, '4.4', 56, 2),
('Agriculture, General', 'A program that focuses on the general principles and practice of agricultural research and production and that may prepare individuals to apply this knowledge to the solution of practical agricultural problems.  Includes instruction in basic animal, plant, and soil science; animal husbandry and plant cultivation; soil conservation; and agricultural operations such as farming, ranching, and agricultural business.', 75321, '5.7', 2993, 172),
('Electromechanical Technology/Electromechanical Engineering Technology', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers engaged in developing and testing automated, servomechanical, and other electromechanical systems.  Includes instruction in prototype testing, manufacturing and operational testing, systems analysis and maintenance procedures, and report preparation.', 56320, '1.0', 1868, 110),
('Electroneurodiagnostic/Electroencephalographic Technology/Technologist', 'A program that prepares individuals, under the supervision of a physician, to study and record electrical activity in the brain and nervous system for purposes of patient monitoring and supporting diagnoses.  Includes instruction in patient communication and care; taking and abstracting patient histories; application of recording electrodes; EEG, EP, and PSG equipment operation and procedural techniques; and data recording and documentation.', 89222, '20.5', 294, 34),
('Elementary and Middle School Administration/Principalship', 'A program that focuses on educational administration at the elementary and middle school (K-7) levels, and prepares individuals to serve as principals and masters of elementary and middle schools.  Includes instruction in elementary and/or middle school education, program and facilities planning, budgeting and administration, public relations, human resources management, childhood and pre-adolescent growth and development, counseling skills, applicable law and regulations, school safety, policy studies, and professional standards and ethics.', 92940, '6.0', 1438, 60),
('Elementary Education and Teaching', 'A program that prepares individuals to teach students in the elementary grades, which may include kindergarten through grade eight, depending on the school system or state regulations.  Includes preparation to teach all elementary education subject matter.', 57730, '6.0', 41786, 1240),
('Elementary Particle Physics', 'A program that focuses on the scientific study of the basic constituents of sub-atomic matter and energy, and the forces governing fundamental processes.  Includes instruction in quantum theory, field theory, single-particle systems, perturbation and scattering theory, matter-radiation interaction, symmetry, quarks, capture, Schroedinger mechanics, methods for detecting particle emission and absorption, and research equipment operation and maintenance.', 125868, '6.0', 2, 1),
('Emergency Care Attendant (EMT Ambulance)', 'A program that prepares individuals to assist licensed EMTs, under the supervision of a physician, to prepare and transport ill or injured patients, and to operate emergency vehicles and equipment such as life support units.  Includes instruction in first aid and emergency medicine field techniques, patient stabilization and care, medical field communications, equipment operation and maintenance, emergency vehicle operation, and applicable standards and regulations.', 25470, '33.0', 2997, 86),
('Endocrinology', 'A program that focuses on the scientific study of the composition, manufacture, and secretion of protein compounds by cells and glands and the role of endocrine substances in bodily processes.  Includes instruction in protein chemistry, protein secretion, membrane biogenesis and transfer methods, cellular communication, gene and cell regulation, cytochemistry, fractionation, radioautography, and applications such as neuroendocrinology.', 93730, '8.0', 4, 2),
('Endodontics/Endodontology', 'A program that focuses on the advanced study of the morphology, physiology, and pathology of human dental pulp and periradicular tissues, and prepares dentists to diagnose and treat internal diseases and injuries of teeth.  Includes instruction in theory and practice of endodontics; pulpal disease; relationship of endodontic conditions to other dental/oral health issues; endodontic operative technique; and patient care and management.', 171040, '9.0', 125, 27),
('Energy Management and Systems Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers and other professionals engaged in developing energy-efficient systems or monitoring energy use.  Includes instruction in principles of energy conservation, instrumentation calibration, monitoring systems and test procedures, energy loss inspection procedures, energy conservation techniques, and report preparation.', 64968, '0.6', 1792, 210),
('Energy, Environment, and Natural Resources Law', 'An advanced, professional study of  the law, policies, and regulations governing the energy industry, environmental protection, natural resources and land use, and related topics.', 136260, '6.0', 175, 23),
('Engine Machinist', 'A program that prepares individuals to apply technical knowledge and skills to the building and reconstruction of automotive and commercial vehicle engines.   Includes instruction in cylinder head and block, crack repair, crankshaft inspection and repair, connecting rods and pistons, balancing, block preparation, disassembly and repair, engine assembly, gas and diesel technology, and inspection and machining.', 41750, '0.0', 116, 9),
('Engineering, General', 'A program that generally prepares individuals to apply mathematical and scientific principles to solve a wide variety of practical problems in industry, social organization, public works, and commerce.  Includes instruction in undifferentiated and individualized programs in engineering.', 121643, '3.9', 7709, 456),
('Engineering Chemistry', 'A program that focuses on the general application of chemical principles to the analysis and evaluation of engineering problems, such as development of electronic materials, solid-state science and technology, polymers, ceramics, and biomaterials. Includes instruction in physical chemistry, organic chemistry, materials science, chemical processes and systems, chemical reaction engineering, biochemical engineering, engineering mathematics, classical and modern physics, and computer science.', 120122, '3.8', 7, 2),
('Engineering Mechanics', 'A program with a general focus on the application of the mathematical and scientific principles of classical mechanics to the analysis and evaluation of the behavior of structures, forces and materials in engineering problems.  Includes instruction in statics, kinetics, dynamics, kinematics, celestial mechanics, stress and failure, and electromagnetism.', 121643, '3.9', 256, 30),
('Engineering Science', 'A program with a general focuses on the general application of various combinations of mathematical and scientific principles to the analysis and evaluation of engineering problems, including applied research in human behavior, statistics, biology, chemistry, the earth and planetary sciences, atmospherics and meteorology, and computer applications.', 121643, '3.9', 1187, 92),
('Engineering/Industrial Management', 'A program that focuses on the application of engineering principles to the planning and operational management of industrial and manufacturing operations, and prepares individuals to plan and manage such operations.  Includes instruction in accounting, engineering economy, financial management, industrial and human resources management, industrial psychology, management information systems, mathematical modeling and optimization, quality control, operations research, safety and health issues, and environmental program management.', 113116, '-1.4', 4355, 148),
('Agronomy and Crop Science', 'A program that focuses on the chemical, physical, and biological relationships of crops and the soils nurturing them.  Includes instruction in the growth and behavior of agricultural crops, the development of new plant varieties, and the scientific management of soils and nutrients for maximum plant nutrition, health, and productivity.', 65215, '0.0', 1031, 55),
('English Literature (British and Commonwealth)', 'A program that focuses on the literatures and literary developments of the English-speaking peoples of the British Isles and the British Commonwealth, from the origins of the English language to the present.  Includes instruction in period and genre studies, author studies, country and regional specializations, literary criticism, and the study of folkloric traditions.', 71210, '10.0', 416, 22),
('English/Language Arts Teacher Education', 'A program that prepares individuals to teach English grammar, composition and literature programs at various educational levels.', 60567, '6.3', 3473, 515),
('Environmental Design/Architecture', 'A program that prepares individuals to design public and private spaces, indoor and outdoor, for leisure, recreational, commercial, and living purposes, and for professional practice as environmental designers and architects.  Includes instruction in the design and planning of public and private open spaces and their relationship to buildings and other aspects of the built environment; facilities management; related aspects of interior design and architecture, landscape architecture, and urban planning; and professional responsibilities and standards.', 117119, '4.0', 762, 58),
('Environmental Education', 'A program that prepares individuals to teach environmental education at various educational levels as a K-12 classroom educator. Includes instruction in foundations of environmental education, instructional methods, and related content knowledge.', 58825, '6.0', 38, 10),
('Environmental Engineering Technology/Environmental Technology', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers and other professionals engaged in developing and using indoor and outdoor environmental pollution control systems.  Includes instruction in environmental safety principles, testing and sampling procedures, laboratory techniques, instrumentation calibration, safety and protection procedures, equipment maintenance, and report preparation.', 51170, '10.0', 519, 74),
('Environmental Health', 'A program that focuses on the application of environmental sciences, public health, the biomedical sciences, and environmental toxicology to the study of environmental factors affecting human health, safety, and related ecological issues, and prepares individuals to function as professional environmental health specialists. Includes instruction in epidemiology, biostatistics, toxicology, public policy analysis, public management, risk assessment, communications, environmental law, occupational health and safety emergency response, and applications such as air quality, food protection, radiation protection, solid and hazardous waste management, water quality, soil quality, noise abatement, housing quality, and environmental control of recreational areas.', 92825, '13.5', 1103, 85),
('Environmental Science', 'A program that focuses on the application of biological, chemical, and physical principles to the study of the physical environment and the solution of environmental problems, including subjects such as abating or controlling environmental pollution and degradation; the interaction between human society and the natural environment; and natural resources management.  Includes instruction in biology, chemistry, physics, geosciences, climatology, statistics, and mathematical modeling.', 74804, '10.9', 7462, 584),
('Environmental Studies', 'A program that focuses on  environment-related issues using scientific, social scientific, or humanistic approaches or a combination.  Includes instruction in the basic principles of ecology and environmental science and related subjects such as policy, politics, law, economics, social aspects, planning, pollution control, natural resources, and the interactions of human beings and nature.', 74804, '10.9', 8219, 485),
('Environmental Toxicology', 'A program that focuses on the scientific study of the health effects associated with exposure to toxic chemicals and systems occurring in the natural, work, and living environments; the management of environmental toxins and toxicity; and the development of protections for humans, animals, and plants.  Includes instruction in applied ecology; microbiology; toxin transport, fate, and degradation; dermal toxicology; reproductive and genetic toxicology; atmospheric and environmental chemistry; metals toxicology; environmental mutagens and biotransformation; nutrient interaction; chemical sensitivity, disorders, and disease; risk assessment; animal waste management; environmental health; and hazardous materials management.', 93730, '8.0', 108, 14),
('Environmental/Environmental Health Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of systems for controlling contained living environments and for monitoring and controlling factors in the external natural environment, including pollution control, waste and hazardous material disposal, health and safety protection, conservation, life support, and requirements for protection of special materials and related work environments.', 122788, '5.5', 2516, 139),
('Equestrian/Equine Studies', 'A program that focuses on the horse, horsemanship, and related subjects and prepares individuals to care for horses and horse equipment; ride and drive horses for leisure, sport, show, and professional purposes; and manage the training of horses and riders.  Includes instruction in horse breeding, nutrition, health, and safety; history of the horse and horsemanship; horse development and training; riding and equestrian technique; stable, paddock, and track management; and equipment maintenance and repair.', 61500, '8.7', 832, 63),
('Accounting Technology/Technician and Bookkeeping', 'A program that prepares individuals to provide technical administrative support to professional accountants and other financial management personnel.  Includes instruction in posting transactions to accounts, record-keeping systems, accounting software operation, and general accounting principles and practices.', 39908, '-6.7', 23178, 1006),
('Ethics', 'A program that focuses on the systematic study of the theory of moral good and its application to various theoretical and practical problems.  Includes instruction in ethical theory, history of ethics, belief and value systems, ethical constructs, and applications to specific topics, issues and problems.', 75140, '12.0', 178, 31),
('Ethnic Studies', 'A program that focuses on the interdisciplinary and comparative study of the history, sociology, politics, culture, and economics of North American racial and ethnic groups, including African Americans, American Indians/Native Americans, Hispanic Americans, and Asian Americans.', 81700, '15.0', 285, 65),
('European History', 'A program that focuses on the development of European society, culture, and institutions from the origins to the present.  Includes instruction in European historiography, European history sources and materials, historical research methods, and applications to the study of specific themes, issues, periods, and institutions.', 108826, '4.3', 46, 16),
('European Studies/Civilization', 'A program that focuses on the history, society, politics, culture, and economics of one or more of the peoples of the European Continent, including the study of European migration patterns and colonial empires.', 81700, '15.0', 161, 68),
('Evolutionary Biology', 'A program that focuses on the scientific study of the genetic, developmental, functional, and morphological patterns and processes, and theoretical principles; and the emergence and mutation of organisms over time.  Includes instruction in molecular and morphological systematics; genetics and development; evolutionary transformation; paleobiology and paleontology; morphogenesis; mutation; locomotor, biomechanical and craniodental form and function; evolutionary theory; and systematic biology.', 103963, '7.2', 162, 11),
('Executive Assistant/Executive Secretary', 'A program that prepares individuals to perform the duties of special assistants and/or personal secretaries for business executives and top management.  Includes instruction in business communications, principles of business law, public relations, scheduling and travel management, secretarial accounting, filing systems and records management, conference and meeting recording, report preparation, office equipment and procedures, office supervisory skills, and professional standards and legal requirements.', 39781, '1.0', 2956, 183),
('Exercise Physiology', 'A program that focuses on the scientific study of the physiological processes involved in physical or motor activity, including sensorimotor interactions, response mechanisms, and the effects of injury, disease, and disability.  Includes instruction in muscular and skeletal anatomy; molecular and cellular basis of muscle contraction;  fuel utilization; neurophysiology of motor mechanics; systemic physiological responses (respiration, blood flow, endocrine secretions, and others); fatigue and exhaustion; muscle and body training; physiology of specific exercises and activities; physiology of injury; and the effects of disabilities and disease.', 91108, '8.2', 3649, 67),
('Experimental Psychology', 'A program that focuses on the scientific study of behavior under experimental conditions and the analysis of controlled behavioral responses.  Includes instruction in learning theory, research design and experimental methods, psychological measurement, statistical design and methods, analysis of cognitive and behavioral variables, and the conduct of specialized and large-scale studies.', 107840, '5.3', 1917, 51),
('Facial Treatment Specialist/Facialist', 'A program that prepares individuals to massage and treat the face, neck, and scalp with chemical and cosmetic preparations, and to function as licensed facial specialists in specialized and full service salons.  Includes instruction in facial surface anatomy; skin properties; skin decontamination and infection control; facial massage; facial makeup; facial wrapping; selection and application of creams, lotions, oils, and other chemicals and cosmetics; European and other facial techniques; client evaluation and care; applicable laws and regulations; and business practices.', 35300, '12.0', 1166, 80),
('Facilities Planning and Management', 'A program that focuses on strategic workplace and facility planning and that prepares individuals to function as facility and event managers and workplace consultants.  Includes instruction in the principles of aesthetic and functional design, environmental psychology and organizational behavior, real estate planning, principles of occupational health and safety, event planning and management, operations management, and applicable regulatory and policy issues.', 52789, '7.8', 96, 15),
('Family and Community Services', 'A program that focuses on the development and implementation of public, private, and voluntary support services for individuals, families, and localities and that prepares individuals to function in a variety of occupations promoting family life, and family/community development.  Includes instruction in family systems, human development, social services, community social and economic development, social policy, voluntary sector activities, and outreach and community education.', 51820, '11.0', 1840, 62),
('Family and Consumer Sciences/Home Economics Teacher Education', 'A program that prepares individuals to teach vocational home economics programs at various educational levels.', 60003, '5.8', 332, 67),
('Family and Consumer Sciences/Human Sciences, General', 'A general program that focuses on family and consumer sciences, including how individuals develop and function in family, work, and community settings and how they relate to their physical, social, emotional, and intellectual environments.', 60395, '6.0', 4335, 144),
('Family and Consumer Sciences/Human Sciences Communication', 'A program that focuses on communication of human sciences subject matter and related consumer information to a variety of audiences through print and non-print media.', 67488, '6.1', 32, 3),
('Family Practice Nurse/Nursing', 'A program that prepares registered nurses to provide independent general care for family groups and individuals in the context of family living.  Includes instruction in family theory and intervention, role synthesis, family primary care, nursing practice and health care policy, holistic practice, pediatric practice, gerontological practice, health assessment, clinical pharmacotherapeutics, clinical techniques, and pathopsychology.', 72443, '16.9', 8301, 249),
('Family Resource Management Studies, General', 'A general program that focuses on the design and implementation of policies and processes contributing to successful individual and family resource management.  Includes instruction in financial goal-setting and strategies; household income, assets, and debt management; preventing and resolving financial difficulties; and the use of relevant public resources.', 51820, '11.0', 791, 23),
('Family Systems', 'A program that focuses on the family as a social unit in its developmental, dynamic, comparative, and structural aspects, and the significance of the family as a system that impacts individuals and society.  Includes instruction in related principles of sociology, psychology, behavioral sciences, and the humanities.', 51820, '11.0', 592, 32),
('Farm/Farm and Ranch Management', 'A program that prepares individuals to manage farms, ranches, and similar enterprises.  Includes instruction in applicable agricultural specialization, business management, accounting, taxation, capitalization, purchasing, government programs and regulations, operational planning and budgeting, contracts and negotiation, and estate planning.', 62146, '-0.2', 535, 52),
('Fashion and Fabric Consultant', 'A program that prepares individuals to assist in apparel and fashion selection, style coordination, customer sales and consulting, fabric selection, clothing specifications, and contract buying activities. Includes instruction in supplying regular clothing needs or acting as a consultant for special events such as weddings.', 73180, '3.0', 69, 5),
('Fashion Merchandising', 'A program that prepares individuals to promote product lines/brands, and organize promotional campaigns, at the wholesale level to attract retailer interest, wholesale purchasing, and supply contracts.  Includes instruction in wholesaling, wholesale advertising, selling, and customer relations.', 66240, '6.0', 5741, 172);
INSERT INTO `majors` (`Name`, `Description`, `Average Salary`, `Expected Growth`, `No of Students`, `No of Offering Schools`) VALUES
('Fashion Modeling', 'A program that prepares individuals to present and display fashion, apparel, and accessories products in wholesale and retail settings, either on the person or via props and natural or artificial settings.  Includes instruction in modeling skills, health and cosmetic principles, fashion show management, display design and production, and applicable aspects of advertising and fashion photography.', 37240, '0.0', 27, 2),
('Fashion/Apparel Design', 'A program that prepares individuals to apply artistic principles and techniques to the professional design of commercial fashions, apparel, and accessories, and the management of fashion development projects.  Includes instruction in apparel design; accessory design; the design of men''s'', women''s'', and children''s'' wear; flat pattern design; computer-assisted design and manufacturing; concept planning; designing in specific materials; labor and cost analysis; history of fashion; fabric art and printing; and the principles of management and operations in the fashion industry.', 76137, '9.7', 4359, 155),
('Fiber, Textile and Weaving Arts', 'A program that prepares individuals creatively and technically to express emotions, ideas, or inner visions by constructing art works from woven or non-woven fabrics and fibrous materials.  Includes instruction in weaving techniques and loom operation; non-woven techniques such as knitting, coiling, netting, and crocheting; quilting; dyeing and pigmentation; printing and other finishing techniques; pattern design; tapestry; and personal style development.', 74624, '10.5', 231, 21),
('Filipino/Tagalog Language and Literature', 'A program that focuses on the modern Filipino/Tagalog language as used in the Philippines.  Includes instruction in philology; literature; and applications to business, science/technology, and other settings.', 56350, '22.2', 10, 2),
('Film/Cinema/Video Studies', 'A program in the visual arts that focuses on the study of the history, development, theory, and criticism of the film/video arts, as well as the basic principles of film making and film production.', 83392, '10.0', 3815, 192),
('Financial Forensics and Fraud Investigation', 'A program focusing on the principles and techniques of conducting investigations into financial crime, terrorist activity, and the analysis and use of accounting data as evidence.  Includes instruction in the principles of accounting, investigative auditing, computer investigations,  accounting system documents and software, business corruption, criminal and terrorist financial networks, international money markets and movement, net worth analysis, financial fraud, exposing concealed assets, records seizure, fraud and money laundering statutes, fraud case initiation, case management, and case presentation.', 75419, '10.0', 200, 29),
('Financial Mathematics', 'A program that focuses on the application of mathematics and statistics to the finance industry, including the development, critique, and use of various financial models. Includes instruction in probability theory, statistical analysis, numerical methods, computation and simulation methods, stochastic processes, economics, and financial markets and applications.', 92745, '9.6', 995, 41),
('Fine and Studio Arts Management', 'A program that prepares individuals to organize and manage fine and studio art organizations, operations, and facilities. Includes instruction in business and financial management; marketing and fundraising; personnel management and labor relations; event promotion and management; public relations and arts advocacy; arts law; and applications to specific arts activities such as galleries, museums, studios, foundations, and community organizations.', 103857, '5.4', 1285, 95),
('Fine/Studio Arts, General', 'A program that prepares individuals to generally function as creative artists in the visual and plastic media.  Includes instruction in the traditional fine arts media (drawing, painting, sculpture, printmaking, CAD/CAM) and/or modern media (ceramics, textiles, intermedia, photography, digital images), theory of art, color theory, composition and perspective, anatomy, the techniques and procedures for maintaining equipment and managing a studio, and art portfolio marketing.', 74214, '10.1', 12644, 689),
('Air Traffic Controller', 'A program that prepares individuals to apply technical knowledge and skills to air-traffic management and control, usually with additional training at the FAA Flight Control Center in a cooperative education program.  Includes instruction in flight control, the use of radar and electronic scanning devices, plotting of flights, radio communication, interpretation of weather conditions affecting flights, flight instrumentation used by pilots, and maintenance of flight-control center or control-tower log books.', 102584, '-5.7', 616, 26),
('Fire Prevention and Safety Technology/Technician', 'A program focusing on the application of fire science and technology to problems of reducing fire risk, limiting loss, supervising substance removal, conducting safety inspections and investigations, and advising on matters of safety procedures and fire prevention policy.  Includes instruction in fire behavior, fire simulation, structural risk assessment, materials analysis, detection and suppression systems, smoke management, supply and evacuation, public education, legal aspects of fire prevention, and related research and communications methods.', 49719, '5.0', 4923, 216),
('Fire Science/Fire-fighting', 'A program focusing on the theory and practice of fires and fire-fighting.  Includes instruction in fire chemistry and physics, combustible materials, computer science, building construction, fire codes and related laws, fire hydraulics, fire command, fire prevention/inspection, fire protection systems, fire suppression systems, fire/arson investigation, occupational safety, equipment operation, emergency medicine and communications.', 49694, '5.1', 8505, 338),
('Fire Services Administration', 'A program focusing on the principles, theory, and practices associated with the management of fire operations, firefighting services, and community fire issues.  Includes instruction in fire protection history and theory, incident command leadership, administration of public fire organizations, labor relations, emergency medical services management, fire emergency response strategies and mitigation, legal and regulatory responsibilities, budgeting, public relations, and organizational leadership.', 106381, '4.1', 1260, 126),
('Fire/Arson Investigation and Prevention', 'A program focusing on the theory and principles of fire combustion and behavior applied to the analysis of fires and their causes.  Includes instruction in fire behavior and combustion, fire dynamics, hazardous materials chemistry, incendiary fire analysis, fire-related human behavior, forensic procedures, investigative techniques, case management and case preparation.', 59800, '6.0', 23, 6),
('Flagging and Traffic Control', 'A program that prepares individuals to control the movement of traffic through construction and maintenance zones and to protect the safety of work crews, drivers, and pedestrians. Includes instruction in flagging duties and responsibilities, the traffic control zone, flagging signals, pavement markers, freeway flagging, utility flagging, emergency response flagging, and night traffic control.', 38200, '5.0', 257, 3),
('Flight Instructor', 'A program that prepares individuals to apply technical knowledge and skills to the training of pilots or navigators, to prepare them to fly and/or navigate commercial passenger and cargo, agricultural, public service, corporate and rescue aircraft, and fixed or rotary wing aircraft.  Includes instruction in principles of aircraft design and performance, aircraft flight systems and controls, flight crew operations and procedures, radio communications and navigation procedures and systems, airways safety and traffic regulations, and governmental rules and regulations pertaining to piloting aircraft.  Programs may qualify individuals to administer the FAA commercial air crew examinations.', 119365, '4.3', 62, 8),
('Folklore Studies', 'A program that focuses on the study of creativity and aesthetic expression in everyday life, as expressed in narrative, literature, performing arts, culture, work, family and community.', 81700, '15.0', 67, 6),
('Food Preparation/Professional Cooking/Kitchen Assistant', 'A program that prepares individuals to serve under the supervision of chefs and other food service professionals as kitchen support staff and commercial food preparation workers.  Includes instruction in kitchen organization and operations, sanitation and quality control, basic food preparation and cooking skills, kitchen and kitchen equipment maintenance, and quantity food measurement and monitoring.', 25571, '6.0', 1556, 91),
('Food Science', 'A program that focuses on the application of biological, chemical, and physical principles to the study of converting raw agricultural products into processed forms suitable for direct human consumption, and the storage of such products.  Includes instruction in applicable aspects of the agricultural sciences, human physiology and nutrition, food chemistry, agricultural products processing, food additives, food preparation and packaging, food storage and shipment, and related aspects of human health and safety including toxicology and pathology.', 81277, '4.8', 2045, 60),
('Food Service, Waiter/Waitress, and Dining Room Management/Manager', 'A program that prepares individuals to serve food to customers in formal or informal settings.  Includes instruction in the nutritional, sensory, and functional properties of food and its ingredients; food services principles; table and counter services; dining room operations and procedures; service personnel supervision and management; communication skills; business math; safety; and sanitation.', 33330, '10.0', 280, 14),
('Food Technology and Processing', 'A program that focuses on the application of chemical, physical, and engineering principles to the development and implementation of manufacturing, packaging, storage, and distribution technologies and processes for food products.  Includes instruction in food engineering, food preservation and handling, food preparation, food packaging and display, food storage and shipment, and related equipment and facilities design, operation, and maintenance.', 52867, '4.6', 95, 16),
('Foods, Nutrition, and Wellness Studies, General', 'A general program that focuses on the role of foods and nutrition in human health and wellness.  Includes instruction in nutritional care and education, the planning and provision of food services, the development of consumable food products, life-span nutrition and wellness, the principles of nutritional assessment, and food safety and food composition.', 48866, '15.0', 3718, 118),
('Foreign Language Teacher  Education', 'A program that prepares individuals to teach foreign languages programs at various educational levels, other than French, German or Spanish.', 60249, '6.2', 331, 102),
('Foreign Languages and Literatures, General', 'A general program that focuses on one or more modern foreign languages that is not specific as to the name of the language(s) studied; that is otherwise undifferentiated; or that introduces students to language studies at the basic/elementary level.', 60127, '7.2', 2763, 273),
('Forensic Chemistry', 'A program that focuses on the application of chemical techniques and instrumentation to the analysis and evaluation of physical evidence to aid in criminal investigations. Includes instruction in analytical, inorganic, organic, and physical chemistry; biochemistry; forensic toxicology; instrumental analysis; crime scene processing; criminal investigation; forensic laboratory technology; and applicable law.', 95501, '6.4', 104, 26),
('Forensic Science and Technology', 'A program that focuses on the application of the physical, biomedical, and social sciences to the analysis and evaluation of physical evidence, human testimony and criminal suspects. Includes instruction in forensic medicine, forensic dentistry, anthropology, psychology, entomology, pathology, forensic laboratory technology and autopsy procedures, DNA and blood pattern analysis, crime scene analysis, crime scene photography, fingerprint technology, document analysis, witness and suspect examination procedures, applicable law and regulations, and professional standards and ethics.', 62312, '23.9', 3149, 267),
('Forest Engineering', 'A program that prepares individuals to apply scientific, mathematical, and forestry principles to the design of mechanical devices and processes for efficient forest management, timber production and related forest logistics systems.  Includes instruction in forest products processing, forest management, forest harvesting, timber structure design, production analysis, road and bridge construction, vehicle adaptation and design, and harvesting equipment design.', 121643, '3.9', 24, 2),
('Forest Management/Forest Resources Management', 'A program that prepares individuals to apply principles of forestry and natural resources management to the administration of forest lands and related resources.  Includes instruction in silviculture, forest mensuration, forest protection, inventorying, biometrics, geographic information systems, remote sensing, photogrammetry, forest policy and economics, forest land use planning, fire protection and management, and related administrative skills.', 64396, '7.3', 274, 26),
('Forest Sciences and Biology', 'A program that focuses on the application of one or more forest-related sciences to the study of environmental factors affecting forests and the growth and management of forest resources.  Includes instruction in forest biology, forest hydrology, forest mensuration, silviculture, forest soils, water resources, environmental science, forest resources management, and wood science.', 64396, '7.3', 326, 19),
('Forest Technology/Technician', 'A program that prepares individuals to assist foresters in the management and production of forest resources.  Includes instruction in woods and field skills, tree identification, timber measurement, logging and timber harvesting, forest propagation and regeneration, forest fire-fighting, resource management, equipment operation and maintenance, record-keeping, sales and purchasing operations, and personnel supervision.', 38260, '-6.0', 323, 35),
('Forestry, General', 'A program that generally prepares individuals to manage and develop forest areas for economic, recreational, and ecological purposes.  Includes instruction in forest-related sciences, mapping, statistics, harvesting and production technology, natural resources management and economics, wildlife sciences, administration, and public relations.', 64396, '7.3', 894, 65),
('French Language and Literature', 'A program that focuses on the French language and related dialects and creoles. Includes instruction in philology; Metropolitan French; Canadian French; African and Caribbean Creoles; dialects; and applications in business, science/technology, and other settings.', 60127, '7.2', 3541, 639),
('French Studies', 'A program that focuses on the history, society, politics, culture, and economics of France, other Francophone countries inside and outside Europe, and the French colonial experience and the associated French minorities around the world.', 81700, '15.0', 151, 36),
('Aircraft Powerplant Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to repair, service, and maintain all types of aircraft powerplant and related systems.  Instruction includes engine inspection and maintenance, lubrication and cooling, electrical and ignition systems, carburetion, fuels and fuel systems, propeller and fan assemblies.', 57820, '-0.5', 2421, 107),
('General Literature', 'A program that focuses on literature from one or more genres, cultures or traditions. Includes instruction in period and genre studies, author studies, literary criticism, and studies of various types of literary text.', 67969, '1.7', 339, 39),
('General Office Occupations and Clerical Services', 'A program that prepares individuals to provide basic administrative support under the supervision of office managers, administrative assistants, secretaries, and other office personnel.  Includes instruction in typing, keyboarding, filing, general business correspondence, office equipment operation, and communications skills.', 33103, '2.7', 3560, 275),
('Genetic Counseling/Counselor', 'A program that prepares individuals to counsel patients and families concerning inherited genetic disorders and diseases; assess risk factors and planning options associated with potential and actual inherited conditions; and serve as patient advocates and provide referral services in relation to private and public support services.  Includes instruction in clinical/medical genetics, methods of genetic testing, interviewing and counseling skills, genetic and support services delivery, principles of public health, medical ethics, law and regulations, patient advocacy, and professional standards.', 74570, '29.0', 140, 19),
('Airframe Mechanics and Aircraft Maintenance Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to repair, service, and maintain all aircraft components other than engines, propellers, avionics, and instruments.  Includes instruction in layout and fabrication of sheet metal, fabric, wood, and other materials into structural members, parts, and fittings, and replacement of damaged or worn parts such as control cables and hydraulic units.', 57820, '-0.5', 5246, 127),
('Genome Sciences/Genomics', 'A program that focuses on the scientific study of whole genome sequences and patterns of gene expression. Includes instruction in molecular and cellular biology, genetics, protein technologies, genomic sciences and techniques, bioinformatics, and scientific and research ethics.', 103963, '7.2', 23, 10),
('Geochemistry', 'A program that focuses on the scientific study of the chemical properties and behavior of the silicates and other substances forming, and formed by geomorphological processes of the earth and other planets.  Includes instruction in chemical thermodynamics, equilibrium in silicate systems, atomic bonding, isotopic fractionation, geochemical modeling, specimen analysis, and studies of specific organic and inorganic substances.', 114935, '7.9', 29, 16),
('Geographic Information Science and Cartography', 'A program that focuses on the systematic study of map-making and the application of mathematical, computer, and other techniques to the analysis of large amounts of geographic data and the science of mapping geographic information. Includes instruction in cartographic theory and map projections, computer-assisted cartography, geographic information systems, map design and layout, photogrammetry, air photo interpretation, remote sensing, spatial analysis, geodesy, cartographic editing, and applications to specific industrial, commercial, research, and governmental mapping problems.', 109484, '4.8', 1826, 176),
('Geography', 'A program that focuses on the systematic study of the spatial distribution and interrelationships of people, natural resources, plant and animal life.  Includes instruction in historical and political geography, cultural geography, economic and physical geography, regional science, cartographic methods, remote sensing, spatial analysis, and applications to areas such as land-use planning, development studies, and analyses of specific countries, regions, and resources.', 110749, '4.0', 6421, 341),
('Geography Teacher Education', 'A program that prepares individuals to teach geography at various grade levels.', 60132, '6.1', 7, 12),
('Geological/Geophysical Engineering', 'A program that prepares individuals to apply mathematical and geological principles to the analysis and evaluation of engineering problems, including the geological evaluation of construction sites, the analysis of geological forces acting on structures and systems, the analysis of potential natural resource recovery sites, and applied research on geological phenomena.', 121328, '4.0', 466, 20),
('Geology/Earth Science, General', 'A program that focuses on the scientific study of the earth; the forces acting upon it; and the behavior of the solids, liquids and gases comprising it.  Includes instruction in historical geology, geomorphology, and sedimentology, the chemistry of rocks and soils, stratigraphy, mineralogy, petrology, geostatistics, volcanology, glaciology, geophysical principles, and applications to research and industrial problems.', 118948, '6.4', 7593, 507),
('Airline Flight Attendant', 'A program that prepares individuals to apply technical knowledge and skills to the performance of a variety of personal services conducive to the safety and comfort of airline passengers during flight, including verifying tickets, explaining the use of safety equipment, providing passenger services, and responding to in-flight emergencies.', 46750, '2.0', 64, 8),
('Geophysics and Seismology', 'A program that focuses on the scientific study of the physics of solids and its application to the study of the earth and other planets.  Includes instruction in gravimetric, seismology, earthquake forecasting, magnetrometry, electrical properties of solid bodies, plate tectonics, active deformation, thermodynamics, remote sensing, geodesy, and laboratory simulations of geological processes.', 121378, '6.3', 345, 47),
('German Language and Literature', 'A program that focuses on the German language and related dialects. Includes instruction in philology; dialects; and applications to business, science/technology, and other settings.', 56350, '22.2', 1486, 383),
('German Language Teacher Education', 'A program that prepares individuals to teach German language programs at various educational levels.', 60249, '6.2', 11, 50),
('Germanic Languages, Literatures, and Linguistics, General', 'A general program that focuses on one or more of the Germanic languages of Western, Central, and Northern Europe.  Includes instruction in philology; linguistics; dialects and pidgins; literature; and applications to business, science/technology, and other settings.', 60127, '7.2', 170, 25),
('Airline/Commercial/Professional Pilot and Flight Crew', 'A program that prepares individuals to apply technical knowledge and skills to the flying and/or navigation of commercial passenger and cargo, agricultural, public service, corporate and rescue fixed wing aircraft.  Includes instruction in principles of aircraft design and performance, aircraft flight systems and controls, flight crew operations and procedures, radio communications, navigation procedures and systems, airways safety and traffic regulations, and governmental rules and regulations pertaining to piloting aircraft.  Programs may qualify individuals to sit for the FAA commercial and airline aircrew examinations.', 119365, '4.3', 1749, 120),
('Gerontology', 'A program that focuses on the human aging process and aged human populations, using the knowledge and methodologies of the social sciences, psychology and the biological and health sciences.', 90506, '5.5', 1313, 185),
('Geropsychology', 'A program that focuses on the psychology of aging and of elderly individuals and populations, with reference to growth and decline across the life span.  Includes instruction in gerontology, developmental and adult psychology, age-related development and decline of cognitive processes, age-related psychological and neurological disorders, social and personality development in aging populations and individuals, and applications to the clinical treatment and care of older adults.', 103521, '7.5', 7, 2),
('Golf Course Operation and Grounds Management', 'A program that prepares individuals to manage the operation of golf courses. Includes instruction in turf grass science and management, golf course design and construction, grounds equipment and operation, pest control, and grounds management.', 97362, '4.2', 745, 20),
('Graphic and Printing Equipment Operator, General Production', 'A program that generally prepares individuals to apply technical knowledge and skills to plan, prepare, and execute a variety of commercial and industrial graphic communications jobs.  Includes instruction in the operation and maintenance of mechanical, electronic, and digital graphic, printing, and finishing equipment; and related processes.', 34216, '-9.2', 380, 63),
('Graphic Communications, General', 'A program that generally prepares individuals to apply technical knowledge and skills in the manufacture and distribution or transmission of graphic communications products.  Includes instruction in the prepress, press, and postpress phases of production operations and processes such as offset lithography, flexography, gravure, letterpress, screen printing, foil stamping, digital imaging, and other reproduction methods.', 40060, '-25.0', 954, 74),
('Graphic Design', 'A program that prepares individuals to apply artistic and computer techniques to the interpretation of technical and commercial concepts. Includes instruction in computer-assisted art and design, printmaking, concepts sketching, technical drawing, color theory, imaging, studio technique, still and life modeling, multimedia applications, communication skills and commercial art business operations.', 64614, '4.2', 11307, 697),
('Greenhouse Operations and Management', 'A program that prepares individuals to produce, store, and deliver plant species in controlled indoor environments for wholesale, commercial, research, or other purposes.  Includes instruction in applicable principles of plant science; climate, irrigation, and nutrition control equipment operation and maintenance; facilities management; inventory control; safety procedures; and personnel supervision.', 51740, '4.8', 87, 17),
('Hair Styling/Stylist and Hair Design', 'A program that prepares individuals to shampoo, cut, style, set, and dress the scalp hair of women and/or men, braid hair, apply hair cosmetics and wigs, and prepare for licensure as professional cosmetologists, hairdressers, and barbers at various levels.  Includes instruction in hair design theory and concepts, hair cleaning and shampooing, hair coloring, chemical applications and permanent reconstructions, hair anatomy and physiology, scalp diseases and treatments, wig and hairpiece fitting, hair braiding, customer service, shop management, equipment operation, health and safety, and applicable laws and regulations.', 28785, '10.0', 1290, 87),
('Hazardous Materials Information Systems Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills to assist engineers and other professionals in implementing, monitoring, and enforcing hazardous materials management and removal.  Includes instruction in environmental science, environmental health, human behavior, economics, management science, information systems and applications, and communication skills.', 51170, '10.0', 2, 2),
('Health Aide', 'A program that prepares individuals to provide routine care and assistance to patients under the direct supervision of other health care professionals, and/or to perform routine maintenance and general assistance in health care facilities and laboratories.', 26883, '17.4', 2881, 44),
('Health and Physical Education/Fitness, General', 'A general program that focuses on activities and principles that promote physical fitness, achieve and maintain athletic prowess, and accomplish related research and service goals.  Includes instruction in human movement studies, motivation studies, rules and practice of specific sports, exercise and fitness principles and techniques, basic athletic injury prevention and treatment, and organizing and leading fitness and sports programs.', 42411, '7.1', 13148, 493),
('Health and Wellness, General', 'A program of study that prepares individuals to assume roles as health/wellness professionals in private business and industry, community organizations, and health care settings. Includes instruction in personal health, community health and welfare, nutrition, epidemiology, disease prevention, fitness and exercise, and health behaviors.', 49159, '13.4', 3043, 114),
('Health Communication', 'A program that focuses on how people, individually and collectively, understand and accommodate to health and illness and the role of communication and media in shaping professional health care messages and public acceptance of these messages.  Includes instruction in the development and use of health-related and care-related messages and media; the goals and strategies of health care promotion; relationships, roles, situations, and social structures in the context of health maintenance and promotion; and applications to disease prevention, health advocacy, and communications concerning treatments.', 61214, '8.5', 255, 32),
('Health Information/Medical Records Administration/Administrator', 'A program that prepares individuals to plan, design, and manage systems, processes, and facilities used to collect, store, secure, retrieve, analyze, and transmit medical records and other health information used by clinical professionals and health care organizations.  Includes instruction in the principles and basic content of the biomedical and clinical sciences, information technology and applications, data and database management, clinical research methodologies, health information resources and systems, office management, legal requirements, and professional standards.', 106070, '17.0', 3125, 191),
('Health Information/Medical Records Technology/Technician', 'A program that prepares individuals, under the supervision of health information administrators and other professionals, to construct medical records and clinical databases, perform manipulations on retrieved data, control the security and quality of records, and supervise data entry and technical maintenance personnel.  Includes instruction in clinical and biomedical science data and information requirements, database management, data coding and validation, information security, quality control, health information content and structure, medical business procedures, and legal requirements.', 40430, '15.0', 10924, 562),
('Health Law', 'An advanced, professional study of the law, policies and regulations affecting the health care industry, health professions, health services and insurance industries, and patients.', 136260, '6.0', 274, 15),
('Health Occupations Teacher Education', 'A program that prepares individuals to teach specific vocational health occupations programs at various educational levels.', 67943, '7.9', 163, 11),
('Health Policy Analysis', 'A program that focuses on the systematic analysis of public policy issues related to domestic and international health and health care systems. Includes instruction in contemporary health issues and policies, politics and economics of health care delivery, epidemiology, public health, comparative and global health, medical law and ethics, statistical methods, and applications to specific public policy topics.', 107285, '16.4', 201, 9),
('Health Services Administration', 'A program that focuses on the application of policy analysis, public administration, business management, and communications to the planning and management of health services delivery systems in the public and private sectors, and prepares individuals to function as health services administrators and managers.  Includes instruction in health systems planning, public health organization and management, pubic health policy formulation and analysis, finance, business and operations management, economics of health care, organizational and health communications, marketing, human resources management, and public health law and regulations.', 106070, '17.0', 2290, 118),
('Health Teacher Education', 'A program that prepares individuals to teach health education programs at various educational levels.', 60080, '6.1', 2410, 171),
('Health Unit Manager/Ward Supervisor', 'A program that prepares individuals, under the supervision of nursing or medical service administrators, to supervise and coordinate the operations of one or more patient care units in hospitals or other health care facilities.  Includes instruction in planning and initiating administrative procedures, personnel supervision, interpersonal skills, general and/or specialized health care operations and procedures, and consultation with other medical, nursing, and administrative team members.', 106070, '17.0', 11, 2),
('Health/Health Care Administration/Management', 'A program that prepares individuals to develop, plan, and manage health care operations and services within health care facilities and across health care systems.  Includes instruction in planning, business management, financial management, public relations, human resources management, health care systems operation and management, health care resource allocation and policy making, health law and regulations, and applications to specific types of health care services.', 106070, '17.0', 21142, 701),
('Health/Medical  Physics', 'A program that focuses on the application of physics, nuclear science, and engineering physics to diagnostic, treatment, and therapeutic processes and public health protection.  Includes instruction in radiation biophysics, biophysics, health effects of natural and artificially induced radiation, hazard evaluation, environmental radioactivity, nuclear physics, engineering physics, radiobiology, medical radiology, calibration and dosage theory, computer applications and medical informatics, and specific research problems.', 114831, '18.1', 244, 27),
('Health/Medical Claims Examiner', 'A program that prepares individuals to perform specialized investigatory, analytical, evaluative, and consultative functions related to health/medical insurance operations and their regulation.  Includes instruction in health and medical insurance processes and procedures, health insurance law and regulations, health care industry law, record-keeping, analytic and investigatory techniques, evaluation methods, field operations methods, office procedures, related software applications, oral and written communications skills, interviewing techniques, and professional standards and ethics.', 64300, '3.0', 59, 2),
('Health/Medical Psychology', 'A program that focuses on the psychological study of health and illness, and recovery,  from the perspective that these phenomena arise from a combination of physical, behavioral, and social conditions.  Includes instruction in abnormal and social psychology, psychophysiology, psychopharmacology, learning processes, clinical and behavioral therapies, biopsychosocial modeling, clinical procedures and assessment, preventive education, psychotherapy, rehabilitation processes, and research methods.', 103521, '7.5', 113, 21),
('Hearing Instrument Specialist', 'A program that prepares individuals to test the hearing of, and to select, fit and dispense appropriate hearing aids for, patients. Includes instruction in acoustics, anatomy and physiology of the ear, hearing testing, hearing aid fitting and technology, health promotion and rehabilitation, counseling and communication, business management, and professional ethics.', 52850, '27.0', 53, 3),
('Heating, Air Conditioning, Ventilation and Refrigeration Maintenance Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to repair, install, service and maintain the operating condition of heating, air conditioning, and refrigeration systems.  Includes instruction in diagnostic techniques, the use of testing equipment and the principles of mechanics, electricity, and electronics as they relate to the repair of heating, air conditioning and refrigeration systems.', 47380, '14.0', 18219, 631),
('Heating, Ventilation, Air Conditioning and Refrigeration Engineering Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers and other professionals engaged in developing and using air conditioning, refrigeration, ventilation, and heating systems. Includes instruction in principles of heating and cooling technology, design and operational testing, inspection and maintenance procedures, installation and operation procedures, and report preparation.', 50542, '11.1', 7087, 200),
('Heavy Equipment Maintenance Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills in the field maintenance and repair of heavy equipment, and in the general maintenance and overhaul of such equipment.  Includes instruction in inspection, maintenance, and repair of tracks, wheels, brakes, operating controls, pneumatic and hydraulic systems, electrical circuitry, engines and in techniques of welding and brazing.', 50685, '4.7', 1073, 54),
('Hebrew Language and Literature', 'A program that focuses on the Hebrew language. Includes instruction in philology; Biblical Hebrew (including Pre- and Post-Exilic scripts); Modern Hebrew; dialects; and applications to business, science/technology, and other settings.', 56350, '22.2', 40, 20),
('Hematology Technology/Technician', 'A program that prepares individuals, under the supervision of clinical laboratory scientists and health care professionals, to perform tests and analyses of blood samples.  Includes instruction in clinical laboratory procedures; blood anatomy and physiology; cellular and molecular biology; blood pathology and disease indicators; quantitative, qualitative, and coagulation testing methodologies; equipment operation and maintenance; and record-keeping.', 80277, '18.5', 490, 8),
('High Performance and Custom Engine Technician/Mechanic', 'A program that prepares individuals to apply technical knowledge and skills to increase the power of diesel and automotive engines; enhance the performance of automobiles; and repair, service, and maintain high performance vehicles. Includes instruction in adding performance accessories; modifying powertrains; tuning custom engines, suspension, and exhaust systems; and using dynamometers and other diagnostic equipment.', 51069, '5.0', 255, 3),
('Higher Education/Higher Education Administration', 'A program that focuses on the principles and practice of administration in four-year colleges, universities and higher education systems, the study of higher education as an object of applied research, and which may prepare individuals to function as administrators in such settings.  Includes instruction in higher education economics and finance; policy and planning studies; curriculum; faculty and labor relations; higher education law; college student services; research on higher education; institutional research; marketing and promotion; and issues of evaluation, accountability and philosophy.', 98874, '8.0', 3618, 192),
('Hispanic and Latin American Languages, Literatures, and Linguistics, General', 'A program that focuses on the languages and literatures of the Spanish- and Portuguese-speaking areas of the world, including the Iberian, Latin American, and Lusophone worlds.  Includes instruction in Spanish and Portuguese language and linguistics; regional and Latin American dialects; and Spanish, Portuguese, Spanish American, Luso-Brazilian, and Chicano literature.', 56350, '22.2', 148, 20),
('Hispanic-American, Puerto Rican, and Mexican-American/Chicano Studies', 'A program that focuses on the history, sociology, politics, culture, and economics of one or more of the Hispanic American immigrant populations within the U.S. and Canada, including Mexican-American Studies, Cuban American Studies, Puerto Rican Studies, and others.', 81700, '15.0', 639, 65),
('Histologic Technician', 'A program that prepares individuals, under the supervision of histotechnologists and other clinical laboratory scientists, to prepare and process tissue samples and perform routine histologic procedures and tests.  Includes instruction in fixation, dehydration, embedding, sectioning, decalcification, microincineration, mounting, routine and special steaming, laboratory mathematics, laboratory procedures and safety, instrumentation and microscopy, computer applications, preparation of museum specimens, and recording and administrative procedures.', 41420, '18.0', 168, 22),
('Histologic Technology/Histotechnologist', 'A program that prepares individuals, at the request of physicians, researchers, and laboratory scientists, to identify tissue structures and cell components and relate these findings to physiological functions and to the detection and diagnosis of diseases and other abnormalities.  Includes instruction in medical chemistry, histochemistry, biochemistry, anatomy, physiology, medical informatics, applied mathematics, electron microscopy, instrumentation, quality control procedures, data recording and analysis, laboratory administration, medical terminology, and professional standards and ethics.', 61860, '14.0', 61, 15),
('Historic Preservation and Conservation', 'A program that focuses on the architectural design principles and building techniques used in historic structures and environments, and the process of saving and restoring old buildings and districts for contemporary use and enjoyment.  Includes instruction in architectural history; building conservation techniques; real estate, land-use and tax laws and codes; economics and public policy; and public relations.', 56453, '5.2', 330, 49),
('History, General', 'A program that focuses on the general study and interpretation of the past, including the gathering, recording, synthesizing and criticizing of evidence and theories about past events.  Includes instruction in historiography; historical research methods; studies of specific periods, issues and cultures; and applications to areas such as historic preservation, public policy, and records administration.', 74720, '5.5', 35974, 1440),
('History and Philosophy of Science and Technology', 'A program that focuses on the historical evolution of scientific theories, science applications and technologies, and the scientific, medical, and technological disciplines, as well as the philosophy of science and its historical socio-economic context. Includes instruction in the concepts and methods of philosophical inquiry; historiography of science; history of science, medicine, and technology; and research methods in the history of the scientific and engineering disciplines, including mathematics.', 108826, '4.3', 209, 24),
('History Teacher Education', 'A program that prepares individuals to teach history programs at various educational levels.', 60314, '6.2', 795, 206),
('Holocaust and Related Studies', 'A program that focuses on genocide in human history with particular reference to Twentieth Century genocides such as that of the Ottoman Armenians during World War I and the Nazi Holocaust during World War II.  Programs also focus on topics such as survivor studies and counseling, war crimes research and prevention, reconciliation and compensation, ethical and spiritual issues, holocaust art and literature, and legacy and effect in relation to subsequent generations.', 61120, '2.0', 29, 5),
('Home Health Aide/Home Attendant', 'A program that prepares individuals to provide routine care and support services for homebound disabled, recovering, or elderly people.  Includes instruction in basic nutrition, home sanitation, infection control, first aid, taking vital signs, personal hygiene, interpersonal communication skills, supervised home management, emergency recognition and referral, geriatric care, and legal and ethical responsibilities.', 22195, '30.5', 1022, 70),
('Homeland Security', 'A program focusing on security policy, planning and operations dedicated to the protection of U.S. territory, assets, infrastructure, institutions and citizens from external threats.  Includes instruction in national security policy, government relations, intelligence, law enforcement, security technology, communications and information technology, homeland security planning and operations, disaster planning and applications to specific threat scenarios.', 105229, '4.0', 1875, 107),
('Horse Husbandry/Equine Science and Management', 'A program that prepares individuals to manage the selection, breeding, care, and maintenance of work, athletic, and show horses; and to manage horse farms, stables, tracks and related equipment and operations.  Includes instruction in applicable principles of animal science, care, and health; stable and track management; design and operation of facilities and equipment; and related issues such as regulations, business management; and logistics.', 51994, '-6.7', 354, 40),
('Horticultural Science', 'A program that focuses on the scientific principles related to the cultivation of garden and ornamental plants, including fruits, vegetables, flowers, and landscape and nursery crops.  Includes instruction in specific types of plants, such as citrus; breeding horticultural varieties; physiology of horticultural species; and the scientific management of horticultural plant development and production through the life cycle.', 76471, '5.3', 809, 63),
('Hospital and Health Care Facilities Administration/Management', 'A program that prepares individuals to apply managerial principles to the administration of hospitals, clinics, nursing homes, and other health care facilities.  Includes instruction in facilities planning, building and operations management, business management, financial management and insurance, fund-raising and marketing, public relations, human resources management and labor relations, health care facilities operations, principles of health care delivery, and applicable law and regulations.', 106070, '17.0', 5409, 115),
('Hospitality Administration/Management, General', 'A program that prepares individuals to serve as general managers and directors of hospitality operations on a system-wide basis, including both travel arrangements and promotion and the provision of traveler facilities.  Includes instruction in principles of operations in the travel and tourism, hotel and lodging facilities, food services, and recreation facilities industries; hospitality marketing strategies; hospitality planning; management and coordination of franchise and unit operations; business management; accounting and financial management; hospitality transportation and logistics; and hospitality industry policies and regulations.', 54265, '5.4', 12644, 410),
('Hospitality and Recreation Marketing Operations', 'A program that prepares individuals to provide marketing services in the hospitality and leisure fields. Includes instruction in hospitality operations, customer sales and assistance operations and techniques, telephone operations, basic office management, retail sports, recreation equipment, food and beverage.', 57810, '8.0', 163, 12),
('Hotel, Motel, and Restaurant Management', 'An instructional program that prepares individuals to manage operations and facilities that provide food and/or lodging services to the traveling public. Includes instruction in hospitality industry principles; supplies purchasing, storage, and control; hotel and restaurant facilities design and planning; hospitality industry law; personnel management and labor relations; financial management; facilities management; marketing and sale promotion strategies; convention and event management; front desk operations; and applications to specific types of hotel, motel, and/or restaurant operations. Note: this program was re-instated after being deleted from CIP 2000; previously, it was coded as 52.0902.', 64279, '6.4', 480, 34),
('Alternative Fuel Vehicle Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to the maintenance of alternative fuel vehicles and the conversion of standard vehicles to AFV status.  Includes instruction in electrical vehicles, liquefied petroleum gas (LPG) vehicles, compressed natural gas (CNG) vehicles, hybrid fuel technology, electrical and electronic systems, engine performance, diagnosis and repair, and conversion/installation.', 40720, '5.0', 155, 20),
('Hotel/Motel Administration/Management', 'A program that prepares individuals to manage operations and facilities that provide lodging services to the traveling public. Includes instruction in hospitality industry principles; supplies purchasing, storage and control; hotel facilities design and planning; hospitality industry law; personnel management and labor relations; financial management; marketing and sales promotion; convention and event management; front desk operations; and applications to specific types of hotels and motel operations.', 54265, '5.4', 3766, 173),
('Housing and Human Environments, General', 'A general program that focuses on the behavioral, social, economic, functional, and aesthetic aspects of housing, interiors, and other built environments.  Includes instruction in analyzing, planning, designing, furnishing, and equipping residential, work, and leisure spaces to meet user needs and the study of related public policies.', 51820, '11.0', 212, 15),
('Human Biology', 'An interdisciplinary program that focuses on understanding the human being from the biological, social science, and humanities perspectives and that addresses contemporary issues related to biology and society, such as global health and disease, environmental policy, bioethics, and biotechnology.', 81687, '9.4', 851, 16);
INSERT INTO `majors` (`Name`, `Description`, `Average Salary`, `Expected Growth`, `No of Students`, `No of Offering Schools`) VALUES
('Human Development and Family Studies, General', 'A general program that focuses on basic human developmental and behavioral characteristics of the individual within the context of the family.  Includes instruction in the conditions that influence human growth and development; strategies that promote growth and development across the life span; and the study of family systems.', 69090, '-12.0', 9328, 164),
('Human Nutrition', 'A program that focuses on the relationships between food consumption and human development and health.  Includes instruction in the cellular and molecular processes of food processing in the human body, related metabolic processes, the relationship of food and nutrition to disease, and nutritional needs across the life span.', 58410, '16.0', 1046, 33),
('Human Resources Development', 'A program that prepares individuals to apply integrated training, organizational development, and career planning and counseling skills to the design, management, and evaluation of programs to improve individual productivity, employability, and job satisfaction and organizational effectiveness.  Includes instruction in psychology; organizational behavior; principles of adult education; occupational counseling; skill testing and evaluation; program design; consulting practice; organizational development; and applications to issues such as training, management development, customer service, and total quality management.', 62460, '8.0', 1822, 64),
('Human Resources Management/Personnel Administration, General', 'A program that generally prepares individuals to manage the development of human capital in organizations, and to provide related services to individuals and groups.  Includes instruction in personnel and organization policy, human resource dynamics and flows, labor relations, sex roles, civil rights, human resources law and regulations, motivation and compensation systems, work systems, career management, employee testing and assessment, recruitment and selection, managing employee and job training programs, and the management of human resources programs and operations.', 73178, '5.5', 16076, 619),
('American  History (United States)', 'A program that focuses on the development of American society, culture, and institutions from the Pre-Columbian period to the present.  Includes instruction in American historiography, American history sources and materials, historical research methods, and applications to the study of specific themes, issues, periods, and institutions.', 108826, '4.3', 120, 31),
('Human Services, General', 'A program that focuses on the general study and provision of human and social services to individuals and communities and prepares individuals to work in public and private human services agencies and organizations.  Includes instruction in the social sciences, psychology, principles of social service, human services policy, planning and evaluation, social services law and administration, and applications to particular issues, services, localities, and populations.', 42249, '10.8', 17172, 455),
('Human/Medical Genetics', 'A program that focuses on the scientific study of human genetics from the standpoint of medical applications such as clinical diagnosis, genetic engineering and therapy, transplantation, and the study of genetic diseases and disabilities and their defense.  Includes instruction in human molecular genetics; genetic factors causing disease; changes in gene expression during development, differentiation, and pathogenesis; recombinant DNA; gene therapy; clinical genetics; genetic epidemiology; immunogenetics; cytogenetics; and genetics of specific disorders and diseases.', 93730, '8.0', 206, 33),
('Hypnotherapy/Hypnotherapist', 'A program that prepares individuals to employ the controlled inducement of altered states of consciousness, or trance, to reduce pain, resolve emotional conflicts, and enhance communications as part of diagnostic and treatment programs.  Includes instruction in the principles of hypnosis and suggestion, induction and deepening, post-hypnotic suggestion, awakening techniques, regression, pacing and leading, resistance transformation, client testing and management, practice management and regulation, and professional standards and ethics.', 114510, '19.0', 133, 3),
('Illustration', 'A program that prepares individuals to use artistic techniques to develop and execute interpretations of the concepts of authors and designers to specifications.  Includes instruction in book illustration, fashion illustration, map illustration, rendering, exhibit preparation, textual layout, cartooning, and the use of various artistic techniques as requested by clients.', 54920, '7.0', 2263, 78),
('Immunology', 'A program that focuses on scientific study of the biological mechanisms involved in the pathogenesis of disease, host-pathogen interactions, and host response to disease.  Includes instruction in antigen and antibody structure and function, effector mechanisms, receptors, histocompatibility, host-pathogen recognition, disease modeling, autoimmune systems, antibody formation, cytotoxic responses, regulation of immune response, virulence determinants, intercellular signaling, immunosuppression, immunotherapy, immunogenetics, disease markers, transplantation, antibody humanization, and microbial pathogenesis.', 99539, '7.5', 238, 36),
('Industrial and Organizational Psychology', 'A program that focuses on the scientific study of individual and group behavior in institutional settings, applications to related problems of organization and industry, and that may prepare individuals to apply such principles in industrial and organizational settings.  Includes instruction in group behavior theory, organizational theory, reward/punishment structures, human-machine and human-computer interactions, motivation dynamics, human stress studies, environmental and organizational influences on behavior, alienation and satisfaction, and job testing and assessment.', 108244, '5.1', 1627, 106),
('Industrial and Physical Pharmacy and Cosmetic Sciences', 'A program that focuses on the application of pharmaceutical sciences and pharmacy to the study of pharmaceuticals production and distribution, and prepares individuals to manage pharmaceutical industry operations.  Includes instruction in pharmacoeconomics, industrial management, operations management, preformulation evaluation, product formulation/reformulation, drug product development, stability testing, dosage design, pilot scale-up, drug marketing, quality control, drug information, and legal and regulatory affairs.', 119270, '3.0', 77, 8),
('Industrial and Product Design', 'A program in the applied visual arts that prepares individuals to use artistic techniques to effectively communicate ideas and information to business and consumer audiences via the creation of effective forms, shapes, and packaging for manufactured products.  Includes instruction in designing in a wide variety of plastic and digital media, prototype construction, design development and refinement, principles of cost saving, and product structure and performance criteria relevant to aesthetic design parameters.', 60711, '4.0', 1819, 80),
('Industrial Electronics Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to assemble, install, operate, maintain, and repair electrical/electronic equipment used in industry and manufacturing.  Includes instruction in installing, maintaining and testing various types of equipment.', 51729, '-2.1', 2056, 149),
('Industrial Engineering', 'A program that prepares individuals to apply scientific and mathematical principles to the design, improvement, and installation of integrated systems of people, material, information, and energy.  Includes instruction in applied mathematics, physical sciences, the social sciences, engineering analysis, systems design, computer applications, and forecasting and evaluation methodology.', 107972, '0.7', 7530, 141),
('Industrial Radiologic Technology/Technician', 'A program that prepares individuals to apply scientific principles and technical skills to the operation of industrial and research testing equipment using radioisotopes.  Includes instruction in x-ray analysis of materials, nondestructive testing and inspection of materials, and continuous measurement of paper or metal thickness.', 78850, '-5.0', 167, 6),
('American Government and Politics (United States)', 'A program that focuses on the systematic study of United States political institutions and behavior.  Includes instruction in American political theory, political parties and interest groups, state and local governments, Constitutional law, federalism and national institutions, executive and legislative politics, judicial politics, popular attitudes and media influences, political research methods, and applications to the study of specific issues and institutions.', 110161, '4.2', 367, 33),
('Industrial Safety Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills to assist engineers and other professionals in implementing and enforcing industrial safety standards.  Includes instruction in industrial processes, industrial hygiene, toxicology, ergonomics, system and process safety, safety performance measurement, human factors, human behavior, and applicable law and regulations.', 71790, '4.0', 545, 18),
('Industrial Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of industrial engineers and managers.  Includes instruction in optimization theory, human factors, organizational behavior, industrial processes, industrial planning procedures, computer applications, and report and presentation  preparation.', 56320, '-4.0', 5008, 328),
('Informatics', 'A program that focuses on computer systems from a user-centered perspective and studies the structure, behavior and interactions of natural and artificial systems that store, process and communicate information. Includes instruction in information sciences, human computer interaction, information system analysis and design, telecommunications structure and information architecture and management.', 104670, '16.8', 1135, 40),
('Information Resources Management', 'A program that prepares individuals to apply principles of information technology, computer systems management, and business operations to the planning, management, and evaluation of information services in organizations.  Includes instruction in telecommunications, systems planning and integration, information policy, information security, contracting and purchasing, budgeting, information technology, operations management, human resources, communications skills, and applicable law and regulations.', 141000, '15.0', 1116, 60),
('Information Science/Studies', 'A program that focuses on the  theory, organization, and process of information collection, transmission, and utilization in traditional and electronic forms.  Includes instruction in information classification and organization; information storage and processing; transmission, transfer, and signaling; communications and networking; systems planning and design; human interfacing and use analysis; database development; information policy analysis; and related aspects of hardware, software, economics, social factors, and capacity.', 114252, '11.3', 14372, 477),
('Information Technology', 'A program that focuses on the design of technological information systems, including computing systems, as solutions to business and research data and communications support needs.  Includes instruction in the principles of computer hardware and software components, algorithms, databases, telecommunications, user tactics, application testing, and human interface design.', 106013, '17.1', 20086, 714),
('Information Technology Project Management', 'A program that prepares individuals to design, develop, and manage information technology projects in a variety of companies and organizations. Includes instruction in principles of project management, risk management, procurement and contract management, information security management, software management, organizational principles and behavior, communications, quality assurance, financial analysis, leadership, and team effectiveness.', 114354, '8.6', 694, 33),
('Inorganic Chemistry', 'A program that focuses on the scientific study of the elements and their compounds, other than the hydrocarbons and their derivatives.  Includes instruction in the characterization and synthesis of non-carbon molecules, including their structure and their bonding, conductivity, and reactive properties; research techniques such as spectroscopy, X-ray diffraction, and photoelectron analysis; and the study of specific compounds, such as transition metals, and compounds composed of inorganic and organic molecules.', 98622, '4.6', 5, 1),
('Institutional Food Workers', 'A program that prepares individuals in production and service used in governmental, commercial or independently owned institutional food establishments and related food industry occupations. Includes instruction in selecting, storing, preparing, and serving food and food products; basic nutrition; sanitation, and food safety; the use and care of commercial equipment; serving techniques; and the operation of institutional food establishments.', 25560, '6.0', 182, 35),
('Instrumentation Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers engaged in developing control and measurement systems and procedures.  Includes instruction in instrumentation design and maintenance, calibration, design and production testing and scheduling, automated equipment functions, applications to specific industrial tasks, and report preparation.', 56320, '1.0', 2463, 71),
('Insurance', 'A program that prepares individuals to manage risk in organizational settings and provide insurance and risk-aversion services to businesses, individuals, and other organizations. Includes instruction in  casualty insurance and general liability, property insurance, employee benefits, social and health insurance, loss adjustment, underwriting, risk theory, and pension planning.', 68223, '4.8', 2525, 75),
('Intellectual Property Law', 'An advanced, professional study of the law, policies, and regulations related to copyrights, patents, trademarks, trade secrets, and related issues. Includes instruction in patent law, copyright law, trademark law, intellectual property licensing and litigation, and applications such as art and entertainment law, communications law, information technology law, sports law, and chemical and biotech patent law.', 135997, '6.4', 169, 17),
('American Indian/Native American Studies', 'A program that focuses on the history, sociology, politics, culture, and economics of one or more of the American Indian, Aleut, Inuit, Hawaiian and other native peoples of the Americas from earliest times until the present, with particular emphasis on U.S. and Canadian populations and their problems but including reference to Caribbean and Latin American native peoples.', 81700, '15.0', 516, 97),
('Intercultural/Multicultural and Diversity Studies', 'A program that focuses on the dynamic social relations between and among majority and minority groups and different minority groups, and ways to promote mutual tolerance, inter-group cooperation, and the leadership and management of diverse groups and diversity issues in family, educational, recreational, and work settings.  Includes instruction in ethnic and cultural studies, group psychology, sociology, anthropology, conflict resolution, human services and resources, and applications to various functional environments.', 81700, '15.0', 476, 57),
('Interior Architecture', 'A program that prepares individuals to apply architectural principles in the design of structural interiors for living, recreational, and business purposes and to function as professional interior architects.  Includes instruction in architecture, structural systems design, heating and cooling systems, occupational and safety standards, interior design, specific end-use applications, and professional responsibilities and standards.', 121436, '2.6', 625, 45),
('Interior Design', 'A program in the applied visual arts that prepares individuals to apply artistic principles and techniques to the professional planning, designing, equipping, and furnishing of residential and commercial interior spaces.  Includes instruction in computer applications, drafting, and graphic techniques; principles of interior lighting, acoustics, systems integration, and color coordination; furniture and furnishings; textiles and their finishing; the history of interior design and period styles; basic structural design; building codes and inspection regulations; and applications to office, hotel, factory, restaurant and housing design.', 59202, '4.6', 5983, 377),
('Intermedia/Multimedia', 'A program that prepares individuals creatively and technically to express emotions, ideas, or inner visions in either two or three dimensions, through simultaneous use of a variety of materials and media.', 79031, '7.8', 1435, 93),
('International Agriculture', 'A program that focuses on the application of agricultural management and scientific principles to the problems of global food production and distribution, and to the study of the agricultural systems of other countries.  Includes instruction in agricultural economics; comparative agricultural systems; international agribusiness and law; third-world development studies and economic development; and global applications of climate, soil, water resources, ecological and environmental studies, and animal and plant sciences.', 81277, '4.8', 120, 8),
('International and Intercultural Communication', 'A program that focuses on the specialized knowledge and skills needed for effective communication in the international community and among people of different cultures; and that prepares individuals to function at the national and international levels as journalists, public relations specialists, travel industry representatives, intercultural trainers, and/or foreign service officers.  Includes instruction in journalism, communications, intercultural and international relations, marketing and public relations, and global communications policy.', 63541, '4.4', 249, 25),
('International Business, Trade, and Tax Law', 'An advanced, professional study of the law, policies, and regulations governing transnational business and commercial practices, including the specialized tax law related to international financial transactions.', 136260, '6.0', 262, 12),
('International Business/Trade/Commerce', 'A program that prepares individuals to manage international businesses and/or business operations.  Includes instruction in the principles and processes of export sales, trade controls, foreign operations and related problems, monetary issues, international business policy, and applications to doing business in specific countries and markets.', 124948, '6.3', 9542, 592),
('International Economics', 'A program that focuses on the systematic study and analysis of international commercial behavior and trade policy.  Includes instruction in international trade theory, tariffs and quotas, commercial policy, trade factor flows, international finance and investment, currency regulation and trade exchange rates and markets, international trade negotiation, and international payments and accounting policy.', 110996, '4.3', 463, 42),
('International Finance', 'A program that prepares individuals to manage international financial operations and related currency transactions.  Includes instruction in international banking, international monetary and financial policy, money and capital markets, foreign exchange, risk analysis, and international cash flow operations.', 118450, '8.7', 56, 13),
('International Law and Legal Studies', 'An advanced, professional study of the law affecting relations between nations, the behavior of international organizations, and the international activities of private citizens and organizations.', 136260, '6.0', 590, 28),
('International Marketing', 'A program that prepares individuals to perform marketing activities in enterprises primarily engaged in exporting or importing goods and services in world markets.  Includes instruction in international trade controls, foreign trade operations, locating markets, negotiation practices, monetary issues, and international public relations.', 89805, '15.5', 348, 24),
('International Policy Analysis', 'A program that focuses on the systematic analysis of public policy issues related to relationships among nations and among governments and non-governmental entities. Includes instruction in international politics, governance, financial policy, and security affairs; globalization; economic and social policies of developing nations; and applications to specific public policy topics such as labor and employment, immigration, and human rights.', 91339, '7.8', 101, 11),
('International Public Health/International Health', 'A program that focuses on the application of public health specializations, the social and behavioral sciences, and policy and communications methods to the study of health problems in low- and middle-income countries and regions, and prepares individuals to function as professional international health specialists.  Includes instruction in health education and promotion, research design and evaluation, infectious disease epidemiology, international health policy and management, public nutrition and food security, information systems, program evaluation, medical anthropology, international communication, behavioral sciences, maternal and child health, demography and population policy, and health care finance and economics.', 56690, '12.0', 696, 38),
('International Relations and Affairs', 'A program that focuses on the systematic study of international politics and institutions, and the conduct of diplomacy and foreign policy. Includes instruction in international relations theory, foreign policy analysis, international law and organization, the comparative study of specific countries and regions, and the theory and practice of diplomacy.', 110161, '4.2', 14715, 430),
('International/Global Studies', 'A program that focuses on global and international issues from the perspective of the social sciences, social services, and related fields.', 103210, '-2.0', 7615, 339),
('American Literature (United States)', 'A program that focuses on the literature and literary development, both formal and folkloric, of the United States from the Colonial Era to the present.  Includes instruction in period and genre studies, author studies, literary criticism, and regional and oral traditions.', 71210, '10.0', 40, 9),
('Investments and Securities', 'A program that prepares individuals to manage assets placed in capital markets, and related technical operations.  Includes instruction in security analysis, debt and equity analysis, investment strategies, securities markets, computer-assisted research, portfolio management, portfolio performance analysis, and applications to specific investment problems and business situations.', 98508, '10.7', 330, 25),
('Iranian Languages, Literatures, and Linguistics', 'A program that focuses on the languages used in ancient, medieval, and modern Iran and its border regions, including modern Persian, Avestan/Old Persian, and related modern and extinct languages. Includes instruction in applications of modern Persian and other languages in business, science/technology, and other settings.', 56350, '22.2', 10, 5),
('Irish Studies', 'A program that focuses on the history, society, politics, culture, and economics of Ireland and the Irish Diaspora, from the early Christian period to the present.', 81700, '15.0', 10, 1),
('Ironworking/Ironworker', 'A program that prepares individuals to make and install structural, ornamental, and reinforcing metal structures and supports.  Includes instruction in drafting, technical mathematics, blueprint interpretation, welding, riveting, beam placement, ornamental design, structural reinforcement, crane operation, safety, and applicable codes and standards.', 33930, '-28.0', 174, 8),
('Islamic Studies', 'A program that focuses on Islam as preached by the Prophet Muhammad in 6th century Arabia and subsequently interpreted and elaborated by Islamic scholars and others; together with the cultural and social milieu related to the faith in various periods, localities, and branches.  Includes instruction in Islamic scripture and related written authorities and commentaries', 81700, '15.0', 47, 19),
('Italian Language and Literature', 'A program that focuses on the Italian language and related dialects. Includes instruction in philology; dialects; and applications in business, science/technology, and other settings.', 56350, '22.2', 489, 125),
('Italian Studies', 'A program that focuses on the history, society, politics, culture, and economics of modern Italy and its predecessors on the Italian Peninsula, including the overseas migrations of Italian peoples.', 81700, '15.0', 91, 31),
('Japanese Language and Literature', 'A program that focuses on the Japanese language. Includes instruction in philology; Ancient, Medieval, and Modern Japanese; dialects; and applications to business, science/technology, and other settings.', 56350, '22.2', 939, 112),
('Japanese Studies', 'A program that focuses on the history, society, politics, culture, and economics of the peoples of Japan, and related island groups and coastal neighbors.', 81700, '15.0', 66, 19),
('Jewish/Judaic Studies', 'A program that focuses on the history, culture, and religion of the Jewish people.  Includes instruction in Jewish religious heritage, sacred texts, and law; Jewish philosophy and intellectual history; Jewish life and culture, both in Israel and the Jewish Diaspora; historical Jewish minority cultures such as the Yiddish, Sephardic, and other; anti-Semitism, gentile relations and Shoa; Zionism; and modern developments within Judaism.', 81700, '15.0', 719, 85),
('Journalism', 'A program that focuses on the theory and practice of gathering, processing, and delivering news and that prepares individuals to be professional print journalists, news editors, and news managers.  Includes instruction in news writing and editing; reporting; photojournalism; layout and graphic design; journalism law and policy; professional standards and ethics; research methods; and journalism history and criticism.', 63519, '-2.3', 14324, 469),
('Junior High/Intermediate/Middle School Education and Teaching', 'A program that prepares individuals to teach students in the middle, intermediate or junior high grades, which may include grades four through nine by regulation.', 59774, '6.0', 4192, 371),
('Juvenile Corrections', 'A program that prepares individuals to specialize in the provision of correction services to underage minor populations.  Includes instruction in corrections, juvenile delinquency, juvenile development and psychology, juvenile law and justice administration, social services, record-keeping procedures, and communication skills.', 46214, '5.1', 261, 20),
('American Sign Language (ASL)', 'A program that focuses on American Sign Language as a visual and motor medium of communication and discourse for deaf individuals and deaf culture.  Includes instruction in the development of ASL, ASL morphology and syntax, signing technique, English translation of ASL, formal and colloquial ASL, and ASL transcription.', 48360, '29.0', 614, 60),
('Kindergarten/Preschool Education and Teaching', 'A program that prepares individuals to teach students in formal settings prior to beginning regular elementary school, usually ranging in age from three to six years (or grade one), depending on the school system or state regulations.  Includes preparation to teach all relevant subject matter.', 39088, '6.7', 2434, 157),
('Kinesiology and Exercise Science', 'A scientific program that focuses on the anatomy, physiology, biochemistry, and biophysics of human movement, and applications to exercise and therapeutic rehabilitation.  Includes instruction in biomechanics, motor behavior, motor development and coordination, motor neurophysiology, performance research, rehabilitative therapies, the development of diagnostic and rehabilitative methods and equipment, and related analytical methods and procedures in applied exercise and therapeutic rehabilitation.', 49740, '11.0', 26259, 615),
('Knowledge Management', 'A program that focuses on the study of knowledge management in government agencies and corporations for the purpose of supporting stated organizational goals and objectives, and prepares individuals to function as information resource managers.  Includes instruction in information technology, principles of computer and information systems, management information systems, applicable policy and regulations, and operations and personnel management.', 141000, '15.0', 101, 15),
('Korean Language and Literature', 'A program that focuses on the Korean language. Includes instruction in philology; dialects; and applications to business, science/technology, and other settings.', 56350, '22.2', 70, 9),
('Korean Studies', 'A program that focuses on the history, society, politics, culture, and economics of the peoples of Korea, including related island groups and borderlands.', 81700, '15.0', 7, 3),
('Labor Studies', 'A program that focuses on the study of various aspects of work, labor organization and policy, and labor movements from the perspective of the social sciences and history.  Includes instruction in labor history; political and ideological issues; worker movements and social organizations; civil rights; labor law and policy studies; labor economics; international and comparative labor studies; and applications to specific industries, groups, locations, and time periods.', 60930, '-8.0', 103, 19),
('American/US Law/Legal Studies/Jurisprudence', 'An advanced, professional program of the U.S. legal system, Constitution law, and jurisprudence.  Includes instruction in legal history, legal sociology, philosophy of law, Constitutional law, legal procedure, and related topics.', 136260, '6.0', 472, 34),
('Landscape Architecture', 'A program that prepares individuals for the independent professional practice of landscape architecture and research in various aspects of the field.  Includes instruction in geology and hydrology; soils, groundcovers, and horticultural elements; project and site planning; landscape design, history, and theory; environmental design; applicable law and regulations; and professional responsibilities and standards.', 132640, '2.6', 1554, 87),
('Landscaping and Groundskeeping', 'A program that prepares individuals to manage and maintain indoor and/or outdoor ornamental and recreational plants and groundcovers and related conceptual designs established by landscape architects, interior designers, enterprise owners or managers, and individual clients.  Includes instruction in applicable principles of horticulture, gardening, plant and soil irrigation and nutrition, turf maintenance, plant maintenance, equipment operation and maintenance, personnel supervision, and purchasing.', 48137, '4.9', 1079, 148),
('Language Interpretation and Translation', 'A program that prepares individuals to be professional interpreters and/or translators of documents and data files, either from English or (Canadian) French into another language or languages or vice versa.  Includes intensive instruction in one or more foreign languages plus instruction in subjects such as single- and multiple-language interpretation, one- or two-way interpretation, simultaneous interpretation, general and literary translation, business translation, technical translation, and other specific applications of linguistic skills.', 56350, '22.2', 658, 75),
('Large Animal/Food Animal and Equine Surgery and Medicine', 'A program that focuses on the scientific study of the internal medicine and invasive and noninvasive treatment of herd, work, sport, and food animals.  Includes instruction in equine medicine, swine and dairy medicine, food animal medicine, pathophysiology, large animal diseases, large animal anesthesiology and surgical procedures, preoperative and postoperative care, and specific medical specialties such as dentistry, ophthalmology, oncology, obstetrics/theriogenology, and orthopedics.', 99000, '9.0', 2, 2),
('Laser and Optical Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of optical systems, lasers and related electronic devices.  Includes instruction in wave theory and mechanics, electromagnetic applications, linear and non-linear optics, photon detecting, laser beam properties, directed energy, harmonic generation, optical systems, shielding and the design and implementation of related systems and equipment.', 121643, '3.9', 82, 3),
('American/United States Studies/Civilization', 'A program that focuses on the history, society, politics, culture, and economics of the United States and its Pre-Columbian and colonial predecessors, and including the flow of immigrants from other societies.', 81700, '15.0', 1899, 236),
('Latin American and Caribbean Studies', 'An integrated program that focuses on the history, society, politics, culture, and economics of the peoples and countries of the Latin American and Caribbean region.', 81700, '15.0', 118, 22),
('Latin American Studies', 'A program that focuses on the history, society, politics, culture, and economics of one or more of the Hispanic peoples of the North and South American Continents outside Canada and the United States, including the study of the Pre-Columbian period and the flow of immigrants from other societies.', 81700, '15.0', 991, 173),
('Latin Language and Literature', 'A program that focuses on the Latin language and literature from its origins through its decline and its current ecclesiastical usage, as a secular and/or theological subject.  Includes instruction in philology, related Italic dialects, Late Roman and Medieval Latin, and modern Church Latin.', 60127, '7.2', 114, 97),
('Latin Teacher Education', 'A program that prepares individuals to teach Latin at various grade levels.', 59954, '6.1', 9, 20),
('Law', 'A program that prepares individuals for the independent professional practice of law, for taking state and national bar examinations, and for advanced research in jurisprudence.  Includes instruction in the theory and practice of the legal system, including the statutory, administrative, and judicial components of civil and criminal law.', 132234, '5.8', 40644, 220),
('Law Enforcement Intelligence Analysis', 'A program focusing on the preparation of law enforcement personnel to perform intelligence and surveillance operations and to analyze and use data collected via such operations.  Includes instruction in the intelligence cycle, information sources, data retrieval, digital investigation, financial investigations, document analysis, external sources, geographic information systems, link analysis, operation planning and security, case management, applicable law and regulations, and case preparation.', 77798, '1.6', 38, 4),
('Law Enforcement Investigation and Interviewing', 'A program focusing on the principles, procedures, techniques, legal concerns, and problems associated with a criminal investigation.  Includes instruction in administrative law and procedures, courtroom evidence management and preparation, case presentation and court testimony, description and identification, state and federal criminal law and procedures, informant and suspect rights, officer liability, informant and witness management, victim awareness, tactical interviewing, psychology, criminal investigation methods and procedures, report writing and documentation, investigative techniques, and case management.', 63854, '4.5', 25, 7),
('Lay Ministry', 'A program that prepares non-ordained individuals to serve as lay pastors, religious educators, youth leaders, and other professional positions open to the laity in local churches and other settings. Includes instruction in bible studies, theology, spirituality, pastoral counseling, foundations of ministry, effective communication, and church leadership.', 45160, '4.0', 251, 38),
('Analysis and Functional Analysis', 'A program that focuses on the properties and behavior of equations, multivariate solutions, functions, and dynamic systems.  Includes instruction in differential equations, variation, approximations, complex variables, integrals, harmonic analysis and wavelet theory, dynamic systems, and applications to mathematical physics.', 106984, '9.9', 1, 2),
('Learning Sciences', 'A program that focuses on the multiple aspects of learning in different environments, including specific aspects of the content to be mastered, cognitive aspects of the student, the instructional environment and materials, the preparation and activities of the instructor, socio-cultural and linguistic components, and assessment outcomes. Includes instruction in the social, organizational, and cultural dynamics of learning; learning and cognition; learning strategies; educational psychology; educational testing and measurement; instructional design and technology; and statistical design of educational research.', 72704, '5.0', 110, 19),
('Legal Administrative Assistant/Secretary', 'A program that prepares individuals to serve as legal office managers, special assistants, and legal secretaries.  Includes instruction in office management, secretarial science, principles of U.S. or Canadian law, legal terminology and documentation, legal research, legal software applications, law office procedures, record-keeping, billing, applicable policies and regulations, and professional standards and ethics.', 46470, '-4.0', 847, 247),
('Legal Assistant/Paralegal', 'A program that prepares individuals to perform research, drafting, investigatory, record-keeping and related administrative functions under the supervision of an attorney or court.  Includes instruction in legal research, drafting legal documents, appraising, pleading, courthouse procedures, and legal specializations.', 51964, '6.7', 14977, 806),
('Legal Studies, General', 'A general program that focuses on law and legal issues from the perspective of the social sciences and humanities.', 126230, '22.0', 2585, 118),
('Analytical Chemistry', 'A program that focuses on the scientific study of techniques for analyzing and describing matter, including its precise composition and the interrelationships of constituent elements and compounds.  Includes instruction in spectroscopy, chromatography, atomic absorption, photometry, chemical modeling, mathematical analysis, laboratory analysis procedures and equipment maintenance, and applications to specific research, industrial and health problems.', 98622, '4.6', 35, 6),
('Library and Archives Assisting', 'A program that prepares individuals to assist professional librarians and archivists. Includes instruction in principles, systems, processes, and procedures of library and archive operation; library resources and services; processes of acquisition, cataloging, storage, and display systems; discovery and retrieval of requested materials; and management of books, periodicals, and other documents and records.', 34200, '5.0', 418, 45),
('Library and Information Science', 'A program that focuses on the knowledge and skills required to develop, organize, store, retrieve, administer, and facilitate the use of local, remote, and networked collections of information in print, audiovisual, and electronic formats and that prepares individuals for professional service as librarians and information consultants.', 97450, '3.5', 5540, 87),
('Licensed Practical/Vocational Nurse Training', 'A program that prepares individuals to assist in providing general nursing care under the direction of a registered nurse, physician or dentist.  Includes instruction in taking patient vital signs, applying sterile dressings, patient health education, and assistance with examinations and treatment.', 44030, '16.0', 49925, 1084),
('Lineworker', 'A program that prepares individuals to apply technical knowledge and skills to install, operate, maintain and repair local, long-distance, and rural electric power cables and communication lines; erect and construct pole and tower lines; and install underground lines and cables.  Includes instruction in cable installation and repair, fibre-optic technology, trenching, mobile equipment and crane operation, high-voltage installations, maintenance and inspection, safety, remote communications, and applicable codes and standards.', 65841, '6.2', 1421, 61),
('Linguistics', 'A program that focuses on language, language development, and relationships among languages and language groups from a humanistic and/or scientific perspective.  Includes instruction in subjects such as psycholinguistics, behavioral linguistics, language acquisition, sociolinguistics, mathematical and computational linguistics, grammatical theory and theoretical linguistics, philosophical linguistics, philology and historical linguistics, comparative linguistics, phonetics, phonemics, dialectology, semantics, functional grammar and linguistics, language typology, lexicography, morphology and syntax, orthography, stylistics, structuralism, rhetoric, and applications to artificial intelligence.', 56350, '22.2', 3466, 166),
('Linguistics of ASL and Other Sign Languages', 'A program that focuses on the scientific and scholarly study of the development, structure, and use of American Sign Language (ASL) and other visual signed languages, both as vehicles for communication within the deaf community and in relation to spoken and written languages. Includes instruction in cognitive linguistics; ASL and sign language phonology, syntax, and morphology; sociolinguistics of the deaf community; comparative linguistics; and studies of specific sign languages, including, but not limited to, ASL, Auslan (Australian Sign Language), LSF (French Sign Language), Shuwa jiten (Japanese Sign Language), HamNoSys (German Sign Language), and Gestuno.', 48360, '29.0', 5, 1),
('Anatomy', 'A program that focuses on the scientific study of organ systems, tissue structures, and whole bodies together with their cellular and structural components and dynamics.  Includes instruction in cell biology and histology, structural biology, molecular mechanics, regional and gross anatomy, embryology, neuroanatomy, endocrinology and secretory dynamics, and applications to such topics as aging and disease conditions.', 99539, '7.5', 606, 41),
('Livestock Management', 'A program that focuses on the application of biological and chemical principles to the production and management of livestock animals and the production and handling of meat and other products.  Includes instruction in animal sciences, range science, nutrition sciences, food science and technology, biochemistry, and related aspects of human and animal health and safety.', 64878, '-3.1', 24, 7),
('Locksmithing and Safe Repair', 'A program that prepares individuals to apply technical knowledge and skills to make, repair, maintain, modify, and open locks; to make keys; to enter and change lock and safe combinations; and install and repair safes.', 41270, '-15.0', 33, 3),
('Logic', 'A program that focuses on the systematic study of valid inference, argument, and sound reasoning.  Includes instruction in Classical logic, properties of argument, validity, proof, fallacies, formal and material logic, symbolic and mathematical logic, analysis, specific schools of logic, and applications to problems in other academic disciplines and professional fields.', 106984, '9.9', 19, 4),
('Logistics, Materials, and Supply Chain Management', 'A program that prepares individuals to manage and coordinate all logistical functions in an enterprise, ranging from acquisitions to receiving and handling, through internal allocation of resources to operations units, to the handling and delivery of output.  Includes instruction in acquisitions and purchasing, inventory control, storage and handling, just-in-time manufacturing, logistics planning, shipping and delivery management, transportation, quality control, resource estimation and allocation, and budgeting.', 98453, '0.8', 6650, 262),
('Long Term Care Administration/Management', 'A program that prepares individuals to apply managerial principles to the administration of nursing homes, assisted living facilities, adult day care, home health services, and other long term care settings and agencies serving the elderly and disabled. Includes instruction in social and clinical aspects of aging, health care delivery systems, nursing home administration, assisted living administration, aging policy and government programs, ethics, business management, financial management, human resource management, marketing, and applicable laws and regulations.', 106070, '17.0', 478, 30),
('Machine Shop Technology/Assistant', 'A program that prepares individuals to apply technical knowledge and skills to fabricate and modify metal parts in support of other manufacturing, repair or design activities, or as an independent business.', 39652, '4.9', 3189, 167),
('Machine Tool Technology/Machinist', 'A program that prepares individuals to apply technical knowledge and skills to plan, manufacture, assemble, test, and repair parts, mechanisms, machines, and structures in which materials are cast, formed, shaped, molded, heat treated, cut, twisted, pressed, fused, stamped or worked.', 38108, '-6.6', 4552, 266),
('Magnetic Resonance Imaging (MRI) Technology/Technician', 'A program that prepares individuals who are AART-certified radiological technicians to utilize MRI technology to obtain still and moving images of various vascular structures in the human body that aid the physician in the diagnosis or treatment of disease and injury. Includes instruction in MRI imaging, sectional anatomy and pathology, MRI technology, MRI techniques and procedures, MRI physics, and clinical training.', 68340, '10.0', 319, 42),
('Ancient Near Eastern and Biblical Languages, Literatures, and Linguistics', 'A program that focuses on one or more of the extinct Semitic and/or Non-Semitic languages spoken in the ancient Near East, including those used to write historical Jewish and Christian religious texts. These languages include, but are not limited to, Egyptian/Coptic, Sumerian, Akkadian, Babylonian, Assyrian, Aramaic, Cannanite, Phonecian, Samarian, Ugaritic, Syriac, Mandean, Hattic, Elamite, Hurrian, Hittite, Urartian, Lydian, Luwian, Lycian, Palaic, Sabaean/South Arabian, and other associated languages. Includes instruction in philology, epigraphy, papyrology, numismatics, and textual studies.', 56350, '22.2', 60, 31),
('Make-Up Artist/Specialist', 'A program that prepares individuals to professionally apply cosmetic makeup preparations and perform complete and specialized appearance makeovers including hairdressing, wig work, masking, temporary prosthesis applications, cosmetic applications, and related costuming for leisure or for professional stage, camera, clinical, or security purposes.  Includes instruction in period and contemporary hairstyling and costuming; wig work and hairpiece application; synthetic hair and masks; cosmetic preparations and treatments; makeup artistry; attachment, removal, and camouflaging of prostheses; health and safety; client consultation and care; pre- and post-production operations; set and crew conduct and relations; script, instruction, and prescription interpretation; labor relations; and business practices.', 29099, '10.1', 1382, 32),
('Mammography Technician/Technology', 'A program that prepares registered radiographers to become registered mammographers. Includes instruction in anatomy and physiology, mammography instrumentation, mammography positioning, principles and procedures of mammography, and quality assurance.', 58520, '9.0', 68, 12),
('Management Information Systems, General', 'A program that generally prepares individuals to provide and manage data systems and related facilities for processing and retrieving internal business information; select systems and train personnel; and respond to external data requests.  Includes instruction in cost and accounting information systems, management control systems, personnel information systems, data storage and security, business systems networking, report preparation, computer facilities and equipment operation and maintenance, operator supervision and training, and management information systems policy and planning.', 115007, '4.4', 12678, 620),
('Management Science', 'A general program that focuses on the application of statistical modeling, data warehousing, data mining, programming, forecasting and operations research techniques to the analysis of problems of business organization and performance. Includes instruction in optimization theory and mathematical techniques, data mining, data warehousing, stochastic and dynamic modeling, operations analysis, and the design and testing of prototype systems and evaluation models.', 123425, '7.2', 6366, 155);
INSERT INTO `majors` (`Name`, `Description`, `Average Salary`, `Expected Growth`, `No of Students`, `No of Offering Schools`) VALUES
('Manufacturing Engineering', 'A program that prepares individuals to apply scientific and mathematical principles to the design, development, and implementation of manufacturing systems.  Includes instruction in materials science and engineering, manufacturing processes, process engineering, assembly and product engineering, manufacturing systems design, and manufacturing competitiveness.', 95760, '4.4', 656, 63),
('Manufacturing Engineering Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills to the identification and resolution of production problems in the manufacture of products.  Includes instruction in machine operations, production line operations, engineering analysis, systems analysis, instrumentation, physical controls, automation, computer-aided manufacturing (CAM), manufacturing planning, quality control, and informational infrastructure.', 56320, '-4.0', 3347, 295),
('Marine Maintenance/Fitter and Ship Repair Technology/Technician', 'A program that prepares individuals to apply technical knowledge and skills to repair outboard and inboard engines; test, maintain, and repair steering devices and electrical systems; repair metal, wood, and fiberglass hulls and vessel components; fabricate and maintain sails; and repair and balance propellers and drive shafts.', 39500, '3.0', 907, 47),
('Ancient Studies/Civilization', 'A program that focuses on Western and Non-Western cultures and related topics in the periods of Pre-history and Antiquity.  Includes such disciplines as ancient languages, archeology, history, art history, geography, population studies, environmental studies, religious studies, and the social sciences.', 61120, '2.0', 143, 39),
('Marine Science/Merchant Marine Officer', 'A program that prepares individuals to serve as captains, executive officers, engineers and ranking mates on commercially licensed inland, coastal and ocean-going vessels.  Includes instruction in maritime traditions and law, maritime policy, economics and management of commercial marine operations, basic naval architecture and engineering, shipboard power systems engineering, crew supervision, and administrative procedures.', 82185, '9.5', 4568, 19),
('Marine Sciences', 'A program that focuses on the study of biology, chemistry, geology and physics applied to marine, estuarine and coastal environments.  Includes instruction in marine biogeochemistry, atmosphere and ocean dynamics, coastal ecology, coastal ocean processes, microbial ecology, marine ecosystem modeling, and polar microbiology.', 93649, '6.4', 198, 17),
('Maritime Studies', 'A program that focuses on the history, science, policy issues, and literature of the ocean. Includes instruction in maritime history, maritime law, maritime literature, oceanography, maritime security, and maritime politics.', 61120, '2.0', 21, 2),
('Marketing Research', 'A program that prepares individuals to provide analytical descriptions of consumer behavior patterns and market environments to marketing managers and other business decision-makers.  Includes instruction in survey research methods, research design, new product test marketing, exploratory marketing, consumer needs and preferences analysis, geographic analysis, and applications to specific products and markets.', 89284, '15.4', 199, 28),
('Marketing/Marketing Management, General', 'A program that generally prepares individuals to undertake and manage the process of developing consumer audiences and moving products from producers to consumers.  Includes instruction in buyer behavior and dynamics, principle of marketing research, demand analysis, cost-volume and profit relationships, pricing theory, marketing campaign and strategic planning, market segments, advertising methods, sales operations and management, consumer relations, retailing, and applications to specific products and markets.', 102964, '12.0', 40889, 1061),
('Marriage and Family Therapy/Counseling', 'A program that prepares individuals for the independent professional practice of marriage and family therapy, involving the diagnosis of cognitive, affective, and behavioral domain disorders, both mental and emotional, within the context of marriage and family systems and the application of short- and long-term therapeutic strategies in family group contexts.  Includes instruction in psychotherapy, family systems and studies, small group intervention and therapy, marital problems, depression, identification of psychopathologies and behavioral disorders, holistic health care, practice management, applicable regulations, and professional standards and ethics.', 67603, '15.5', 3370, 149),
('Mason/Masonry', 'A program that prepares individuals to apply technical knowledge and skills in the laying and/or setting of exterior brick, concrete block, hard tile, marble and related materials, using trowels, levels, hammers, chisels, and other hand tools. Includes instruction in technical mathematics, blueprint reading, structural masonry, decorative masonry, foundations, reinforcement, mortar preparation, cutting and finishing, and applicable codes and standards.', 63572, '10.7', 508, 71),
('Ancient/Classical Greek Language and Literature', 'A program that focuses on the Greek language and literature from its origins through the fall of the Byzantine (Eastern Roman) Empire, as a secular and/or theological subject. Includes instruction in philology, Attic and Hellenistic dialects, Koine (Biblical) Greek, and Medieval or Byzantine Greek.', 56350, '22.2', 37, 59),
('Mass Communication/Media Studies', 'A program that focuses on the analysis and criticism of media institutions and media texts, how people experience and understand media content, and the roles of media in producing and transforming culture.  Includes instruction in communications regulation, law, and policy; media history; media aesthetics, interpretation, and criticism; the social and cultural effects of mass media; cultural studies; the economics of media industries; visual and media literacy; and the psychology and behavioral aspects of media messages, interpretation, and utilization.', 62941, '-2.1', 11611, 369),
('Massage Therapy/Therapeutic Massage', 'A program that prepares individuals to provide relief and improved health and well-being to clients through the application of manual techniques for manipulating skin, muscles, and connective tissues.  Includes instruction in Western (Swedish) massage, sports massage, myotherapy/trigger point massage, myofascial release, deep tissue massage, cranio-sacral therapy, reflexology, massage safety and emergency management, client counseling, practice management, applicable regulations, and professional standards and ethics.', 90267, '20.0', 19910, 711),
('Master Aesthetician/Esthetician', 'A program that prepares individuals to massage and treat the face, neck, and body with advanced chemical and cosmetic preparations and esthetic medical treatments, and to function as licensed master or medical estheticians in dermatologists'' and plastic surgeons'' offices as well as in salons and spas. Includes instruction in advanced anatomy and physiology, skin properties and disorders, sanitation and infection control, advanced facial treatments, spa body treatments, advanced extractions, corrective makeup, chemical peels, microdermabrasion, lymphatic drainage and advanced massage techniques, pre- and post-operative esthetic skin care, client/patient evaluation and care, applicable laws and regulations, and business practices.', 35300, '12.0', 891, 46),
('Materials Chemistry', 'A program that focuses on the synthesis and study of organic or inorganic materials and their electronic, magnetic, optical or mechanical properties. Includes instruction in advanced materials for photonics, lasers, chemical sensors and arrays or nanochemistry; semiconductor nanowires; and molecular electronics.', 98472, '4.5', 41, 4),
('Materials Engineering', 'A program that prepares individuals to apply mathematical and materials science principles to the design, development and operational evaluation of materials and related processes used in manufacturing in a wide variety of settings; the synthesis of new industrial materials, including marrying and bonding composites; analysis of materials requirements and specifications; and related problems of system design dependent on materials factors.', 99762, '6.1', 3028, 99),
('Materials Science', 'A program that focuses on the general application of mathematical and scientific principles to the analysis and evaluation of the characteristics and behavior of solids, including internal structure, chemical properties, transport and energy flow properties, thermodynamics of solids, stress and failure factors, chemical transformation states and processes, compound materials, and research on industrial applications of specific materials.', 134001, '3.9', 506, 47),
('Maternal and Child Health', 'A program that focuses on the application of public health specializations, public policy studies, and the social and behavioral sciences to issues of health affecting women, children, and families; and prepares individuals to function as maternal and child health specialists.  Includes instruction in research design and testing, program evaluation, public policy analysis, public finance, economics of health care, community health, family development and dynamics, women''s studies, social psychology, fetal and child development, biostatistics, health education and promotion, nutrition, neonatal development, psychology, and social services delivery.', 49159, '13.4', 236, 16),
('Maternal/Child Health and Neonatal Nurse/Nursing', 'A program that prepares registered nurses to provide prenatal care to pregnant women and to mothers and their newborn infants.  Includes instruction in perinatal and newborn health assessment, stabilization, and care; pathophysiology of pregnancy, fetuses, and the newborn; clinical management of high-risk pregnancies and newborns; perinatal and neonatal technology and clinical procedures; and patient education.', 72443, '16.9', 267, 28),
('Mathematical Biology', 'A program that focuses on the application of mathematics to genomics, molecular modeling, structural biology, ecology, evolutionary biology and systems of analysis of neurobiology, physiology, and metabolism.  Includes instruction in computational mathematics, chaos and nonlinear systems, perturbation methods, evolutionary biology, molecular biology, bioinformatics, and neurobiology.', 100284, '7.6', 21, 6),
('Mathematical Statistics and Probability', 'A program that focuses on the mathematical theory underlying statistical methods and their use.  Includes instruction in probability theory parametric and non-parametric inference, sequential analysis, multivariate analysis, Bayesian analysis, experimental design, time series analysis, resampling, robust statistics, limit theory, infinite particle systems, stochastic processes, martingales, Markov processes, and Banach spaces.', 86507, '21.6', 387, 12),
('Mathematics, General', 'A general program that focuses on the analysis of quantities, magnitudes, forms, and their relationships, using symbolic logic and language.  Includes instruction in algebra, calculus, functional analysis, geometry, number theory, logic, topology and other mathematical specializations.', 65751, '7.1', 26967, 1484),
('Mathematics and Computer Science', 'A program with a general synthesis of mathematics and computer science or a specialization which draws from mathematics and computer science.', 96821, '3.0', 349, 75),
('Mathematics and Statistics', 'A program with a general synthesis of mathematics and statistics or a specialization which draws from mathematics and statistics. Includes instruction in calculus, linear algebra, numerical analysis and partial differential equations, discrete mathematics, probability theory, statistics, computing, and other related topics.', 103220, '15.4', 132, 18),
('Mathematics Teacher Education', 'A program that prepares individuals to teach mathematics programs at various educational levels.', 60623, '6.4', 3874, 593),
('Meat Cutting/Meat Cutter', 'A program that prepares individuals to receive, cut, and package animal meat products in commercial establishments and to function as licensed meat cutters/butchers.  Includes instruction in product recognition for beef, veal, lamb, pork, poultry, and fancy and smoked meats; retail and wholesale cutting and specialty cuts; packaging and counter display; shop safety; meat sanitation, storage and rotation; quality control; meat handling laws and regulations; and customer service.', 29273, '2.8', 28, 4),
('Mechanical Drafting and Mechanical Drafting CAD/CADD', 'A program that prepares individuals to apply technical knowledge and skills to develop working drawings and electronic simulations in support of mechanical and industrial engineers, and related professionals.  Includes instruction in manufacturing materials and processes, mechanical drafting, electrode-mechanical drafting, basic metallurgy, geometric dimensioning and tolerancing, blueprint reading, and technical communication.', 56610, '-7.0', 1288, 162),
('Mechanical Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of physical systems used in manufacturing and end-product systems used for specific uses, including machine tools, jigs and other manufacturing equipment; stationary power units and appliances; engines; self-propelled vehicles; housings and containers; hydraulic and electric systems for controlling movement; and the integration of computers and remote control with operating systems.', 96731, '5.2', 35730, 363),
('Mechanical Engineering/Mechanical Technology/Technician', 'A program that prepares individuals to apply basic engineering principles and technical skills in support of engineers engaged in the design and development phases of a wide variety of projects involving mechanical systems.  Includes instruction in principles of mechanics, applications to specific engineering systems, design testing procedures, prototype and operational testing and inspection procedures, manufacturing system-testing procedures, test equipment operation and maintenance, and report preparation.', 56390, '2.0', 3686, 231),
('Mechatronics, Robotics, and Automation Engineering', 'A program that prepares individuals to apply mathematical and scientific principles to the design, development and operational evaluation of computer controlled electro-mechanical systems and products with embedded electronics, sensors, and actuators; and which includes, but is not limited to, automata, robots and automation systems. Includes instruction in mechanical engineering, electronic and electrical engineering, computer and software engineering, and control engineering.', 121643, '3.9', 239, 27),
('Medical Administrative/Executive Assistant and Medical Secretary', 'A program that prepares individuals to perform the duties of special assistants and personal secretaries for practicing physicians and nurses, health care facilities and services administrators, and other health care professionals.  Includes instruction in business and medical communications, medical terminology, principles of health care operations, public relations and interpersonal communications, software applications, record-keeping and filing systems, scheduling and meeting planning, applicable policy and regulations, and professional standards and ethics.', 33044, '22.6', 13438, 547),
('Medical Anthropology', 'A program that focuses on biological, socio-cultural, psychological, and behavioral factors as they relate to health, illness, medical practices, and access to health care services. Includes instruction in ethno-medicine, urban health, international health, psychiatric and psychological anthropology, aging, and health and identity.', 109991, '4.1', 50, 2),
('Medical Illustration/Medical Illustrator', 'A program that prepares individuals to apply the principles and techniques of art and computer-assisted imaging, graphics, and animation to create visual materials to facilitate the recording and dissemination of biomedical knowledge for educational, research, and clinical purposes.  Includes instruction in anatomy, physiology, pathology, histology, embryology, neuroanatomy, medical terminology, artistic media and techniques, illustration techniques, three-dimensional modeling, prosthetics, data display design, exhibit design and production, medical photography, multimedia, computer graphics and animation, digital imaging, business management, production technology, and instructional design.', 54170, '3.0', 96, 8),
('Medical Informatics', 'A program that focuses on the application of computer science and software engineering to medical research and clinical information technology support, and the development of advanced imaging, database, and decision systems.  Includes instruction in computer science, health information systems architecture, medical knowledge structures, medical language and image processing, quantitative medical decision modeling, imaging techniques, electronic medical records, medical research systems, clinical decision support, and informatics aspects of specific research and practice problems.', 99175, '15.2', 894, 90),
('Animal Behavior and Ethology', 'A program that focuses on the scientific study of the psychological and neurological bases of animal sensation, perception, cognition, behavior, and behavioral interactions within and outside the species.  Includes instruction in ethology, behavioral neuroscience, neurobiology, behavioral evolution, cognition and sensory perception, motivators, learning and instinct, hormonal controls, reproductive and developmental biology, community ecology, functional behavior, and applications to specific behaviors and patterns as well as to specific phyla and species.', 64230, '4.0', 142, 11),
('Medical Insurance Coding Specialist/Coder', 'A program that prepares individuals to perform specialized data entry, classification, and record-keeping procedures related to medical diagnostic, treatment, billing, and insurance documentation.  Includes instruction in medical records and insurance software applications, basic anatomy and physiology, medical terminology, fundamentals of medical science and treatment procedures, data classification and coding, data entry skills, and regulations relating to Medicare and insurance documentation.', 33955, '21.8', 12616, 637),
('Medical Insurance Specialist/Medical Biller', 'A program that prepares individuals to perform and manage the medical and health insurance operations in a medical office, health care facility, health maintenance organization, or insurance provider.  Includes instruction in health and medical insurance processes; health insurance law, policy, and regulations; insurance records and paperwork administration; insurance office administration; health/medical insurance software applications; personnel supervision; business mathematics; billing and collection procedures; medical terminology; and communications skills.', 34330, '21.0', 11052, 300),
('Medical Microbiology and Bacteriology', 'A program that focuses on the scientific study of pathogenic bacteria that are significant factors in causing or facilitating human disease.  Includes instruction in the pathogenesis of bacterial diseases, bacterial genetics and physiology, bacterial anatomy and structure, antigens, bacterial reproduction, bacterial adhesion, phagocytes, and the identification of new or mutated bacteria and bacterial agents.', 102994, '5.2', 798, 53),
('Medical Office Assistant/Specialist', 'A program that prepares individuals, under the supervision of office managers and other professionals, to perform routine administrative duties in a medical, clinical, or health care facility/system office environment.  Includes instruction in general office skills, data processing, office equipment operation, principles of medical record-keeping and business regulations, medical/clinical office procedures, and communications skills.', 33044, '22.6', 9429, 429),
('Medical Office Computer Specialist/Assistant', 'A program that prepares individuals to apply computer programming, troubleshooting, and information technology skills to the installation, maintenance, and upgrade of standard, customized, or proprietary medical software and associated hardware.  Includes instruction in computer programming, systems analysis, networking, telecommunications, medical records and informatics software applications, information technology, systems administration, computer security, and applicable regulations and certifications or licenses.', 62998, '6.0', 372, 25),
('Medical Office Management/Administration', 'A program that prepares individuals to manage the specialized business functions of a medical or clinical office.  Includes instruction in business office operations, business and financial record-keeping, personnel supervision, medical and health care policy administration, conference planning, scheduling and coordination, public relations, and applicable law and regulations.', 56170, '8.0', 4788, 233),
('Medical Radiologic Technology/Science - Radiation Therapist', 'A program that prepares individuals to administer prescribed courses of radiation treatment, manage patients undergoing radiation therapy, and maintain pertinent records.  Includes instruction in applied anatomy and physiology, oncologic pathology, radiation biology, radiation oncology procedures and techniques, radiation dosimetry, tumor localization, treatment planning, patient communication and management, data collection, record-keeping, and applicable standards and regulations.', 85232, '13.8', 6153, 339);
